INSERT INTO `scholarships_scholarship` VALUES (1,'ScholFin Diwali Scholarship','ScholFin',10,0,0,0,'2015-11-11 20:03:03','You should apply for this scholarship before the midnight of Diwali. Applications received after midnight of Diwali (12 November) won\'t be accepted.',0,0,0,0,'Top 10 winners of the scholarship will be awarded FREE notebooks. Notebooks will be delivered to your address at Nagpur FREE of cost!',0,0,'2015-07-27 20:03:03',0,'You should be a student studying in Nagpur.\r\n','ScholFin Diwali scholarship is an effort to award FREE notebooks to students of Nagpur. This scholarship is a small effort to bring down the expenses on stationery items thus reducing the cost of education. ','Click on the Apply button and fill the application form.','CIVN conference room,\r\nLibrary 3rd floor,\r\nVNIT,\r\nNagpur - 440010.\r\nPhone: +91-9167333093\r\nEmail-ID: thescholfin@gmail.com','/apply/ScholFin-Diwali-Scholarship/',' ','ScholFin Diwali scholarship is an effort to award FREE notebooks to students of Nagpur. This scholarship is a small effort to bring down the expenses on stationery items.','ScholFin Diwali scholarship 2015-16','http://blog.scholfin.com/ultimate-guide-vnit-alumni-scholarship-scholfin/','',5,2,0),(2,'Foundation for Social Care Scholarship','Foundation for Social Care(FSC)',200,0,0,0,'1994-05-05 12:48:42','Deadline details are not mentioned so you are advised to contact the Trust for updated deadlines.',2,0,0,27000,' ',0,0,'2015-07-28 12:48:42',1,'Undergraduate, Post-Graduate and Ph.d students are eligible.','FSC is a public charitable trust working from the historic city Lucknow, the state capital of Uttar Pradesh, since 1994. Foundation for Social Care Scholarship is for undergraduate,post-graduate and Ph.D students with 200 scholarship winners to be awarded.','Since the Organisation has no online application, Hence it is advised for students to call the trust to know about the application process.\r\n','Hnorary Director\r\nFSC Scholarship Programme \r\nA58/3 Shahin Bag\r\nJamia Nagar \r\nNew Delh - 110025\r\n\r\nEmail: fscscholarship@yahoo.co.in\r\nTele.: +9415016531\r\nMobile :9935859534','http://www.fscwecare.org/scholarship_programme.html',' ','Foundation for Social Care Scholarship 2015 is for undergraduate,post-graduate and Ph.D students with 200 scholarship winners .Let\'s fill the form and apply.','Foundation for Social Care Scholarship 2015- Scholfin','','',0,0,0),(3,'G.P. Birla Educational Foundation Scholarship',' G.P. Birla Educational Foundation',50,0,0,0,'2015-07-15 15:11:21',' ',0,2,4,50000,'Scholarship amount will be to cover Tuition Fees and Hostel Fees, [where applicable], subject to a ceiling of Rs. 50,000/- per student per year.',0,0,'2015-07-28 15:11:21',2,'The Trust proposes to grant Scholarships to meritorious students, male or female, from West Bengal, who have in the year 2015, passed class XII examination and have secured 80% marks or more from State Board or 85% or more from Central Board or have secured rank in top 15000 in AIEEE/JEE/AIPMT Tests and are in need of financial help to pursue further studies.','The Trust has been established to carry forward the cherished dream of Late Shri G. P. Birla, the renowned Industrialist and Philanthropist, to promote education, develop human resources and empower the youth of the Country.\r\nG.P. Birla Educational Foundation Scholarship  is for students who have passed XII examination in 2015 and are from West Bengal.',' Students who meet the above criteria of merit, and need financial assistance for pursuing further studies, may apply in the prescribed Proforma.Applications may be forwarded through the Head of the Institution from which the Student has passed Class XII or where he has taken admission to  “G.P. Birla Educational Foundation, 1582, Rajdanga Main Road, Southend Conclave, 4 Floor, Kolkata – 700 107”.',' G.P. Birla Educational Foundation\r\n\r\nAttn: Radha Tamal Goswami / Anil Kumar Sharma\r\n1582 Rajdanga Main Road,\r\nSouthend Conclave,\r\n4th Floor,\r\nKolkata-700107\r\n\r\nPhone No: 033-24414542 / 24414456\r\nEmail : office@gpbirlaedufoundation.com','http://gpbirlaedufoundation.com/download.html',' ','G.P. Birla Educational Foundation Scholarship is for students who have passed XII examination in 2015 and are from West Bengal.Let\'s fill the form and apply now.','G.P.Birla Educational Foundation Scholarship 2015-Scholfin ',' ','',0,0,0),(4,'Gaurav Foundation Scholarship ','Gaurav Foundation',0,0,0,0,'2015-11-25 15:11:21','Last Date to Purchase the Application Form - 10th November 2015. \r\nLast Date to Submit the Main Application Form with Documents - 25th November 2015',0,0,0,0,'Tuition and academic fees.',0,0,'2015-07-28 15:11:21',0,'1 Must be an Indian and must not hold any other Countries Passport.\r\n2 Min. Age 11 years and Max. Age 35 years\r\n3 Min. 60% in all Exams (since school days)','Gaurav Foundation provides Scholarships to bright students to pursue studies. Gaurav Foundation Scholarship  is for Indian students who wish to pursue higher education in India and abroad.Dealine-11th November.','1. For members : To Request the Scholarship Application Form - Quote your Annual Membership ID (given by GAURAV FOUNDATION), Scholarship for India or Abroad, along with your Name, Date of Birth & Gender and sent it to contact@gauravfoundation.org .\r\n\r\n2. For non-members : Scholarship Application Form will cost Rs. 1500/- for Non Annual Members.You can get the request form on the website.','G-107, Vidyasagar Oswal Garden,\r\n210-212, Cochrane Basin Road,\r\nKorukkupet, Chennai – 600021\r\nTamil Nadu, INDIA.\r\n\r\nEmail id: contact@gauravfoundation.org\r\nPhone: 09840538638','http://www.gauravfoundation.org/scholarship.html',' ','Gaurav Foundation Scholarship is for Indian students who wish to pursue higher education in India and abroad.Dealine-11th November.Let\'s fill the form and apply now.','Gaurav Foundation Scholarship 2015 - Scholfin',' ','',0,0,0),(5,'Aakash National Talent Hunt Scholarship ANTHE- Junior','Aakash Coaching Classes ',450,0,0,0,'2015-11-11 15:11:21','Exam Date:                22nd November, 2015 (Sunday)\r\nTimings:                        10:30 A.M. to 12:30 P.M.\r\nLast Date of Application :   11th November, 2015 (Wednesday)\r\nResult Declaration Date:    9th December, 2015 (Wednesday)\r\nExamination Fee:        200/- (Including Service Tax)',0,0,0,20000,'Free coaching and cash prizes for top 150 students of every class',0,2,'2015-07-28 15:11:21',3,'Class VII, VIII & IX studying students','Aakash National Talent Hunt examination aims to enable the young students to achieve their goal of becoming top professionals by providing them with free coaching. ANTHE (Junior) 2015 will select top 450 students (150 students each from class VII, VIII & IX) to give them this once-in-a-lifetime opportunity. These students will get free coaching from Aakash worth 2.35 crores. The examination will be held at various centres spread across the country.','1. You can fill the application form Online as well as Offline by submitting it to the nearest center. \r\n2. Offline scholarship application form can be downloaded from the website.\r\n3. You can also apply online by clicking on the Apply button.','Aakash Tower, Plot No-4, Sector 11, \r\nDwarka, New Delhi-110075\r\nPh No: (011)-39454545, 47623456\r\nFax No: (011) 47623472\r\nEmail: medical@aesl.in, iitjee@aesl.in, info.afs@aesl.in \r\nTOLL-FREE NO : 1800-102-2727 \r\n                        1800-180-2727\r\n','http://www.aakash.ac.in/anthe/','http://www.aakash.ac.in/download-anthe-admission-form','Aakash National Talent Hunt Junior Scholarship provides free coaching for students of class 7, 8 and 9 for medical and engineering studies.Let\'s fill the form and apply','Aakash National Talent Hunt Junior Scholarship 2015-Scholfin',' ','',0,0,0),(6,'GE Foundation Scholarship','GE Foundation ',0,0,0,0,'2015-02-28 15:11:21','1. In the year 2015,2nd February was the last date of submitting completed applications.\r\n2. 2nd February ,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,2,2,2000,'1.Opportunity to interact with GE Business Leaders and to understand the R&D culture of a major engineering company\r\n2.Participation in GE Foundation Scholar-Leaders activities, including a specially designed leadership development seminar\r\n3.Participation in community development projects',1,0,'2015-07-28 15:11:21',0,'Students of 2nd Year from following universities are eligible to apply: \r\n\r\n1. VIT University, Vellore – Biomedical Engineering\r\n2. Tezpur University, Assam – Food Engineering and Technology, Mechanical Engineering\r\n3. IIT, Gandhinagar- Mechanical Engineering\r\n4. BITS, Pilani – Mechanical Engineering, Computer Science and Engineering\r\n5. MIT, Manipal – Mechanical Engineering','The GE Foundation Scholar-Leaders Program began in 1987 in Mexico and has grown to support outstanding students in higher education in fourteen countries around the world.\r\nGE Foundation Scholarship  is for Engineering students from VIT, Tezpur University, IIT Gandhinagar, Bits Pilani and MIT.','1.) You should Register on the through the website and should submit your application online.','Ms. Preetika Sachar\r\nInstitute of International Education (IIE) India\r\nJ-19, Hauz Khas Enclave, New Delhi – 110016, India\r\nEmail: iieindia@iie.org\r\nPhone: +91 11 46631430',' http://scholarshipandmore.org/india/apply/','http://scholarshipandmore.org/india/faq/','GE Foundation Scholarship is for Engineering students from VIT, Tezpur University, IIT Gandhinagar, Bits Pilani and MIT.Let\'s fill the form and apply now.','GE Foundation Scholarship 2015 - Scholfin','','',0,0,0),(7,'Aakash National Talent Hunt  Scholarship ANTHE- Senior','Aakash Coaching Classes ',300,0,0,0,'2015-11-11 15:11:21','Exam Date:                 22nd November, 2015 (Sunday)\r\nTimings:                          10:30 A.M. to 12:30 P.M.\r\nResult Declaration Date:  8th December, 2015 (Tuesday)\r\nLast Date of Application  11th November, 2015 (Wednesday)\r\nExamination Fee:         300/- (Including Service Tax)',0,0,0,40000,'Free coaching and cash prizes',0,2,'2015-07-28 15:11:21',3,'Students studying in class 10th and interested in engineering and medical field','Aakash National Talent Hunt Senior Scholarship helps class 10th students by providing free coaching for engineering and medical fields. There are several cash prizes for top 150 rankers from Rs 40,000 to Rs 6,000.','1. You can apply through offline application as well as online application.\r\n2. Download offline form given on the website.\r\n3. For submitting Online application, click on APPLY button. ','Aakash Tower, Plot No-4, Sector 11, Dwarka, New Delhi-110075\r\nPh No: (011)-39454545, 47623456\r\nFax No: (011) 47623472\r\nEmail: medical@aesl.in, iitjee@aesl.in, info.afs@aesl.in\r\nTOLL FREE NO :\r\n1800-102-2727 \r\n1800-180-2727','http://www.aakash.ac.in/anthe/','http://www.aakash.ac.in/sites/default/files/anthe-senior-2015-admission-form-medical.pdf','Aakash National Talent Hunt Junior Scholarship provides free coaching for students of class 10 for medical and engineering studies.Let\'s fill the form and apply  ','Aakash National Talent Hunt Senior Scholarship 2015 - Scholfin ',' ','',0,0,0),(8,'GIIS Global Citizen Scholarship','Global Schools Foundation',0,0,0,0,'2016-06-25 15:11:21','1. In the year 2015, 25th June was the last date of submitting completed applications.\r\n2. 25th June ,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,0,0,0,' ',0,0,'2015-07-28 15:11:21',0,'1.) Students of Class 9th and 10th students with A1 grade in all subject or having 90% aggregate are eligible to apply','Global Schools Foundation offers the GIIS Global Citizen Scholarship to deserving candidates as a stepping stone for future growth by providing them an unparalleled learning experience at its flagship campus in Queenstown, Singapore','1.) You should download the application form from the given website and should attached the following documents with it:\r\n\r\n1.Class 10 final exam mark sheet\r\n2.Class 9 final exams mark sheet\r\n3.Four (4) passport-size photographs\r\n4.Extra-curricular achievements; and\r\n5.Curriculum Vitae  \r\n\r\n2.) You should send the application form to address mentioned below: \r\n\r\nProgramme Manager, \r\nGIIS Global Citizen Scholarship,Global Indian International School, \r\nPlot No. D-5, Sector-71, Noida 201301 Uttar Pradesh,India.','Write directly at http://www.globalindianschool.org/scholarships/#About',' http://www.globalindianschool.org/scholarships/#About',' ','GIIS Global Citizen Scholarship is for Class 9th and 10th students with A1 grade in all subject or having 90% aggregate.Let\'s fill the form and apply now.','GIIS Global Citizen Scholarship 2015 - Scholfin','','',0,0,0),(10,'The Human Welfare Foundation (HWF) Scholarship','The Human Welfare Foundation (HWF)',0,0,0,0,'2014-08-31 15:11:21','Deadline details are not mentioned so you are advised to contact the Trust for updated deadlines.',0,0,0,15000,' ',0,0,'2015-07-28 15:11:21',4,'Academically meritorious and financially needy young students to pursue undergraduate or postgraduate studies ','The foundation runs various scholarship programs for different age groups to help them support their education. The beneficiaries of these scholarships include school students, under graduates/post graduates, orphans and IAS aspirants.','Procedure details are not mentioned so you are advised to contact the Trust on the given contact detail.',' Mailing Address\r\n\r\nHuman Welfare Foundation \r\nE89-4th Floor, Hari Kothi Lane \r\nAbul Fazal Enclave, Jamia Nagar \r\nOkhla, New Delhi-110025\r\n\r\n+91-11 29945999\r\nEmail: info@hwfindia.org\r\n          hwfindia@gmail.com','http://www.hwfindia.org/education/scholarships',' ','The Human Welfare Foundation (HWF) is for school students, under graduates/post graduates, orphans and IAS aspirants..Let\'s fill the form and apply now.','The Human Welfare Foundation Scholarship 2015 - Scholfin','','',0,0,0),(11,'INTERNATIONAL ALUMNI ASSOCIATION OF SHRI MAHAVIRA JAIN VIDYALAYA- Graduate Scholarship Loan','INTERNATIONAL ALUMNI ASSOCIATION OF SHRI MAHAVIRA JAIN VIDYALAYA',0,0,0,0,'2015-09-01 17:24:59','1. In the year 2015, 1st September was the last date of submitting completed applications.\r\n2. 1st September,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,0,0,2000,' ',1,0,'2015-07-28 17:24:59',1,'1.)Students belonging to Jain category who have secured admission in USA for higher studies are eligible to apply. ','This program entails awarding a one-time loan scholarship of up to $ 2000.00 to bright and needy Jain students arriving in USA for further studies in order to help them tide over initial financial problems on start up. This is a interest free loan scholarship ','1. You should download the application form from the website.\r\n\r\n2. You should submit the application form along with the documents required to the address mentioned on website.\r\n','Mr. Keyur Gandhi,  Scholarship Committee,  IAAMJV, Inc.\r\n24 River Road, Unit #1, Clifton, NJ 07014\r\nPhone No. 973-723-4817\r\nEmail – icc_gc@hotmail.com  \r\n','http://www.iaamjv.org/scholarship-loan-forms',' ','INTERNATIONAL ALUMNI ASSOCIATION OF SHRI MAHAVIRA JAIN VIDYALAYA- Graduate Scholarship Loan is for Jain who gets admission in USA.Let\'s fill the form and apply.','SHRI MAHAVIRA JAIN  INTERNATIONAL SCHOLARSHIP 2015- Scholfin','','',0,0,0),(12,'Aga Khan Foundation International Scholarship ','Aga Khan Foundation',0,0,0,0,'2016-03-20 17:24:59','1. In the year 2015, 29th June was the last date of submitting completed applications.\r\n2. 29th June,2016 date is expected date. You should check the page again in the month of August-September for up