 scholarships, while each Management institute can have a maximum of 2 scholarships.',0,0,'2015-07-28 17:24:58',2,'1. Engineering Institutes:\r\nFirst three Toppers of 2nd, 3rd and 4th year based on the academic performance in the previous years (CGPA) of the following streams are eligible:\r\n\r\nCivil Engineering\r\nElectrical Engineering\r\nMechanical Engineering\r\nMetallurgical Engineering\r\n\r\n2. Management Institutes\r\nFirst 10 toppers of 2nd year are eligible based on the academic performance in the first year of regular PGDM/ MBA.\r\n\r\n3. List of Participating Institutes\r\na. Engineering Institutes\r\nIIT - DelhiIIT - Kanpur IIT - Roorkee IIT BHU - Varanasi NIT - Allahabad MNIT - Jaipur NIT - Kurukshetra BITS - Pilani IIT - Mumbai NIT - Nagpur SVNIT – Surat NIT - Durgapur IIT - Guwahati IIT - Kharagpur ISM - Dhanbad NIT - Jamshedpur NIT - Rourkela OPJIT-Raigarh NIT - Raipur IIT - Chennai NIT - Suratkal NIT - Trichy NIT - Warangal Delhi College of Engineering\r\n\r\nb. Management Institutes\r\nFMS - Delhi MDI - Gurgaon Jindal Global Business School IIM - Lucknow IIM - Ahmedabad IIM - Indore XLRI - Jamshedpur SP Jain Institute of Management & Research IIM - Bangalore IIM - Calcutta IIM Kozhikode IIM - Ranchi IIM - Raipur IIM - Rohtak JBIMS - Mumbai IIFT- Delhi','O. P. JINDAL ENGINEERING & MANAGEMENT SCHOLARSHIPS  is awarded to students of India\'s premier engineering and management institutes. The scholarship consists of an Online test followed by a personal interview.','You should inquire the institute itself for notify for the application process. ','Mobile No: +91 9313531621\r\nE-mail : opjems.jindalstainless@gmail.com','http://www.opjems.com/frmRegistration_form.aspx',' ','O. P. JINDAL ENGINEERING & MANAGEMENT SCHOLARSHIPS OPJEMS are for students of Engineering (IIT, NIT) and management MBA institutes. Lets fill the form and apply now!','O.P.Jindal Engineering & Management Scholarship 2015- ScholFin',' ','',0,0,0),(64,'Sanskriti – Prabha Dutt Fellowship ','Sanskriti Foundation',0,0,0,0,'1994-05-05 17:24:59','1.) You can apply for this scholarships throughout the year. ',3,0,0,100000,'The duration of the Fellowship will be Ten months. A grant of Rs. 1,00,000 will be given in two phases; the first installment at the commencement of the award and the second after submission of the completed project. A progress report will be required after the first four months.',0,0,'2015-07-28 17:24:59',3,'1.The Fellowship is only open to women who are Indian Nationals in the age group of 25 to 40.\r\n\r\n2.It is exclusively for print journalists. \r\n\r\n3.The Fellows will be required to publish a stipulated number of articles in established publications. The Fellow may work on a book or monograph for subsequent publication within the given time frame.','The Prabha Dutt Fellowship in Journalism financially support & encourage young women who wish to investigate and research on any topic of contemporary relevance. ','1.You should send your CV and a write up of approximately 500 words explaining their project.\r\n\r\n2.You should send your samples of previous work, project or performances along with your personal contact details.\r\n\r\n3.You should send your Application to the address mentioned on website. ','Sanskriti Foundation  \r\nC-11, Qutab Institutional Area  \r\nNew Delhi-110 016   \r\n  \r\nPhones: 91 11 2696 3226, 2652 7077  \r\nFax: 91 11 2685 3383  \r\nEmail: info@sanskritifoundation.org ','http://www.sanskritifoundation.org/prabha-dutt-fellowship.htm',' ','Sanskriti – Prabha Dutt Fellowship is for exclusively for Graduate print journalists in the age group of 25 to 40.Let\'s fill the form and Apply Now!','Sanskriti – Prabha Dutt Fellowship 2015 - ScholFin','','',0,0,0),(65,'Pratibha Scholarship Programme STARS Kerala ','Kerala Government',100,0,0,0,'2015-09-15 17:24:59','1. In the year 2015, 15th September was the last date of submitting completed applications.\r\n2. 15th September,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,2,3,60000,'B.Sc. Degree Course/ First 3 years of Integrated M.Sc. course\r\n\r\n1st Year  - Rs. 12,000/-\r\n2nd Year - Rs. 18,000/-\r\n3rd Year - Rs. 24,000/-\r\n\r\nM.Sc. Course *\r\n\r\n1st Year/ 4th Year of Integrated M.Sc. - 40,000/-\r\n2nd Year/ 5th Year of Integrated M.Sc. - 60,000/-',0,1,'2015-07-28 17:24:59',1,'1. 90% or equivalent grade for all subjects and minimum 95% aggregate marks or equivalent grade for all science subjects for the Higher secondary Board Examination\r\n\r\n2. Secured admission for B.Sc. /Integrated M.Sc. courses in Basic or Natural Science in any of the Institutions or Universities in India.','Pratibha Scholarship Programme STARS is awarded to students who have qualified Higher Secondary Board Examination from Kerala and are pursuing B.Sc. / Integrated M.Sc. courses in Basic / Natural sciences anywhere in India.','1.You should Download the application application form from the website.\r\n\r\n2.You should send the application form to the address mentioned on the website.','Email : wsdkscste@gmail.com  \r\nTel: 0471-2548208/ 2548346','http://kscste.kerala.gov.in/index.php/programmes-initiatives/h-r-development-in-s-t/pratibha-scholarship',' ','Pratibha Scholarship Programme STARS Kerala is for  Undergraduate Postgraduate B.Sc. /Integrated M.Sc. courses in Basic or Natural Science. Lets fill the form and apply n','Pratibha Scholarship Programme STARS Kerala 2015 - ScholFin',' ','',0,0,0),(66,'Mani Mann Fellowship- Classical Music ','Sanskriti Foundation',0,0,0,0,'1994-05-05 17:24:58','1. In the year 2015,5th May was the last date of submitting completed applications.\r\n2. 5th May,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. \r\n',3,0,0,100000,'The duration of the Fellowship will be one year. The grant of Rs. 100,000 will be given in two phases; the first installment at the commencement of the award and the second installment after the submission of your complete project report when the candidate may be requested to give a vocal recital.',0,0,'2015-07-28 17:24:58',0,'1.The Fellowship is only open to Indian Nationals in the age group of 25 to 40.\r\n\r\n2.The applicant must hold a degree/diploma from a recognized university or institution in the field and/or the candidate should have at least ten years of initial training in Indian classical music. \r\n\r\n3.The fellow would be required to have given at least 2-3 solo performances to his/her credit in recognized forums.\r\n','Mani Mann Fellowship - in Hindustani Classical Music is awarded to young musicians to study and learn under the tutelage of an acclaimed guru of Indian Classical Music.','1.You should send your CV/Resume.\r\n\r\n2.You should send your samples of previous work, project or performances along with your personal contact details.\r\n\r\n3.You should send your Application to the address mentioned on website. \r\n\r\n','Sanskriti Foundation  \r\nC-11, Qutab Institutional Area  \r\nNew Delhi-110 016   \r\n  \r\nPhones: 91 11 2696 3226, 2652 7077  \r\nFax: 91 11 2685 3383  \r\nEmail: info@sanskritifoundation.org ','http://www.sanskritifoundation.org/Mani-Mann-Fellowship.htm',' ','Mani Mann Fellowship- Classical Music is for young musicians to study and learn Classical Music in the age group of 25 to 40.Let\'s fill the form and Apply Now!','Mani Mann Fellowship- Classical Music 2015 - ScholFin',' ','',0,0,0),(67,'Kerala Science Research Scheme (SRS) ','Kerala Government',0,0,0,0,'2015-07-28 17:24:59','1. In the year 2015, 28th July was the last date of submitting completed applications.\r\n2. 28th July,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,0,0,300000,'1. Rs. 30 lakh for three years excluding overheads.\r\n\r\n2. The host institution will be eligible for an overhead @ 10% of total expenditure subject to a ceiling of Rs.1.5   lakh.\r\n\r\n3. Paid for specific projects to cover expenditure on acquisition of equipment, laboratory supplies, cost of books and periodicals, publication of research papers, cost on internal travels including participation in scientific conferences/symposia or for any other specific purpose.\r\n\r\n4. Paid for specific projects to cover expenditure on Manpower, Consumables, Equipment, Travel, Contingencies and Institutional over head.',0,1,'2015-07-28 17:24:59',0,'Scientists and Technologists working in S&T institutions/academic institutions in the state on R&D projects with particular relevance to scientific/research work.','Kerala State Council of Science Technology and Environment offers Science Research Scheme to provide financial assistance to scientists and researchers for projects.','1.You should download the application form and send it to the mentioned address.','KERALA STATE COUNCIL FOR SCIENCE TECHNOLOGY AND ENVIRONMENT\r\nSasthra Bhavan, Pattom,\r\nThiruvananthapuram 695004\r\nKerala, INDIA.\r\nTel: ++91 + 471 2548200\r\nFax: ++91 + 471 2540085\r\nE-mail: kscste@gmail.com','http://kscste.kerala.gov.in/index.php/programmes-initiatives/h-r-development-in-s-t/science-research-scheme-srs',' ','Kerala Science Research Scheme provides financial assistance of Rs 30 lakhs to Scientists, technologists and Research students. Lets fill the form and apply now. ','Kerala Science Research Scheme 2015 - ScholFin',' ','',0,0,0),(68,'KERALA STATE YOUNG SCIENTIST AWARD','Kerala Government',0,0,0,0,'2015-10-31 17:24:58','31st October,2015 is the last date of submitting completed applications',0,1,3,45000,'1. Project grants to eligible scientists upto Rs 30 Lakhs for three years.\r\n2. Young Scientists will be provided monthly emoluments of Rs 35,000/-per month for fresh PhD’s, Rs 40,000/- per month for fellows with 3 years research/industrial experience after PhD.\r\n3. Rs 45,000/-per month for fellows with 5 years research/industrial experience after PhD.',0,1,'2015-07-28 17:24:58',1,'1. Applicants (under the age of 40 years and 45 years in the case of woman candidates on the date of application) of Indian citizens\r\n2. Candidates of Indian origin who have a PhD Degree in any branch of Science from a recognized University, with research interest in the subject area chosen and should have at least two research publications in peer-reviewed journals indexed in leading database.','Young Scientist Scheme is  for nurturing and mentoring young researchers in Kerala  for fulfilling long-term career goals in science, technology and related domains. These Young Scientists will be eligible for Rs 30 Lakhs project grant.','1. Send your Letter of Intent (Download from website). \r\n2. Completed LoIs (nomination through host institution) shall be forwarded to The Executive Vice President, Kerala State Council For Science, Technology and Environment, Sasthra Bhavan, Pattom, Thiruvananthapuram -695 004. \r\n3. A copy should also be sent by e-mail to: verghesekurienyss@gmail.com.','KERALA STATE COUNCIL FOR SCIENCE TECHNOLOGY AND ENVIRONMENT\r\nSasthra Bhavan, Pattom,\r\nThiruvananthapuram 695004\r\nKerala, INDIA.\r\nTel: ++91 + 471 2548200\r\nFax: ++91 + 471 2540085\r\nE-mail: kscste@gmail.com','http://kscste.kerala.gov.in/index.php/programmes-initiatives/h-r-development-in-s-t/young-scientist-scheme',' ','Verghese Kurien Young Scientist Fellowship Kerala is for Research & PhD students with a stipend of Rs 45000pm and grant of 35 lakhs. Lets fill the form and apply now.','Verghese Young Scientist Fellowship Kerala 2015 - ScholFin','http://www.scholfin.com/scholarship-details/Verghese-Kurien-Young-Scientist-Fellowship/','',0,0,0),(69,'Kalakriti Fellowship- Indian Classical Dance ','Sanskriti Foundation',0,0,0,0,'1994-05-05 17:24:59','1.) You can apply for this scholarships throughout the year. ',3,0,0,50000,' ',0,0,'2015-07-28 17:24:59',3,'1.The Fellowship is only open to Indian Nationals in the age group of 25 to 40.\r\n\