jects. ','1.You should send your CV to respected authority.\r\n\r\n2.Priority will be given to such proposals which traces and advances the relevance of Geddes’ ideas and work The project proposal should be written in 1500 words with reference to the specific city /section/mohalla.\r\n\r\n3.The names and contact addresses/telephones of two referees should also be sent. The application should bear the title ‘Sanskriti – Geddes Scholarship ’ on the envelope if sent by post on head office address and in the subject line if e-mailed on fellowships@sanskritifoundation.org','Sanskriti Foundation  \r\nC-11, Qutab Institutional Area  \r\nNew Delhi-110 016   \r\n  \r\nPhones: 91 11 2696 3226, 2652 7077  \r\nFax: 91 11 2685 3383  \r\nEmail: info@sanskritifoundation.org ','http://www.sanskritifoundation.org/Geddes-Fellowship.htm',' ','Geddes Scholarship- Town Planning and Architecture is for graduate/postgraduate/research level students in the age group of 25 to 40.Let\'s fill the form and Apply Now!','Geddes Scholarship-Town Planning & Architecture 2015 - ScholFin',' ','',0,0,0),(72,'Post Doctoral Fellowship Kerala ','Kerala Government',10,0,0,0,'2015-07-28 17:24:59','1. In the year 2015,28th July was the last date of submitting completed applications.\r\n2. 1st October,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,1,2,25000,'An annual contingent grant of Rs.50,000/- and 10% H.R.A p. m also will be granted to the PD Fellows.',0,1,'2015-07-28 17:24:59',4,'1. Candidate should be a Keralite by birth / domicile.\r\n\r\n2. Candidates should possess a Ph.D degree in Science or Engineering, at the time of application.\r\n\r\n3. Candidates should have published at least one research paper in a Science Citation Indexed Journal (SCI- journal) or one patent.\r\n\r\n4. Age should not be more than 40 years as on 1st January of the current year.','Post Doctoral Fellowship Kerala is awarded to Ph.D stuents of Science and Engineering for full time research work in relevant areas for 2 years.','You will be notified in the form of advertisement in newspapers.','KERALA STATE COUNCIL FOR SCIENCE TECHNOLOGY AND ENVIRONMENT\r\nSasthra Bhavan, Pattom,\r\nThiruvananthapuram 695004\r\nKerala, INDIA.\r\nTel: ++91 + 471 2548200\r\nFax: ++91 + 471 2540085\r\nE-mail: kscste@gmail.com','http://kscste.kerala.gov.in/index.php/programmes-initiatives/h-r-development-in-s-t/post-doctoral-fellowship',' ','Post Doctoral Fellowship Kerala for Ph.D stuents of Science and Engineering for research work.Duration- 2 years.Stipend-25000pm. Lets fill the form and apply now!','Post Doctoral Fellowship Kerala 2015 - ScholFin ',' ','',0,0,0),(73,'Madhobi Chatterji Memorial Fellowship-Music and Dance ','Sanskriti Foundation',0,0,0,0,'1994-05-05 17:24:59','1. In the year 2015,5th May was the last date of submitting completed applications.\r\n2. 5th May,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,0,0,100000,' ',0,0,'2015-07-28 17:24:59',0,'1.It is open to all Indian Nationals from any genre of Indian Classical Music (Vocal or Instrumental) or Dance (any form or choreography).\r\n\r\n2.The fellow would be required to have given at least 2-3 solo performances to his/her credit.','The Sanskriti Pratishthan with Smt Madhobi Chatterji Memorial Fellowship in Indian Classical Music and Dance from supports young artists who wish to contribute towards enriching the art form. ','1.Candidates should send a two – page CV, a CD of their recitals and a write up of approximately 500 words explaining their project. The project proposal should explain how the fellowship will provide an opportunity to express their creativity and technical competence and expand the repertoire of their style.\r\n \r\n2.Full postal and telephonic contact details together with any E-mail id should be submitted to facilitate contact. Few samples of previous work, project or performances should be submitted. The names and contact addresses/telephones of two referees should also be sent. \r\n\r\n3.The application should bear the title ‘Sanskriti – Madhobi Chatterji Memorial Fellowship’ on the envelope when sent by post.','Sanskriti Foundation  \r\nC-11, Qutab Institutional Area  \r\nNew Delhi-110 016   \r\n  \r\nPhones: 91 11 2696 3226, 2652 7077  \r\nFax: 91 11 2685 3383  \r\nEmail: info@sanskritifoundation.org ','http://www.sanskritifoundation.org/Madhobi-Chatterji-Memorial.htm',' ','Madhobi Chatterji Memorial Fellowship- Music and Dance is for any genre of Indian Classical Music (Vocal or Instrumental) or Dance (any form or choreography).','Madhobi Chatterji Fellowship- Music & Dance 2015 - ScholFin',' ','',0,0,0),(74,'MESCO High Cost Educational Scholarship Scheme ','MESCO',168,0,0,0,'1994-05-05 17:24:59','1. In the year 2015,5th May was the last date of submitting completed applications.\r\n2. 5th May,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',1,0,0,0,'During the last year the HCES provided loans to a value of 69.36 lacs to 168 students.',0,0,'2015-07-28 17:24:59',1,'Financial help is given to students (who are deserving and academically bright) for professional courses.','The HCES programme provides financial support to students by offering loans to a value of 69.36 lacs to 168 students, of which 22 were Medical students, 108 Degree in Engineering, 12 Diploma in Engineering, 13 Professional Graduation, 3 Professional Post Graduation, 1 Business Management, 4 CA. 3 B.Ed. and 2 D.Ed.','Note:The above trust does not have a website and the details are not listed clearly anywhere. The given below procedure is a general process to apply for a Trust Scholarship. \r\n\r\n1.You should send a letter to the trust mentioning the reason to opt for scholarship enclosing documents like:\r\n  \r\n   a.Marksheet of 10th,12th till the last degree.\r\n   b.Parental Income certificate.\r\n   c.Letter of admission of University.\r\n   d.Identification Proof.\r\n   e.An envelope with your residential address written on it along with a stamp of Rs25.\r\n\r\n2.You are advised to contact the trust and confirm the same. Contact details are given in the contact column.','G-2, New Udyog Mandir-2, Mogul Lane, Behind Johnson and Johnson, Tulsi Pipe Road, Mahim (West), Near Mahim station, \r\nMumbai-400016. \r\nPhones: (+9122) 24441442 / (+9122) 24448637 Fax: (+9122) 24448637\r\nE-mail: mescotrust@mescotrust.org / mescotrust@yahoo.co.in','http://www.mescotrust.org/content/mesco%E2%80%99s-educational-support-programmes',' ','MESCO High Cost Educational Scholarship Scheme 2015 is for Medical, Engineer, Diploma, Post Graduate, Business Management, CA, B.Ed. and D.Ed students.','MESCO High Cost Educational Scholarship 2015 - ScholFin',' ','',0,0,0),(75,'EU & The Hindu Centre Essay Writing Competition ','the European Union Delegation to India, in collaboration with The Hindu Centre for Politics and Public Policy',3,0,0,0,'2015-08-16 17:24:59',' ',0,0,0,0,'1.Three winners will be invited for a short study tour to Europe.(Four days)\r\n2.The winners\' trip will be a group tour scheduled so as not to interfere with exams. While individual constraints will be considered, their acceptance cannot be guaranteed.\r\n3.Winning essays will be published on the print and digital media of the organisers with the names of the authors.',0,2,'2015-07-28 17:24:59',0,'1.The essay competition is open to students studying for an undergraduate (Bachelor\'s) degree or graduate (Master\'s) degree in a recognized institution of higher education whether public or private.M.Phil and Ph.D students are not eligible to take part in the competition.\r\n2.The participant must be an Indian resident, aged 18 or older','Providing a platform for people to \'Voice Out\' their concerns and come out with possible solutions, the European Union Delegation to India, in collaboration with The Hindu Centre for Politics and Public Policy, has announced the launch of an essay competition on climate change in India. ','1.Essays (1,500 words in English) should be submitted before August 16, 2015, on one of the following three topics:\r\na.Climate Change in India: Challenges and Solutions\r\nb.Making India\'s Growth Sustainable\r\nc.Clean Development in India: the Way Forward for Towns and Cities\r\n2.The format should be as follows: single line between paragraphs, single spacing between lines of a paragraph, and 12 point Times New Roman font.\r\n3.These essays are to be submitted on both the following Email-IDs : \r\n-thc@thehinducentre.com\r\n-DELEGATION-INDIA-PRESS@eeas.europa.eu','Kasturi Buildings \r\n859 & 860, Anna Salai \r\nChennai \r\nTamil Nadu \r\nIndia 600 002\r\nPhone : +91-44-28524445 and +91-44-28538155\r\nFax : +91-44-28415325\r\nEmail : thc@thehinducentre.com\r\n','http://www.thehinducentre.com/events/article7318300.ece',' ','EU & The Hindu Centre Essay Writing Competition 2015  is for undergraduate (Bachelor\'s) degree or graduate (Master\'s) degree students with minimum 18 years of age.','EU & The Hindu Centre Essay Writing Competition 2015 - ScholFin',' ','',0,0,0),(76,'JBNSTS Junior Talent Search Test ','Jagadis Bose National Science Talent Search Kolkata',0,0,0,0,'2015-08-17 17:24:58','JBNSTS Junior Scholarship test will be conducted on September 27, 2015 and the last date to apply for the scholarship test is August 17, 2015.',0,1,2,500,'1.Rs.1000 will be given to students as one time book grant.\r\n2.The Scholars selected for the scholarship will get exposure to seminars, projects, scientific workshops and colloquia.',0,0,'2015-07-28 17:24:58',3,'1.You should be domiciled resident of West Bengal.\r\n2.You should have cleared class 10 exams with at least 75%in the year 2015.\r\n3.For class 11th you should be enrolled in science stream with any 3 subjects out of Mathematics, Chemistry, Computer Science, Physics, Statistics or Biology.','Jagadis Bose National Science Talent Search (JBNSTS), Kolkata is an Autonomous Registered Society under West Bengal Society Registration Act XXI of 1860.The JBNSTS Junior Scholarship Test is conducted to identify and enhance the scientific talent of the students enrolled in Science stream during Class 11 & 12 and is considered to be one of the most reputed Scholarships of the country.','OFFLINE Application :-\r\n1.Download the application form from the website. \r\n2.Information about documents to be attached are given in the form itself.\r\n3.You need to deposit the examination fee of Rs.100 by the means of Bank draft drawn in the favor of ‘Jagadis Bose National Science Talent Search’ payable at Kolkata.\r\n4.Submit the form by sending it to : \r\n         Jagadis Bose National Science Talent Search\r\n         1300 Rajdanga Main Road,\r\n         Kasba, Kolkata-700 107.\r\n\r\nONLINE Application :-\r\n1.Fill the form on the given website.\r\n2.Upload the required documents asked in the form.\r\n3.Pay the examination fee of Rs100 by credit card/ debit card/ net banking or by the means of SBI Challan.','JAGADIS  BOSE NATIONAL SCIENCE TALENT SEARCH\r\n1300, Rajdanga Main Road\r\nKolkata - 700 107\r\nWest Bengal, INDIA\r\nPhone : +91 33 2442 8270 / 8269 & 2441 7542 \r\nFax :+91 332442 8267\r\nEmail : : jbnsts@jbnsts.org','http://www.jbnsts.org/index.php',' ','JBNSTS Junior Talent Search Test 2015 is for Class 11th students enrolled in 2015 in science stream from West Bengal.Let\'s fill the form and Apply now!','JBNSTS Junior Talent Search Test 2015 - ScholFin',' ','',0,0,0),(77,'MigrantHeroes Smartphone Film Competition ','International Organization for Migration',12,0,0,0,'2015-08-17 17:24:58','The 5th OISFF will be held on the following schedule\r\n\r\nSubmission : Jul 1 - Aug 17, 2015\r\nPreliminary Selection : Aug 21 - Aug 24, 2015\r\nFinalist Announcement : Sep 1, 2015 (announcement on festival homepage)\r\nJury Selection : Sep 1 - Sep 8',0,0,0,10000000,'a.Official Awards\r\n1.olleh Grand Prize : Prize money of 10,000,000KRW (1 film only among all competitive categories)\r\n2.Best Short under 10Min : Prize money of 5,000,000KRW\r\n3.Best Director - Shorts under 10Min : Prize money of 4,000,000KRW\r\n4.Jury Prize - Shorts under 10Min : Prize money of 3,000,000KRW\r\n5.Best Extreme Short under 1Min : Prize money of 2,000,000KRW\r\n6.Jury Prize - Extreme Shorts under 1Min : Prize money of 1,000,000KRW\r\n7.Best Feature-length Film: Prize money of 5,000,000KRW\r\n\r\nb.Special Jury Prize\r\n1.Best Documentary : Prize money of 2,000,000KRW\r\n2.Media Art Prize(AAF) : Prize money of 2,000,000KRW\r\n\r\nc.Other Special Awards\r\n1.Youth Prize : Prize money of 1,000,000KRW and smart device\r\n2.Migrant Heroes Prize(IOM) : Prize money of 2,000,000KRW\r\n3.Pikicast Award(Audience Award) : Smart device',4,0,'2015-07-28 17:24:58',0,'1.There are no special restrictions on eligibility; either individual or group participation is possible.\r\n','For the variety and fairness of the festival, 5th OISFF divides the Official Awards competition into the following sections: \r\n-Shorts under 10Min (dom./intl.): The films between 10 min. to 1 min. 1sec., (1:01-10:00) including ending credits.   \r\n-Extreme Shorts under 1Min (dom./intl.): The films less than 1 min., (0:01-1:00) including ending credits.\r\n-Feature-length Films (dom./intl.): The films longer than 50 min. (50:00+), including ending credits.','1.Fill the online form on the official website.\r\n2.Upload the Movie file (h.264 Codec / mov, mp4, wmv / less than 500MB in case of 10min and 1min section)\r\n3.Stills / Proof photo that the film was shot using smartphone.\r\n4.For Feature-length film submissions, please fill out the entry form and send the film file through your personal cloud service (ex. dropbox or google drive) with photo of the film and proof photo that the film was shot using smartphone. You can write down your download link in entry form or send the link to admin@ollehfilmfestival.com.','Contact Number : +82-(0)10-7201-0201\r\nEmail-ID : admin@ollehfilmfestival.com','http://www.ollehfilmfestival.com/5th/eng/contest/submission_competition.php',' ','MigrantHeroes Smartphone Film Competition 2015 is for class 1-12, Undergraduate, Post-Graduate, Diploma video-making students.Let\'s fill the form and Apply now!','MigrantHeroes Smartphone Film Competition 2015 - ScholFin',' ','',0,0,0),(78,'Global Youth Video Competition on Climate Change ','UNFCCC, UNDP-SGP and tve',2,0,0,0,'2015-08-17 17:24:59',' ',0,0,0,0,'1.Round trip to COP21/CMP11 in Paris, France from 30 November to 11 December 2015 (inclusive of accommodation and other expenses); and\r\n\r\n2.Position as a youth reporter for COP21/CMP11, responsible for assisting UNFCCC Newsroom team with videos, articles and social media posts.',0,2,'2015-07-28 17:24:59',0,'1.You should belong to age group of 18-30 years.','The UN Framework Convention on Climate Change has teamed up with tve to launch a video competition for the best youth climate projects happening around the globe.','1.Make a three-minute film about the action you are involved in to combat climate change.\r\n\r\n2.Complete your entry using our online form and send us the film before 23.00 GMT 17 August 2015. The videos may be recorded in any language, but English subtitles must be provided.','Email-ID : biomovies@tve.org.uk','http://www.tvebiomovies.org/globalyouth.php',' ','Global Youth Video Competition on Climate Change 2015 is for class 1-12, Undergraduate, Post-Graduate, Diploma video-making students.Let\'s fill the form and Apply now!','Global Youth Video Competition 2015 - ScholFin',' ','',0,0,0),(79,'TVE Biomovies Short Film Competition ','UNFCCC, UNDP-SGP and tve',2,0,0,0,'2015-08-17 17:24:59',' ',0,0,0,1500,'Funding of US$300 will be paid to the selected three finalists in each category, only on successful receipt of their completed films.',1,2,'2015-07-28 17:24:59',0,'Open to all','We have two categories for you to choose from. In each one we will commission three films to be made. The completed films will be shown on YouTube and the one in each category which has the most views will win US$1500!','1.Select one of the two categories : \r\n-The European Bank for Reconstruction and Development Green Economy Prize\r\n-The International Year of Soils 2015 Prize.\r\n2.Then think on some ideas how will you make a short film on that topic and send you proposal through online form given on the website before 17th August.','Email-ID : biomovies@tve.org.uk','http://www.tvebiomovies.org/categories.php#categories',' ','TVE Biomovies Short Film Competition 2015 is for class 1-12, Undergraduate, Post-Graduate, Diploma video-making students.Let\'s fill the form and Apply now!','TVE Biomovies Short Film Competition 2015 - ScholFin',' ','',0,0,0),(80,'10th National biennial competition ','National Innovation Foundation, India',20,0,0,0,'2017-05-31 17:24:59','The last date for the 10th National Biennial Competition is March 31, 2017. Entries received after this date will be included in the 11th National Biennial Competition 2017-19.',0,0,0,30000,'1. Prizes worth Rs 30,000, 25,000 and Rs 20,000 for the best three entries and \r\n2. Several consolation prizes of Rs 10,000 each.',0,2,'2015-07-28 17:24:59',1,'1. Students till Class 12th.\r\n2. The ideas and innovations should be unsupervised, an outcome of their own creativity, without any support from their teachers or outsiders.','NATIONAL INNOVATION FOUNDATION (NIF), a grant-in-aid institute under the Department of Science and Technology, Government of India rewards students (till class 12th) who have an outstanding innovation or idea.','You may send as many entries as per your wish on a plain paper mentioning:\r\n\r\n1. Technical details of the idea/innovation/traditional knowledge practice along with sketches, photos or videos wherever available/necessary \r\n2. Genesis of idea/innovation or traditional knowledge \r\n3. Your Educational qualification (mention your class and school name)\r\n4. Complete postal address with pin code and contact number(s) and \r\n5. Any other information that may seem necessary\r\n\r\nSend these to the following address:\r\n\r\nNational Coordinator (Scouting and Documentation)\r\nNational Innovation Foundation\r\nSatellite Complex, \r\nBungalow No 1, Premchandnagar Road , Jodhpur Tekra, \r\nAhmedabad 380015 Gujarat.\r\nEmail: campaign@nifindia.org','Satellite Complex,\r\nJodhpur Tekra, Near Mansi crossroad\r\nAhmedabad, Gujarat, India.\r\nPin : 380015,\r\nTele: + 91 079 26753501, +91 079 2673 2095 / 2456,\r\nFax : + 91 079 26731903,\r\nE–Mail : info@nifindia.org\r\nFor Innovation/Ideas:- sd@nifindia.org, campaign@nifindia.org, ignite@nifindia.org','http://nif.org.in/biennial_competition',' ','10th National biennial competition 2015 is for students till class 12th with unaided ideas and innovations. Prize-Rs25,000. Lets fill the form and apply now!','10th National Biennial Competition 2015- ScholFin',' ','',0,0,0),(81,'CBSE Heritage India Quiz ','Central Board of Secondary Education',16,0,0,0,'2015-08-18 17:24:58',' ',0,0,0,21000,'1.First Prize - Rs 21,000 x 1 team = Rs 21,000\r\n2.Second Prize - Rs 12,000 x 1 team = Rs 12,000   \r\n3.Third Prize - Rs 7,500 x 1 team = Rs 7,500\r\n4.Fourth Prize - Rs 4,500 x 1 team = Rs 4,500\r\n5.Second Position (Semi-final) - Rs 3,000 x 4 teams = Rs 12,000\r\n6.Third Position (Semi-final) - Rs 1,500 x 4 teams = Rs 6,000\r\n7.Fourth Position (Semi-final) - Rs 1,000 x 4 teams = Rs 4,000',0,1,'2015-07-28 17:24:58',0,'1.Any Class 9-12 students can apply.\r\n2.Three students per school are allowed to participate.\r\n3.Schools have to register three students as a team.','The objective of the year- long CBSE Heritage Quiz, supported by the Central Board of Secondary Education, aims to inform the\r\ngrowing generation of students the inter-link between their culture and heritage and the need for sustainable socio-economic\r\ndevelopment alongside modernization. In continuation with Circular No. Acad-23/2014, as in the previous years, the Heritage India\r\nQuiz would also include 25% questions on the Cultural Practices and Heritage of the North Eastern States of India. ','1.Schools have to get registered by filling the form online.\r\n2.They have to draw a DD of Rs. 600 in favour of “The Secretary, CBSE, Delhi”. On the backside of the DD, schools have to write their school name, affiliation number and the registration number obtained from the website with a HB pencil.','Tel: 011-23212603 \r\nFax: 011-23234324\r\nE-mail: directoracad.cbse@nic.in\r\n\r\nMr. Sandeep Sethi, Education Officer\r\nPhone: 011- 23217128\r\nE-mail: eo_ss@cbseacademic.in.','http://49.50.126.244/web_material/Circulars/2015/43_circular_Registration_form.pdf',' ','CBSE Heritage India Quiz 2015 is for Class 9-12 students where School needs to register maximum 3 students as a team.Let\'s fill the form and Apply now!','CBSE Heritage India Quiz 2015 - ScholFin',' ','',0,0,0),(82,'Write India Times of India ','Times Internet',0,0,0,0,'2015-09-30 17:24:59','1. This is a monthly competition.\r\n2. Entries will be accepted from 7th of every month till the 30th of the month',0,0,0,0,'1. There are total 11 authors in this campaign. Each month one of the designated \'Author of The Month\' will share a preface with your story.\r\n2. For 11 months, every month a \'Winner of the Month\' will be awarded a Kindle. :-)\r\n3. All the 11 winners will attend a unique Writers Camp in Diu and be mentored by some authors from the preeminent panel.',0,2,'2015-07-28 17:24:59',0,'Anyone who has a interest in story writing','Write India is a collaborative writing initiative by Times Internet, which will have a set of 11 celebrity authors writing the preface of short stories. These prefaces will be later opened to public for completion. Every month they will select one winner from the entries received with the help of the \'Celebrity Author of the Month\'.','1. E-mail your stories to writeindia@timesinternet.in\r\n2. You can also upload your stories by clicking on APPLY button. (Apply button>>Question 4)','Email : writeindia@timesinternet.in\r\nTel : 0120-6776999\r\nExt : 7292 (Gunjan Verma)\r\n        7291 (Kalpana Sharma)','http://timesofindia.indiatimes.com/life-style/books/writeindia/aboutcampaign/46795568.cms',' ','Write India Times of India is a story writing competition open to everyone. You will get a kindle and a trip to DIU free. Let\'s fill the form and apply now! ','Write India Times of India 2015 - ScholFin',' ','',0,0,0),(83,'UIA HYP International Competition in Architectural Design ','Union International des Architecsts (UIA)',12,0,0,0,'2015-08-20 17:24:58','REGISTRATION DEADLINE: August 20, 2015 \r\nSUBMISSION DEADLINE: August 31, 2015 ',0,0,0,100000,'1st Prize (1 team) - Certificate and 100,000 RMB \r\n2nd Prize (3 teams) - Certificate and 30,000 RMB \r\n3rd Prize (8 teams) - Certificate and 10,000 RMB\r\n\r\nHonorable Mentions (20 teams) : \r\n- Certificate and 6-month free subscription of UED magazine\r\n- Advisors of prize-winning projects will also be awarded with certificates;\r\n- Prize winners will have an opportunity to intern at prestigious architectural firms through the “Learning Design with Master Architects” program.',5,2,'2015-07-28 17:24:58',0,'1.This competition is open all Graduate and Ph.D Architecture students around the globe to participate as an individual or as a team.\r\n2.Maximum team size limit is 4.','2015 marks the fourth edition of UIA-HYP Cup International Student Competition in Architectural Design, the sole annual international architecture competition for students in mainland China that receives the support of Union International des Architectes (UIA). It is a platform for global architecture students to approach the theme “architecture in transformation”, and for the rest of the world to check out the latest trend of Chinese architectural education.','1.You need to register on the we