mmy award and an HDFlipCam!\r\n2. All nominees will win a chance to The One Minutes Jr./IDFA Masterclass in Amsterdam to be held in November. ',0,2,'2015-07-28 17:24:59',3,'You must be between 12-20 years of age to participate in this competition.','The three categories of the competition 2015 are:\r\n\r\n1.Open category: One minute of freedom\r\n60 seconds of absolute freedom to say what you wish on any topic you are interested in.\r\n\r\n2.Thematic category: Inside-out\r\nSometimes we all feel like we belong, and other times we feel left out. This can be a choice we make or something that happens against our will. Make a one-minute telling your experience, your opinion.\r\n\r\n3.Personal category: Self-portrait\r\nWho are you? What do you stand for? What are your dreams, fascinations, fears, hopes and passions? Where do you come from? What do you see around you? Say who you are in your own way. ','If you want to apply ONLINE: \r\n1. Fill the application form given on the official website and print it.\r\n2. Upload your videos on theoneminutes.wetransfer.com\r\n3. Email your application form to anja@theoneminutes.org\r\n\r\nIf you want to apply OFFLINE: \r\nSend your application form along with a DVD containing your entry to the following address: \r\n\r\nThe One Minutes foundation\r\nAnja Masling\r\nc/o Sandberg Institute\r\nFred. Roeskestraat 98\r\n1076 ED Amsterdam\r\nThe Netherlands\r\nTel : +31 20 5882401','The One Minutes foundation\r\nAnja Masling\r\nc/o Sandberg Institute\r\nFred. Roeskestraat 98\r\n1076 ED Amsterdam\r\nThe Netherlands\r\nTel : +31 20 5882401','http://www.theoneminutesjr.org/?thisarticle=44',' ','The One Minutes Jr. Competition 2015 is for Class 7-12th and Undergraduate students interested in Video-Making contest.Let\'s fill the form and Apply now!','The One Minutes Jr. Competition 2015 - ScholFin',' ','',0,0,0),(105,'RD Sethna Scholarship for Studies in India & Abroad ','RD SETHNA SCHOLARSHIP FUND',0,0,0,0,'2015-08-31 17:24:59','1. In the 