Examination 2015- ScholFin',' ','',0,0,0),(112,'Dr. Ambedkar National Essay Competition 2015 ','Dr. Ambedkar Foundation',12,0,0,0,'2015-08-31 13:06:54',' ',0,0,0,100000,'For both languages Hindi and English, winners among the COLLEGE students will be awarded as follows:\r\n1st Prize : Rs 1,00,000\r\n2nd Prize : Rs 50,000\r\n3rd Prize : Rs 25,000\r\n\r\n\r\nFor both languages Hindi and English, winners among the SCHOOL students will be awarded as follows:\r\n1st Prize : Rs 25,000\r\n2nd Prize : Rs 15,000\r\n3rd Prize : Rs 10,000\r\n\r\n\r\n',0,2,'2015-08-02 13:06:54',1,'You must be a student from class IX-XII OR a student from a recognised college/institution.\r\n','Two competitions will be held, one for the students from class IX-XII and another for college students, both in English and Hindi.\r\n\r\nTopic for the first category is:\r\nDr. Ambedkar\'s views on Education and Empowerment of Youth. (2000 words)\r\n\r\nTopic for the second category is:\r\nEnsuring Entitlements in Welfare Economics : The Thoughts and ideas of Dr. Ambedkar. (3500 words)','A. You can download the application form online.\r\nB. Enclose the following documents alongwith: \r\n1. Bonafide certificate.\r\n2. Two clean typed copies (one original & other photocopy) of the essay, one of which must contain your name, address, topic, language, e-mail, phone no, etc., and your signature.\r\n3. On the top of the envelop  write “Dr. Ambedkar Foundation National Essay Competition- 2015” and post the essay with registered / Speed post to the following address. Mention your name, address, topic, language, e-mail, phone no, etc.:\r\n\r\n The Chair Professor\r\n Aligarh Muslim University,\r\n  Aligarh- 202002, Uttar Pradesh','The Chair Professor,\r\nDepartment of Law,\r\nAligarh Muslim University,\r\nAligarh- 202002, Uttar Pradesh\r\nPhone: 91-11-23320571,23320576\r\nFax: 91-11-23320582','http://www.ambedkarfoundation.nic.in/html/main.htm',' ','Dr. Ambedkar National Essay Competition 2015 is for Class 9-12th and students from recognized school or college/university/institutions.Let\'s fill the form and Apply now!','Dr. Ambedkar National Essay Competition 2015 - ScholFin',' ','',0,0,0),(113,'Pastel 100 Competition ','The Pastel Journal',30,0,0,0,'2015-09-01 13:06:54',' ',0,0,0,5000,'1. Winner of the FIRST prize will be rewarded the Pastel Journal Founder\'s Award: a cash prize of $5,000.\r\n2. Winner of the SECOND prize will be rewarded the Pastel Journal Award of Excellence: a cash prize of $2,500.\r\n3. Winner of the THIRD prize will be rewarded the  Ruth Richeson/Unison Pastel Award: a set of Unison Pastels worth $2,000.\r\n4. Winners of the FOURTH and FIFTH prize will be awarded an assortment of \'Richeson and Unison\' Pastels and Surfaces worth $1,500 and $1,000 respectively.\r\n\r\n\r\n\r\nBesides, 25 Category Prizes will be awarded alongwith:\r\n\r\n5 First Place Category Awards: $500 worth of Terry Ludwig Pastels\r\n5 Second Place Category Awards: $350 worth of Great American pastels\r\n5 Third Place Category Awards: $150 worth of Canson paper/Rembrandt pastels\r\n5 Fourth Place Category Awards: $100 worth of PanPastels\r\n5 Fifth Place Category Awards: $75 worth of UART pastel paper\r\n\r\n70 Honorable Mention Image and information about each painting will be published in Pastel Journal. \r\n',1,0,'2015-08-02 13:06:54',0,'1. You must be above 16 years to participate in this exam.\r\n2. Paintings made under another artist‘s supervision or paintings based on another person’s photograph are NOT eligible, even if they\'re copyright-free. ','Pastel 100 Competition will be based on the following categories:\r\n1. Portrait + Figure\r\n2. Landscape +Interior\r\n3. Still life + Floral\r\n4. Animals + Wildlife\r\n5. Abstract + Non-objective\r\n\r\nWork must be at least 80% soft pastel. Nupastels and other “harder” pastels are considered soft pastels. You cannot use oil pastels for your painting.\r\n\r\n','1. Fill the application form online.\r\n2. Upload your image in JPG format.\r\n3. The entry fee can be paid by Credit Card/Cheque/DD. \r\n  Entry fee for early-bird entries: $25 per image.\r\n  Entry fee for regular entries: $30 per image.\r\n','Pastel 100 Competition,\r\n10151 Carver Road,\r\nSuite 200, Blue Ash,\r\nOH 45242.\r\nPhone - 513/531-2222\r\nFax - 513/891-7153','http://www.artistsnetwork.com/competitions/pastel-100-competition',' ','Pastel 100 Competition is for drawing lovers from Class 9-12th, Undergraduate, Post-Graduate students above 16 years of age.Let\'s fill the form and Apply now!','Pastel 100 Competition 2015 - ScholFin',' ','',0,0,0),(114,'National Cyber Olympiad ','Science Olympiad Foundation (SOF) ',47,0,0,0,'2015-10-08 13:06:54','The examination will be held on the following dates:\r\n1. 23th September, 2015.\r\n2. 8th October, 2015.\r\n\r\nYou may appear for the examination on any of the date above.\r\nNOTE: To participate in this scholarship competition, your school authorities must send the registration fees and relevant documents one month before the exam.',0,0,0,50000,'1. All CLASS and STATE toppers will be awarded with cash prizes and medals. \r\n2. Awards worth Rs 10 Crores will be distributed throughout.\r\n',0,2,'2015-08-02 13:06:54',2,'You must be a student of class II-XII.\r\n','National Cyber Olympiad consists of total 50 questions to be solved within 60 minutes.\r\n\r\nThe exam consists of four sections:\r\n1. Logical Reasoning\r\n2. Computers &  IT\r\n3. Achievers Section\r\n\r\n','1. You should send the name, e-mail ID, complete address of your school along with name and contact details of your principal by clicking on APPLY link.\r\n \r\n2. They will send the detailed information and registration forms to your School so that your Principal / Teacher-in-charge can register your name(s) for the exam. \r\n','SCIENCE OLYMPIAD FOUNDATION\r\nPlot no 99, Sec - 44, \r\nGurgaon (Haryana) \r\nIndia. Pin - 122003\r\n\r\nLandline No: 0124-4951200 \r\nMobile: 09312680855, 09312680857','http://www.sofw