cationform4.php','http://www.jbnsts.org/jbweb/Poster2015STST.pdf','JBNSTS Junior Talent Search Test for Senior Talent 2015 is for First year Basic Sciences (Hons)/Medicine/Engineerin  from West Bengal.Let\'s fill the form and Apply now!','Junior Talent Search Test for Senior Talent 2015 - ScholFin',' ','',0,0,0),(122,'The Prince of Wales\'s Commonwealth Environmental Photography Awards','The Royal Commonwealth Society',6,0,0,0,'2015-09-06 13:06:54',' ',0,0,0,1000,'There will be two categories in this exam:\r\n\r\nOVER 18: Winners will receive £1,000.\r\nUNDER 18: Winners will receive £1,000.\r\n\r\nAll winners and finalists will form a part of a special exhibition in the margins of the 2015 Commonwealth Heads of Government Meeting in Malta in November.',2,2,'2015-08-02 13:06:54',0,'This Competition is OPEN TO ALL.','Your photographs should be related to the following 3 themes:\r\n\r\n1. Nature’s Assets\r\n2. People and the Oceans\r\n3. Human Impacts\r\n\r\nThe photographs should be taken only in commonwealth countries.','1. Register yourself online on the official website.\r\n\r\n2. Submit your entries online. You can submit up to 5 entries. ','Communications Office\r\nClarence House\r\nLondon SW1A 1BA\r\nPhone : 020 7024 2106\r\nEmail-ID : outofthebluephotocomp@gmail.com','http://outofthebluecompetition.com/register/',' ','The Prince of Wales\'s Commonwealth Environmental Photography Awards is OPEN to ALL-Amateur and professional Photographers.  Let\'s fill the form and Apply now!','The Prince of Wales\'s Commonwealth Photography 2015 - ScholFin',' ','',0,0,0),(123,'CGAP Photo Contest 2015 in association with World Bank ','World bank in association with CGAP',26,0,0,0,'2015-09-09 13:06:54',' ',0,0,0,2000,'1. GRAND prize winner will be awarded $2000 gift certificate for photography equipments and display on PR Newswire Jumbotron at the Times Square.\r\n2. SECOND prize winner will be awarded $500 gift certificate for photography equipments.\r\n3. THIRD prize winner will be awarded $250 gift certificate for photography equipments.\r\n4. PEOPLE\'S CHOICE winner will be awarded $250 gift certificate for photography equipment.\r\n5. From each region, one winner will be selected on the basis of the country in which the photo was taken. They will be awarded a US$200 gift certificate for photography equipments.\r\n6. Four winners will be chosen on the below mentioned categories and will be awarded US$200 gift certificate for photography equipments:\r\n Digital financial services and mobile banking\r\n Women\'s use of financial services\r\n  Microfinance for small business enterprises\r\n Smallholder farmers and their families\r\n7. 12-15 other winners will be selected and awarded US$50 gift certificate for photography equipments.\r\n',1,2,'2015-08-02 13:06:54',0,'The competition is open for all above 18 years of age.','The photos should touch the following themes discussed in detail:\r\n\r\n1. Digital Finance - Show how poor customers are making best use of digital services.\r\n\r\n2. Smallholders Families - Show how smallholder farmers and their families are putting financial services to use.\r\n\r\n3. Women\'s Use of Financial Services: Show how women around the world are improving their lives with financial services.\r\n\r\n4. Small Business Enterprises:  Show how low-income entrepreneurs are using financial services to grow their businesses.\r\n','You can register online on the official website and submit your entry.\r\n\r\n','900 19th St NW, \r\nWashington, \r\nDC 20006, \r\nUnited States.\r\nPhone: +1 202-473-9594\r\nEmail-ID : mrizzo1@worldbank.org ','https://photocontest.cgap.org/users/login','https://photocontest.cgap.org/pages/cgap/rules/eng','CGAP Photo Contest 2015 in association with World Bank is OPEN to ALL-Amateur and professional Photographer sabove 18 years of age.  Let\'s fill the form and Apply now!','CGAP Photo Contest 2015 - ScholFin',' ','',0,0,0),(124,'Asia-Europe Foundation Photo Contest 2015','The Asia-Europe Foundation (ASEF)',3,0,0,0,'2015-09-06 13:06:54','1. 21 September : Announcement of nominated photos\r\n2. 5 October : Announcement of winners\r\n3. 4 November : Exhibition in Luxembourg',0,0,0,0,'1. Two winners will be selected by the Jury.\r\n\r\n2. One winner will be selected by audience having highest online votes.\r\n\r\n3. There will be an exhibition of all 3 winners and more 20 selected contestants in in conjunction with the 12th ASEM Foreign Ministers\' Meeting (ASEM FMM12) on 4 November 2015 in Luxembourg.\r\n\r\n4. The first stops will be Singapore, followed by Belgium and finally, Mongolia - where the 20th Anniversary of the Asia-Europe Meeting (ASEM) will be celebrated.  \r\n\r\n5. Photos shortlisted for the exhibition and a further selection of 30 photos will be published in a photo book. ',0,2,'2015-08-02 13:06:54',0,'Anyone above 18 years of age is eligible to participate.','Theme of the contest is the activity and the pace of life in Asia and Europe, illustrating those moments how we can be different and yet so alike, have unique means of achieving them but similar visions; and while we live them out in different ways, we hold common values.','1. You have to fill the form Online.\r\n\r\n2. A maximum of 3 entries in digital format has to be submitted online on the website. ','Asia-Europe Foundation (ASEF)\r\n31 Heng Mui Keng Terrace\r\nSingapore 119595\r\nEmail-ID :admin@aseminfoboard.org ','http://www.asef.org/onthego/submit/','http://www.asef.org/onthego/rules/','Asia-Europe Foundation Photo Contest 2015 is OPEN to ALL-Amateur and professional Photographer above 18 years of age.Let\'s fill the form and Apply now!','Asia-Europe Foundation Photo Contest 2015 - ScholFin',' ','',0,0,0),(125,'National Scholarships for persons with Disabilities (Trust Fund) 2015-16 ','National Handicapped Finance and Development Corporation, GoI',2500,0,1,300000,'2015-08-02 13:06:54','You can apply under this scheme anytime during the year.',3,1,4,3000,'The amount of this scholarship are as follows:\r\n1. For Graduate Courses- Rs 2500 per month\r\n2. For Post-Graduate Courses- Rs 3000 per month\r\n\r\na. For Visually Handicapped\r\n   \r\n1. Brailler / Brailler Typewriter- Rs. 10,000\r\n2. Laptop with Screen reading software- Rs. 40,000\r\n3. Laptop with Screen Magnification software- Rs. 60,000  \r\n\r\nb. For  Hearing Handicapped\r\n\r\n1. Binaural digital programmable hearing aid with annual provision of button cells-  Rs 50,000 + Rs 3600 p.a\r\n2. Cell phone with SMS SIM card - Rs 5,000\r\n3. Laptop - Rs 70,000\r\n\r\nc. For  Orthopaedically Handicapped\r\n   \r\n1. Laptop - Rs 40,000',0,1,'2015-08-02 13:06:54',1,'1. You must be a student pursuing graduate/ post-graduate degree from a recognised institution.\r\n2. You must not be a recipient of another scholarship scheme.\r\n','National Scholarships for persons with Disabilities (Trust Fund) scholarship provides financial support to the physically-disable students, thus encouraging them to overcome their physical and psychological barriers and become self-dependent in society.','You should download application form through website & then submit it followings documents:\r\n\r\ni) Attested Academic record \r\nii) Proof of annual income \r\niii) Attested copy of Disability certificate & Bonafide certificate.\r\niv) Course fee receipt if any, duly paid during the academic session;\r\nv) Receipt/Invoice of eligible assistive devices duly countersigned by the authorized signatory of the institution\r\n\r\n ','PHD Chamber of Commerce and Industry, \r\nPHD House, 4/2 Siri Institutional Area,\r\nAugust Kranti Marg, \r\nNew Delhi-110 016\r\nTel: 011-40541355','http://www.nhfdc.nic.in/Document_needed.htm',' ','National Scholarships for persons with Disabilities (Trust Fund) 2015-16 is for Physically disabled undergraduate and post graduate students.Lets apply now!','National Scholarships for Disabilities (Trust Fund) 2015-16 ',' ','',0,0,0),(126,'19th Japan Media Arts Festival 2015 ','Japan Media Arts Festival Executive Committee',16,0,0,0,'2015-09-09 13:06:54',' ',0,0,0,600000,'The following awards will be distributed to the winners:\r\nA. A grand prize of 600,000 Japanese Yen.\r\nB. An excellence award of 300,000 Japanese Yen.\r\nC. A new-face award of 200,000 Japanese Yen. \r\nD. A special achievement award.\r\n\r\nAll the above winners will be given a certificate and a trophy.\r\n ',5,0,'2015-08-02 13:06:54',3,'1. You must be above 18 years of age.\r\n2. Works must be completed or released between September 3, 2015 and September 9, 2015.','The entries for the awards will accepted in the below mentioned 4 Divisions:\r\n\r\n1. Art Division: Includes Interactive art, Media installations, Media performances, Video installations, Video works, Graphic art and Internet art.\r\n\r\n2. Entertainment Division: Includes Games, Video / sound works, Multimedia productions, Gadgets, electronic devices, Websites and Application software.\r\n\r\n3. Animation Division: Includes Animated feature films, animated series and Animated short films.\r\n\r\n4. Manga Division: Comics published in book form, comics published in a magazine, Self-published comics and Comics published online.\r\n','1. Register yourself on the official website to enter the festival.\r\n\r\n2. You can upload or submit your work using any of the following 3 Methods :\r\n\r\na. Upload data to a web server and register the link.\r\n\r\nb. Upload data to Japan Media Art Festival web server.\r\n\r\nc. Send 2 discs of the media to : \r\nJapan Media Arts Festival Submission Receptionist\r\nc/o Nikko Graphic Arts Co. Ltd Kamata K-1 Building 5F,\r\n5-8-7 Kamata, Ota-ku,\r\nTokyo, Japan\r\n144-0052','Japan Media Arts Festival Submission Receptionist\r\nc/o Nikko Graphic Arts Co. Ltd Kamata K-1 Building 5F,\r\n5-8-7 Kamata, Ota-ku,\r\nTokyo, Japan\r\n144-0052.\r\nTel : +81-3-3535-3501','https://entry.j-mediaarts.jp/en','http://festival.j-mediaarts.jp/en/entry/entry-guidelines.php#','19th Japan Media Arts Festival 2015 has art, entertainment, animation and manga division which requires creativity and imagination.Let\'s fill the form and Apply now!','19th Japan Media Arts Festival 2015 - ScholFin',' ','',0,0,0),(127,'Scheme For Disabled Young Professional ','National Handicapped Finance and Development Corporation, GoI',0,0,1,0,'2015-08-02 13:06:54','You can apply for this scheme anytime during the year.',1,0,0,25000,'Loan upto Rs. 25,00,000 will be provided.\r\n\r\nThe rate of interest depends on the loan amount, and are as follows:\r\n\r\ni)   Upto Rs. 50,000/- 5% p.a.\r\nii)  Above Rs. 50,000/ and upto Rs. 5.0 lakh- 6% p.a.\r\niii) Above Rs. 5.0 lakh and upto Rs. 15.0 lakh - 7% p.a.\r\niv) Above Rs. 15.0 lakh - 8% p.a.',0,1,'2015-08-02 13:06:54',1,'1. You must be a citizen of India with atleast 40% disability.\r\n2. You must be between 18 to 45 years of age.\r\n3. You should have obtained a professional degree from recognized Institute.\r\n','Scheme For Disabled Young Professional is for professionally educated unemployed disabled youth. The Corporation provides a loan at the rate of 4-8% p.a. to professionally educated / trained disabled youths, to support them to become successful in their life\r\n\r\n ','You have to apply for this scheme through your bank.','PHD Chamber of Commerce and Industry, \r\nPHD House, 4/2 Siri Institutional Area,\r\nAugust Kranti Marg, \r\nNew Delhi-110 016\r\nTel:   \r\n(011)45088636 \r\n(011)45088638\r\n(011)40541355 \r\n(011)45803730 ','http://www.nhfdc.nic.in/upload/nhfdc/Scheme_Young.pdf',' ','Scheme For Disabled Young Professional provides loan of Rs 25 lakhs for startups and entrepreneurs for physically handicapped unemployed youths. Lets apply now!','Scheme For Disabled Young Professional 2015 - ScholFin',' ','',0,0,0),(128,'\"60 Seconds to Fame\"! All India One Minute Film Competition on Disability ','Ability Foundation',3,0,0,0,'2015-09-11 13:06:54',' ',0,0,0,100000,'1. Winners of the FIRST prize will be awarded Rs 1,00,000, 