s of Appreciation will be presented to:\r\n\r\n1. The Final Cut – Editing\r\n2. The Perfect Capture – Cinematography\r\n3. Finest Use of Theme\r\n4. Superlative Music Score',0,2,'2015-08-02 13:06:54',0,'No eligibility is need to participate in this competition.','\r\nThe theme for the competition will be announced on-the-spot. Each team will have 50 hours to complete the film which includes: \r\n\r\n-Scripting\r\n-Casting\r\n-Location and Art Design\r\n-Shooting\r\n-Editing\r\n-Dubbing and Background Music\r\n-Color Correction and Rendering\r\n-Compressing below 250 MB\r\n-Uploading via link sent on registered mail ID.\r\n','1. Your team needs to register online. The information about members could be edited anytime later till the last date of registration.\r\n2. You have to pay Rs. 1000/- as registration fee, either through online portal or via Demand Draft drawn in the name of  “FREEWAY ENTERTAINMENT COMPANY” and payable at Ahmedabad.\r\n',' ','http://indiafilmproject.co/login/','http://indiafilmproject.co/portfolio/rules/','IFP 2015 - India Film Project conducted by Axis Bank is Asia’s largest film-making event Open to everyone across globe.Let\'s fill the form and Apply now!','IFP 2015 - India Film Project - ScholFin',' ','',0,0,0),(130,'All India Talent Scholarships Award 2015','Children\'s Education Trust and Management Society of India (CET) sponsored by International Children\'s Equity Fund (INCEF)',0,0,0,0,'2015-09-14 13:06:54','The exam will be conducted on 5th/6th December, 2015.',0,2,2,9600,'Each category winners will get a Certificate of Brilliance from INCEF. You\'ll be awarded with a cash prize OR a scholarship. The scholarship money will be paid quarterly during an year, for two years.\r\n1. Group A students will receive a cash prize of Rs. 600 OR a scholarship of Rs. 6000/-.\r\n2 .Group B students will receive a cash prize of Rs. 600 OR a scholarship of Rs. 7200/-.\r\n3. Group C students will receive a cash prize of Rs. 800 OR a scholarship of Rs. 7200/-.\r\n4. Group D students will receive a cash prize of Rs. 800 OR a scholarship of Rs. 9600/-.\r\n\r\n',0,2,'2015-08-02 13:06:54',0,'1. You must be a student of class V-XII to participate in this examination.\r\n2. If you\'re awarded the scholarship, you must score at least 65% marks, as INCEF/CET have to be informed about your progress quarterly.','All India Talent Scholarships Award 2015 provides financial aid to the meritorious students, hence encouraging them to pursue higher studies.','1. You can download the application form online or apply through your school. \r\n2. You can also send a Bank Draft of Rs. 50/- along with the postal stamped envelope of size 5” x 12” in favour of Children’s Education Trust, payable at New Delhi.\r\n3. If you apply through school, the registration fees are as follows:\r\n  Group A and B- Rs. 180 per child\r\n  Group C and D- Rs. 200 per child\r\n4. If you DO NOTapply through school, the registration fees are as follows:\r\n Group A and B- Rs. 230.\r\n Group C and D- Rs. 250.\r\n5. Students getting grades  B+, A or A+ will have their Oral tests around 300 centres.This test will be conducted in the first week of May, 2016.','C-207(1st Floor),\r\nNaraina Industrial Area,\r\nPhase 1, New Delhi, \r\n110028.\r\nTel : 011- 25895886, 41410452, 45597068\r\nFax: 011- 45092468\r\nEmail-ID : cetmsi@yahoo.com, cetmsi@gmail.com','http://www.cetmsi.com/','http://www.cetmsi.com/files/Prospect15.pdf','All India Talent Scholarships Award 2015 is for Class 5-12 students having minimum of 65% marks in school/Institue. Let\'s fill the form and Apply now!','All India Talent Scholarships Award 2015 - ScholFin',' ','',0,0,0),(131,'Loan for Educational Courses to Disabled Persons','NHFDC, Government of India',0,0,1,0,'2015-08-02 13:06:54','Applications are open all year long.',1,0,0,2000000,'1. The amount of loan that\'ll be provided depends on the income of your family.\r\n2. If you are studying in India: Max Rs. 10.00 lakhs will be given as loan.\r\n3. If you are studying OUTSIDE India: Max Rs. 20.00 lakhs will be given as loan.\r\n4. The rate of interest is 4% p.a. A rebate of 0.5% on interest to women will be given.\r\n5. The following will be covered under this scheme:\r\n A. Tuition fees.\r\n  B. Books, uniform and study instruments\' allowances.\r\n C. Travel expenses. \r\n  D. Computer/Laptop allowances.  \r\n  E. Two wheeler vehicle allowance (upto Rs. 50,000/-).\r\n F. Any other expenses required to complete the course like study tours, project work, assistive devices etc.\r\n\r\n',0,1,'2015-08-02 13:06:54',0,'You must be a citizen of India with 40% or more disability.\r\n','Loan for Educational Courses to Disabled Persons provides integrated fellowships in the form of financial assistance to physically challenged students, hence encouraging them to pursue higher studies.','You can fill up the application form online. You will be contacted if your applicaiton is accepted by the NHFDC.','PHD Chamber of Commerce and Industry, \r\nPHD House, 4/2 Siri Institutional Area,\r\nAugust Kranti Marg, \r\nNew Delhi-110 016\r\nTel: 011-40541355','http://www.nhfdc.nic.in/education.aspx',' ','NHDFC provides Loan for Educational Courses to Disabled Persons for undergraduate and postgraduate studies in India and abroad. Lets fill the form and apply now!','Loan for Educational to Disabled Persons 2015- ScholFin',' ','',0,0,0),(132,'Rajiv Gandhi National Fellowship for Students with Disabilities ','Government of India ',200,0,1,0,'2016-07-31 13:06:54','1. In the year 2015, 31st July was the last date of submitting completed applications.\r\n2. 31st July,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,1,5,16000,'A. Scholarships in the fields of SCIENCE, SOCIAL SCIENCE AND HUMANITIES are provided as:\r\n\r\n     1. Rs. 16,000/- p.m. in the first two years as a Junior Research Fellow (JRF).\r\n     2. Rs. 18,000/- p.m. for the remaining tenure as a Senior Research Fellow (SRF).\r\n\r\nB. Scholarships in the field in ENGINEERING AND TECHNOLOGY, are provided as:\r\n\r\n     1. Rs. 18,000/- p.m. in the first two years as a Junior Research Fellow (JRF).\r\n     2. Rs. 20,000/- p.m. for the remaining tenure as a Senior Research Fellow (SRF).\r\n\r\nC. The contingency charges are as follows:\r\n\r\n     1.HUMANITIES AND SOCIAL SCIENCES: \r\n\r\n     Rs. 10,000/- p.a. for initial two years.\r\n     Rs. 20,500/- p.a. for remaining tenure.\r\n\r\n     SCIENCE, ENGINEERING AND TECHNOLOGY:\r\n\r\n     Rs. 12,000/- p.a. for initial two years.\r\n     Rs. 25,000/- p.a. for remaining tenure.\r\n\r\nBesides, the host institution will be paid Rs. 3000/- p.a. for providing you infrastructure for research.\r\n\r\nIn case you are not provided hostel accommodation by the college, you will be provided Hostel Rent Allowance (HRA).',0,1,'2015-08-02 13:06:54',0,'You are eligible for the scholarship programme if you are admitted to an M.Phil./Ph.D. course in a recognised institution and physically challenged.\r\n','Rajiv Gandhi National Fellowship for Students with Disabilities aims to financially support to physically challenged students, hence encouraging them to pursue higher studies such as M. Phil and Ph.D.','You should fill the application form through the website.','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nTel: 011- 23239627 ','http://www.ugc.ac.in/rgnfd/close.aspx',' ','Rajiv Gandhi National Fellowship for Students with Disabilities 2016 is for pursuing P.hD and M.phill courses in engineering, science, social science and humanities. Lets','Rajiv Gandhi Fellowship for Disable student 2016-ScholFin ',' ','',0,0,0),(133,'Imperial College Junior Research Fellowship 2015 ','Imperial College, London',0,0,0,0,'2015-09-14 13:06:54','1. In the year 2015, 14th September was the last date of submitting completed applications.\r\n2. 14th September,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. \r\n',3,2,3,39380,'1. You will get research and travel expenses worth £45,000 over a span of 3 years.\r\n2. A Senior Imperial Academic will be made available for personal mentoring support to you.',2,0,'2015-08-02 13:06:54',0,'1. You must have completed a four-year Bachelor\'s degree from a institution with a First Class Distinction for Master\'s admission.\r\n\r\n2. You must hold a four-year Bachelor\'s degree and a Master\'s degree for research application.\r\n\r\n','The JRFs at Imperial College, London are available in all fields that have a strong research base within Faculty of Engineering, Medicine, Natural Sciences and Business School.\r\n','1.You should download application form given on the website.\r\n\r\n2. You should along with the form submit a confidential letter of support/reference issued by you institution.\r\n\r\n3. Send your complete application form in electronic format to: juniorresearchfellowships@imperial.ac.uk.','Tel : +44 (0)20 7594 7243\r\nEmail-ID : Juniorresearchfellowships@imperial.ac.uk','https://www.imperial.ac.uk/study/pg/apply/how-to-apply/','https://www.imperial.ac.uk/study/pg/apply/requirements/pgacademic/','Imperial College Junior Research Fellowship 2015 is for graduate, post-graduate, Ph.d and research students to study in UK.Let\'s fill the form and Apply now!','Imperial College Junior Research Fellowship 2015 - ScholFin',' ','',0,0,0),(134,'2015 International Student Design Competition Registration','UN-HABITAT & International Council for Caring Communities’ (ICCC)',6,0,0,0,'2015-09-15 13:06:54','1. Last date for registration: 15th September, 2015.\r\n2. Last date for submission of project: 1st December, 2015.\r\n3. Announcement of Winners: February, 2016.\r\n ',0,0,0,10000,'You can participate individually or as a team, hence two prizes will be awarded to each place:\r\n\r\n1. FIRST prize winners will get a cash prize of $10,000.\r\n2. SECOND prize winners will get a cash prize of $5,000.\r\n3. THIRD prize winners will get a cash prize of $2,000.',1,2,'2015-08-02 13:06:54',0,'You must be an undergraduate/graduate student of Architecture to participate in this competition.','International Student Design Competition aims to highlight the outstanding talents in the field of Architecture and Design. Students get an opportunity to demonstrate their talents and get exposure in the field.','A. You need to register online on the website.\r\n\r\nB. You must include the following elements in your project :\r\n\r\n     1. Location: Strategic placement of facilities for older people within walking distance where older persons can contribute and be engaged.\r\n    \r\n     2. Connectivity: Establishment of physical and possibly electronic connectivity to amenities and services.\r\n    \r\n     3. Symbiosis: Matching of talents and interests of older people and needs of society.\r\n    \r\n     4. Dignity: Uphold and preserve the personal rights and personal domain regardless of any reduction in faculties.\r\n    \r\n     5. Access: Availability of essential services such as healthcare, food, educational facilities, recreational areas, social services and transportation.\r\n    \r\n     6. Security: Provide a sense of safety in physical and psychological terms.\r\n\r\n\r\nC. Submit your hard copies by post to :\r\n\r\n     International Council for Caring Communities,\r\n     24 Central Park South,\r\n     New York, NY 10019.\r\n     USA\r\n\r\n','International Council for Caring Communities,\r\n24 Central Park South,\r\nNew York, NY 10019.\r\nUSA\r\nPhone : (212) 688 4321\r\nFax : (212) 759 5893\r\nEmail-ID : icccworld@earthlink.net','http://international-iccc.org/entry-2016/','http://international-iccc.org/wp-content/uploads/2014/05/2016_Competition_Guidelines-docx1.pdf','2015 International Student Design Competition Registration is for Undergraduate and Post-Graduate Architecture students.Let\'s fill the form and Apply now!','2015 International Student Design Competition - ScholFin',' ','',0,0,0),(135,'National Overseas Scholarship for Students with Disabilities ','Government of India ',20,0,1,600000,'2015-10-03 13:06:54','3rd October,2015 is the last date of submitting completed applications.',0,2,3,15400,'A. FOR UNITED STATES OF AMERICA AND OTHER COUNTRIES EXCEPT UNITED KINGDOM\r\n    Allowance of USD 15,400/- will be given for all levels courses covered under the Scheme.\r\n\r\nB. ONLY FOR UNITED KINGDOM\r\n    Allowance of GBP 9,900/- will be given for all levels courses covered under the Scheme.\r\n\r\nBesides this probable allowances will also be paid under this scheme:\r\nA. FOR UNITED STATES OF AMERICA AND OTHER COUNTRIES EXCEPT UNITED KINGDOM\r\n    Allowance of USD 1,500/- will be given.\r\n\r\nB. ONLY FOR UNITED KINGDOM\r\n    Allowance of GBP 1,100/- will be given.\r\n\r\n',1,1,'2015-08-02 13:06:54',1,'You must have at least 55% marks in your Bachelors\'/Masters\' degree.\r\n\r\n\r\n\r\n','Central Sector Scheme of National Overseas Scholarship for Students with Disabilities provides financial support to students pursuing Master level courses and Ph.D. abroad in a recognized Institution.\r\n','1. You should download the application form from the website.\r\n\r\n2. You should submit the application form along with the documents required to the address mentioned on website.\r\n','Department of Empowerment of Persons with Disabilities\r\nMinistry of Social Justice & Empowerment\r\n5th Floor\r\nParyavaran Bhawan, CGO Complex, Lodhi Road\r\nNew Delhi - 110003 (India)\r\nPhone : 011-24369055','http://www.disabilityaffairs.gov.in/content/page/nos--for-students-with-disabilities.php','http://innovationclustersarchive.nic.in/upload/uploadfiles/files/NOSScheme.pdf','National Overseas Scholarship for Disabilities 2016 is for postgraduate, masters and P.hD studies in abroad with an yearly allowance of $15400.Let\'s apply now!','National Overseas Scholarship for Disabilities 2016-S