1. Cognitive Computing and Internet of Things\r\n    \r\n2. Digital Application Marketplace\r\n','1. You must fill the online application form.\r\n2. You must make a minute-long video explaining your ideas, upload it on YouTube, and send the link alongwith.',' ','http://innovationjockeys.net/submit-entry/','http://innovationjockeys.net/contest/','Innovation Jockey 4 by Accenture | Powered by Yahoo India- Submit your Innovative Idea is  for  Undergraduates,Graduates Post-Graduates.Let\'s fill the form and Apply!','Innovation Jockey 4 by Accenture 2015 - ScholFin',' ','',0,0,0),(140,'Pre Matric Scholarships for Students with Disabilities','Department of Disability Affairs',46000,0,1,200000,'2015-08-31 13:06:54','1. In the year 2015, 31st August was the last date of submitting completed applications.\r\n2. 31st August,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. \r\n ',3,1,2,600,'A. For HOSTELER:\r\n     1. Scholarship: Rs. 600/- p.m. for 10 months.\r\n     2. Book and ad-hoc grant: Rs. 1000/- p.a.\r\n\r\nB. For DAY-SCHOLAR:\r\n     1. Scholarship : Rs. 350/- p.m. for 10 months.\r\n     2. Book and ad-hoc grant: Rs. 600/- p.a.\r\n\r\nBesides, the following expense will also be awarded:\r\n     1. Reader expense for Blind students - Rs 160 (p.a.)\r\n     2. Transport expense - Rs 160 (p.a.)\r\n     3. Escort expense - Rs 160 (p.a.)\r\n     4. Helper expense - Rs 240 (p.a.)\r\n     5. Coaching expense - Rs 240 (p.a.)',0,1,'2015-08-02 13:06:54',0,'You must be a regular, full-time student studying in class IX or X in a recognised school, affiliated with CBSE/State Board.','Pre Matric Scholarships for Students with Disabilities aims to provide support for students with disabilities studying at pre matriculation stage, enabling them to complete their education successfully.','You can apply for this scholarship directly through the National Scholarship Portal.','Ministry of Communications & Information Tec