if applicable)\r\n     Land address\r\n     Email address\r\n     Phone number\r\n     The titles of all of the novel extract\r\n\r\n\r\n ','The Mslexia Women’s Novel Competition,\r\nMslexia Publications Ltd.,\r\nPO Box 656, Newcastle upon Tyne 99 1PZ.\r\nTel : +44 (0)191 204 8860\r\nEmail-ID : novel@mslexia.co.uk','https://mslexia.co.uk/competition/novel-competition/','https://mslexia.co.uk/novel-competition-rules/','Mslexia Women’s novel competition 2015  is  Only for female writers who have not commercially published their novels.Let\'s fill the form and Apply now!','Mslexia Women’s novel competition 2015 - ScholFin',' ','',0,0,0),(142,'Post Matric Scholarships for Students with Disabilities','Department of Disability Affairs',16650,0,1,250000,'2015-08-31 13:06:54','1. In the year 2015, 31st August was the last date of submitting completed applications.\r\n2. 31st August,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,1,4,2160,'The value of scholarship includes following benefits:\r\n\r\n1. Tuition Fees.\r\n2. Maintenance expense.\r\n3. Study tour expense.\r\n4. Thesis typing/printing charges for Research Scholars.\r\n5. Book expense along with book bank facility. \r\n6. Book bank facilities.\r\n7. Additional expense for physically challenged students.\r\n',0,1,'2015-08-02 13:06:54',0,'1. You are eligible for the scholarship programme if you are studying ANY post-matriculation or post-secondary courses in a recognised institution.\r\n\r\n2. You cannot apply for this scheme if you study in a multipurpose school.\r\n\r\n3. In cases where X class examination is treated equivalent to matriculation, students are eligible for the scholarship if they fulfill the above criteria. ','Post Matric Scholarships for Students with Disabilities aims to provide support for students with disabilities studying at post matriculation or post-secondary stage, enabling them to complete their education successfully ','You can apply for this scholarship directly through the National Scholarship Portal.','Ministry of Communications & Information Technology (Government of India)\r\nElectronics Niketan, 6, CGO Complex,\r\nLodhi Road, New Delhi: 110003\r\ne-Mail: webmaster[at]deity[dot]gov[dot]in\r\nPhone No. : +91-11-24301851\r\nFax No. : +91-11-24363101\r\nHelpline Numbers:040-23120300','https://registrations.scholarships.gov.in/login.do;jsessionid=C77E5624B75E709FCFE01B7616C3B3D1?mode=unspecified','http://innovationclustersarchive.nic.in/upload/uploadfiles/files/sprepost-scholar-da2014.pdf','Post Matric Scholarships for Students with Disabilities 2015-16 is for class 11,12, diploma and undergraduate courses with a monthly stipend. Lets apply now!','Post Matric Scholarships for Disabilities 2015-16- ScholFin',' ','',0,0,0),(143,'National Painting Competition 2015 for school children on Energy Conservation ','Bureau of Energy Efficiency (BEE)',61,0,0,0,'2015-09-30 13:06:54','1. A 2-hour, school level painting competition must be conducted before 30th September, 2015.\r\n2. Selected paintings must be sent to the Nodal Officer of their State/UT before 30th September, 2015.\r\n3. A state level painting competition of the 50 shortlisted students will be held on 6th November, 2015.\r\n4. Schools will be informed about the selected students by 1st November, 2015.\r\n',0,0,0,100000,'1. All participants will be awarded Certificate Of Participation\r\n\r\n2. Prizes worth Rs. 25.20 lakhs for 36 States/UTs will be awarded on November 6, 2015. \r\n\r\n3. Prizes worth Rs. 10.35 lakhs will be awarded by the Ministry Of Power on December 14, 2015.\r\n\r\n4. Winners will be awarded as below:\r\n\r\n  A.State Level Competition (For Category A and B) :\r\n    \r\n     1st Prize : Rs. 20,000\r\n     2nd Prize : Rs. 15,000\r\n     3rd Prize : Rs. 10,000\r\n     Consolation Prize : Rs. 2,500 each( 10 nos.)\r\n\r\n  \r\n  B.National Level Competition: Category A (Classes 4-6) :\r\n\r\n     1st Prize : Rs. 100,000\r\n     2nd Prize (4 nos.) : Rs. 50,000\r\n     3rd Prize (8 nos.) : Rs. 25,000\r\n     Consolation Prize : Rs. 10,000 each( 10 nos.)\r\n     BEE Prizes : Rs. 10,000 each (10 nos.) \r\n\r\n  \r\n  C.National Level Competition: Category B (Classes 7-9) :\r\n\r\n     1st Prize : Rs. 1,00,000\r\n     2nd Prize (2 nos.) : Rs. 50,000\r\n     3rd Prize (3 nos.) : Rs. 25,000\r\n     Consolation Prize : Rs. 10,000 each( 6 nos.)\r\n\r\n  \r\n  D. For schools located outside India:\r\n\r\n     1st Prize :    Amount in Rs, equivalent to USD 500\r\n     2nd Prize :   Amount in Rs, equivalent to USD 300 \r\n     3rd Prize :     Amount in Rs, equivalent to USD 200 ',0,2,'2015-08-02 13:06:54',2,'There are two categories:\r\n\r\n    1. Category \'A\': Students from classes 4-6\r\n    2. Category \'B\': Students from classes 7-9\r\n\r\nNote: Winners of State level painting competition of Category \'A\' or \'B\'  of the last 2 years are not eligible to participate in the competition.','The National Painting competition for students of Class 4-9 is organized at three levels:\r\n1. School level\r\n2. State level\r\n3. National level\r\n\r\nFollowing are the themes for National Level Painting Competition 2015:\r\nYou can choose any one of these topics:\r\n\r\n    Category A:Class 4-6  \r\n\r\n        1. Save Energy, Save Environment\r\n        2. Leaks make your future bleak\r\n        3. Kukudu Koo Suraj Nikla, Light Jalaien Kyun?\r\n\r\n    Category B:Class 7-9   \r\n\r\n       1.Save Electricity to light more Homes\r\n       2.Don\'t be cruel, conserve your fuel\r\n       3.LED bulb: Ek sahi soch\r\n\r\n','1.The participation in the National Level Competition will be started with a School Level Painting Competition.You must participate only through your school.\r\n\r\n2.Your school has to conduct a 2-hour painting competition for Classes 4-6 under category \'A\' and Classes 7-9 under category \'B\'. You school will select two best paintings, each from Category A and B.\r\n\r\n3.Your paintings must be sent only through school and duly signed by your Principal and should reach the State Nodal Officer by September 30, 2015.\r\n \r\n','State-wise address of Nodal Officers is provided on the official website.','http://beeindia.in/NECA-2015/NECA2015.html',' ','National Painting Competition 2015 for school children on Energy Conservation is for class 4-6th and 7-9th school students.Let\'s fill the form and Apply now!','National Painting Competition 2015 - ScholFin',' ','',0,0,0),(144,'Pre Matric Scholarship for OBC Candidates ','Ministry of Social Justice and Empowerment, Government of India',2500000,0,0,44500,'2015-08-02 13:06:54','The deadline for each state is different. You can contact your school regarding any information/queries about the scholarship.You should visit the page again for update deadline.',3,1,6,250,'A. For students as a HOSTELERS from class III to X\r\n           1. Class III to VIII : Rs.200/- per month \r\n           2. Class IX to X : Rs.250/- per month \r\n\r\nB. For students as a DAY SCHOLARS from class I to X.\r\n           1. Class I to V Rs.25/- per month for 10 months\r\n           2. Class VI to VIII Rs.40/- per month for 10 months\r\n           3. Class IX to X Rs.50/- per month for 10 months\r\n\r\nC. Besides, you will be given an AD-HOC GRANT of Rs. 500/- per annum.\r\n\r\n',0,1,'2015-08-02 13:06:54',2,'1. The scholarship will be considered only if you are studying in a State Government/UT recognised institution, and/or are pursuing courses recognised by them. \r\n\r\n2. Scholarship will only be awarded if your parent\'s/guardian\'s income is less than Rs. 44,500.\r\n\r\n3. If either of your parents are alive, only their income will be taken into consideration. During unfortunate case of death of both parents, the income of the guardian will be taken into account.\r\n\r\n4. If you are a married, unemployed student, the income of your husband will be taken into consideration. In case he\'s passed away, the income of the guardian will be taken into account.\r\n\r\n5. House-rent allowances (if any), is not taken into consideration for computation of income.\r\n\r\n6. Income certificate is required at the time of admission.\r\n\r\n','Pre Matric Scholarship for OBC Candidates is initiative to support them to pursue their dreams through education.','You can contact your respective school for scholarship info and queries.','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/pre-matric.php?format=print',' ','Pre Matric Scholarship for OBC Candidates 2015-16 is for Class 1-10 OBC students whose parental income is below 44,500 per annum. Lets fill the form and apply now!','Pre Matric Scholarship for OBC 2015-16 - ScholFin',' ','',0,0,0),(145,'Post-Matric Scholarships For Other Backward Classes (OBCs) Students','Ministry of Social Justice and Empowerment, Government of India',2500000,0,0,100000,'2016-07-31 13:06:54','1. In the year 2015, 31st July was the last date of submitting completed applications.\r\n2. 31st July,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,1,4,750,'1. Apart from Maintenance Allowance of Rs 750 per month, you will also receive enrolment/registration, tuition, games, union, library, magazine, medical examination and such other fees compulsorily payable by the scholar to the institution or University/Board.\r\n\r\n\r\n',0,1,'2015-08-02 13:06:54',1,'1. You are eligible for the scholarship programme if you are studying ANY post-matriculation or post-secondary courses in a recognised institution.\r\n\r\n2. In cases where X class examination is treated equivalent to matriculation, students are eligible for the scholarship if they fulfill the above criteria.','Post-Matric Scholarships for Other Backward Classes (OBCs) students provides financial support to the OBC students studying at post matriculation or post-secondary stage, enabling them to complete their education.','A.You should submit the Application form along with the following documents:\r\n   1.A passport size photograph with your signature on it.\r\n   2.Attested copy of certificate of degree/diploma.\r\n   3.Authorized Caste certificate authorized \r\n   4.Income declaration by parents on non-Judicial stamp paper.\r\n   5.Acknowledgement receipt signed by the Head of the institution, if you applied for scholarship,previous year.\r\n\r\n','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/postmatric.php?format=print','  ','Post Matric Scholarship for Other Backward Class (OBC) is for Class 11, 12, diploma and undergraduate courses with a monthly stipend and fees. Let apply now!','Post Matric Scholarship for OBC 2015-16 - ScholFin',' ','',0,0,0),(146,'SmartKid General Knowledge Olympiad (SKGKO ’15) ','SilverZone',250,0,0,0,'2015-09-30 13:06:54','The examination will be conducted on a date chosen by your school, either on 17th December, 2015 or 20th January, 2016.',0,0,0,10000,'In each class:\r\n1. FIRST RANKERS will be awarded a cash prize of Rs.10,000 along with a Winner’s Trophy.\r\n\r\n2. SECOND RANKERS will be awarded a Tablet and a Winner’s Trophy.\r\n\r\n3. THIRD RANKERS will be awarded a Digital Camera and a Winner’s Trophy.\r\n\r\n4. Top 4-10 rank holders from each class will get a wrist watch.\r\n\r\n5. Top 11-25 rank holders from each class will get exciting gifts.\r\n\r\n6. Top 26–200 rank holders from each class will get Certificate of Achievement.\r\n\r\n7. Class Toppers (1st, 2nd and 3rd) from each class of every school will be provided with Gold, Silver and Bronze medals 