CIAL SCIENCES: \r\n\r\n     Rs. 10,000/- p.a. for initial two years.\r\n     Rs. 20,500/- p.a. for remaining tenure.\r\n\r\n     SCIENCE, ENGINEERING AND TECHNOLOGY:\r\n\r\n     Rs. 12,000/- p.a. for initial two years.\r\n     Rs. 25,000/- p.a. for remaining tenure.\r\n\r\nBesides, the host institution will be paid Rs. 3000/- p.a. for providing you infrastructure for research.\r\n\r\nIn case you are not provided hostel accommodation by the college, you will be provided Hostel Rent Allowance (HRA).',0,1,'2015-08-02 13:06:54',0,'1.You are eligible for the scholarship programme if you are admitted to an M.Phil./Ph.D. course in a recognised institution.\r\n\r\n2.If the progress in your research is found to be satisfactory, only then you will be eligible for the SRF programme.\r\n','Central Sector Scheme of National Fellowship for OBC Students is an opportunity for the students of Other Backward Classes (OBCs) for pursuing higher education and acquire degrees such as M.Phil. and Ph.D.','1. You can read the advertisement about this scheme from newspaper and the booklet.\r\n\r\n2. You should fill the form online within a month. \r\n\r\n','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nTel: 011-23239627 \r\n','http://www.ugc.ac.in/nfobc/close.aspx','http://socialjustice.nic.in/pdf/nfobc-2015.pdf','Central Sector Scheme of National Fellowship for OBC Students 2015-16 is for M.phill and P.hd studies in science, arts, humanities and engineering. Lets apply now!','Central Sector Scheme of National Fellowship for OBC 2015-16',' ','',0,0,0),(149,'Interest Subsidy on Educational Loan for Overseas Studies for OBC','Ministry of Social Justice and Empowerment',0,0,0,300000,'2015-08-02 13:06:54','You can apply for this scheme anytime during the year.You should check the page again in the month of August-September for updated deadlines. ',1,0,0,0,'You won\'t have to pay any interest on the educational loan. The interest will be borne by the Government of India.',0,1,'2015-08-02 13:06:54',3,'1. You must have a secured admission in courses for Masters, M.Phil or Ph.D levels abroad.\r\n\r\n2.The loan will be given for the study in all ovearseas institutions, recognised by the Govt of India.\r\n\r\n3. You must avail the loan from the bank under the Education Loan Scheme of the Indian Banks Association (IBA).\r\n\r\n4. You parent\'s income must not be more than Rs. 3,00,000/- p.a.\r\n\r\n\r\n ','Interest Subsidy on Educational Loan for Overseas Studies for OBC awards interest subsidy to deserving students belonging to the weaker sections of the society and provide them opportunities for higher education abroad.','1. You should approach the bank for applying for this educational loan.\r\n\r\n2. For list of designated banks,visit the website','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/pdf/g-ISELforOBC1415.pdf',' ','Interest Subsidy on Educational Loan for Overseas Studies for OBC 2015-16 provides interest free loans to study abroad. Lets fill the form and apply button.','Interest Subsidy on Educational Loan for Overseas Studies for OBC',' ','',0,0,0),(150,'International French Language Olympiad - IFLO 2016','SilverZone',250,0,0,0,'2015-09-30 13:06:54','The International French Language Olympiad 2016 will be conducted between December 2015 and January 2016.',0,0,0,10000,'1. FIRST RANKERS will be awarded with cash prize of Rs.10,000 along with a Winner’s Trophy.\r\n\r\n2. SECOND RANKERS will be awarded a Tablet and a Winner’s Trophy.\r\n\r\n3. THIRD RANKERS will be awarded a Digital Camera and a Winner’s Trophy.\r\n\r\n4. Top 4-10 rank holders from each class will get a wrist watch.\r\n\r\n5. Top 11-25 rank holders from each class will get exciting gifts.\r\n\r\n6. Top 26–200 rank holders from each class will get Certificate of Achievement.\r\n\r\n7. Class Toppers (1st, 2nd and 3rd) from each class of every school will be provided with Gold, Silver and Bronze medals provided that they obtain minimum 50% marks.\r\n\r\n8. ALL PARTICIPANTS will be given a certificate of participation.',0,2,'2015-08-02 13:06:54',0,'Students from class VI-X can participate in this exam.\r\n\r\nNote: The examination will be held in French language only.','Exam pattern: The following exam pattern will be followed in International French Language Olympiad – IFLO 2016:\r\n\r\n    Time Duration: 60 minutes.\r\n    Number of questions: 40\r\n    Negative Marking: No\r\n    Type of Questions: Multiple Choice Answers.\r\n\r\n','1. You can participate in   International French Language Olympiad (IFLO \'16) only through your school, no individual entries are allowed.\r\n\r\n2. Application forms can be taken from your school.\r\n\r\n3. You have to pay a fee of Rs. 250/- by means of Demand Draft (DD) in favor of French Language Teacher’s Association, payable at New Delhi.\r\n    \r\n4. Application forms along with demand draft should be sent to the following address by the means of Speed Post, Registered post or Courier:\r\n     Society of Science Education\r\n     B-2, Ansal Chamber II,\r\n     Bhikaji Cama Place,\r\n     New Delhi - 110066, India.\r\n','B-2 Ansal Chamber II,\r\nBhikaji Cama Place,\r\nNew Delhi- 110066, India.\r\nE-mail: Info@silverzone.org\r\nPhone: +91-11-26166210\r\n           +91-11-26166211\r\n           +91-11-26166212','http://silverzone.org/PDF/2015/iFLO/iFLO_School_Registration_Form.pdf','http://silverzone.org/newweb/iflo_olympiad.html','International French Language Olympiad - IFLO 2016 for class 6-10 students having good knowledge and fluency in French.Let\'s fill the form and Apply now!','International French Language Olympiad-IFLO 2016 - ScholFin',' ','',0,0,0),(151,'CII Green Your School Contest 2015 ','IGBC- India Green Building Council',3,0,0,0,'2015-09-30 13:06:54','1. Confirmation from school regarding participation: 16th August 2015.\r\n2. Last date for receiving submittals: 30th September 2015. \r\n3. Contest finale: 18th November 2015.   ',0,0,0,350000,'1. FIRST RANKER will be awarded an amount of Rs 3.5 Lakhs.\r\n\r\n2. SECOND RANKER winner will be awarded an amount of Rs 2.5 Lakhs.\r\n\r\n3. THIRD RANKER winner will be awarded an amount of Rs 1.5 Lakhs.',0,2,'2015-08-02 13:06:54',2,'Students from class VIII-X can participate in this exam.','1. Each school has to submit one entry.\r\n\r\n2. Three students under guidance of one teacher can participate.\r\n\r\n3. The competition will be held in TWO stages. Top three selected schools will head to stage 2, where they have to present their project to a panel of distinguished judges.\r\n      ','1. Your school has to send an email to satya.aruna@cii.in/ disha.natwani@cii.in before 16th August, 2016.\r\n\r\n2. Prepare a powerpoint presentation to convey your ideas of how to convert your school into a green school.\r\n\r\n3. Send the presentation by couries or email to the above addresses.\r\n\r\n4. Top three schools will have to give their presentation to the judges on 18th November, 2015.\r\n\r\n ','CII - Sohrabji Godrej Green Business Centre   \r\nSurvey No 64, Kothaguda Post\r\nNear Kothaguda Cross Roads \r\nRanga Reddy Dist\r\nHyderabad - 500 084\r\nDisha K Natwani (Engineer)\r\nEmail Id: disha.natwani@cii.in\r\nPhone number: +91(40) 4418 5207 ','www.igbc.in',' ','CII Green Your School Contest 2015 is for class 8-10 students to convert school’s existing environment into a green school.Let\'s fill the form and Apply now!','CII Green Your School Contest 2015 - ScholFin',' ','',0,0,0),(152,'UNESCO I Quiz 2015 for school students','Muslim Educational Social & Cultural Organization & UNESCO',8,0,0,0,'2015-09-30 13:06:54',' ',0,0,0,500000,'1. FIRST RANKER will be awarded a cash prize of Rs.5,00,000.\r\n2. SECOND RANKER will be awarded a cash prize of Rs.3,00,000.\r\n3. THIRD RANKER will be awarded a cash prize of Rs.1,00,000.\r\n4. 5 CONSOLATION PRIZES will be given, each having a value of Rs. 50,000.\r\n5. Every participant will get a certificate of participation from UNESCO.',0,2,'2015-08-02 13:06:54',2,'Students from age between 13-16 years can participate in this quiz.','The quiz is being conducted on the theme : “Golden Age of Science with focus on Contributions of Ibn Al-Haytham”\r\n\r\n    Ibn Al-Haytham was a Medieval Century scientist who is considered to have laid the foundations for Optics.\r\n\r\n','1. You can participate in I Quiz 2015 through your school. You can also register for the quiz individually.\r\n\r\n2. You have to pay a fee of Rs.150/-\r\n\r\n3. In the Stage 1 of the application process, your school has to register.\r\n\r\n4. In the Stage 2, organiser teams will contact your school and help for your individual participant registration.\r\n \r\n','IQuiz 2015\r\nC/O Muslim Educational Social & Cultural Organisation\r\n# 22-1-1037/1, Darul Shifa, Hyderabad 500024 (A.P.)\r\nTelangana, India.\r\nEmail-ID : ibnalhaytham.in@gmail.com\r\nTel : 9247578583','http://ibnalhaytham.in/register-for-iquiz-2015','http://ibnalhaytham.in/about-iquiz-2015','UNESCO I Quiz 2015 for school students is for school students in the age group of 13-16 years on Ibn Al-haytham.Let\'s fill the form and Apply now!','UNESCO I Quiz 2015 - ScholFin',' ','',0,0,0),(153,'International Challenge of Economic Ideas (ICEI) 2015','Department of Economics, Universitas Gadjah Mada',3,0,0,0,'2015-09-30 13:06:54',' ',0,0,0,700,'FIRST RANKER will be awarded a cash prize of 700 USD along with a certificate, The Best Essays Compilation book and a chance to deliver a 10 minutes presentation in the FSDE seminar.\r\n\r\nSECOND RANKER will be awarded a cash prize of 500 USD along with a certificate and The Best Essays Compilation book.\r\n\r\nTHIRD RANKER will be awarded a cash prize of 300 USD along with a certificate and The Best Essays Compilation book.',1,2,'2015-08-02 13:06:54',0,'You need to be pursuing an undergraduate course from a recognised institution to participate in this challenge.','International Challenge of Economic Ideas (ICEI) 2015 is an online essay competition for recognition and aid of meritorious students, encouraging them to pursue higher education. \r\n\r\nYou can send only one entry of the essay.\r\n\r\nTheme of the competition is: “Financial Policy to Create Economic Sustainability”','The applications for the Challenge are to be submitted online by emailing them to icei.fsde2015@gmail.com\r\n\r\nWord limit: 1000-1500 words\r\n\r\nThe essay is to be divided into 2 parts, the names and contents of the 2 part are as follow:\r\n\r\n1. The Cover Sheet of your project should contain the essay title, your name, nationality, name of the institution, address and email ID.\r\n       \r\n\r\n2. The following documents are also required:\r\n\r\n    Student Id: A scan of the Student ID in JPG format.\r\n    Photograph: your photograph in JPG format with minimum 500 pixels size.\r\n    Statement of Authorship:  A scan your signed statement of authorship in JPG format.\r\n    Essay: Cover sheet and Essay content in pdf format. \r\n','Faculty of Economics & Business\r\n1st Floor, North Wing,\r\nUniversity of Gadjah Mada.\r\nBulaksumur, Yogyakarta\r\nEmail-ID : icei.fsde2015@gmail.com','http://fsde-himiespa.com/international-challenge-on-economic-ideas.html',' ','International Challenge of Economic Ideas (ICEI) 2015 is an essay writing competition of 1000-1500 words for Undergraduate students.Let\'s fill the form and Apply.','International Challenge of Economic Ideas (ICEI) 2015 - ScholFin',' ','',0,0,0),(154,'Post-Matric Scholarship for the Economically Backward Class ','Ministry of Social Justice and Empowerment, Government of India',0,0,0,100000,'2015-08-02 13:06:54','1. The details of this scholarship scheme will be announced in May-June, through advertisements in newspapers and other media outfits.You should check the page again in the month of for updated deadlines. \r\n',3,1,4,750,'Scholarship includes:\r\n\r\n1. Enrollment/registration, tuition, games, union, library, magazine, medical examination and miscellaneous.\r\n\r\n2. Study tour charges up-to a maximum of Rs. 900/- p.a.\r\n\r\n3. Thesis typing/printing charges up-to a maximum of Rs. 1000/- will be paid to research scholar',0,1,'2015-08-02 13:06:54',3,'1.If you are studying ANY post-matriculation or post-secondary courses in a recognized institution.\r\n\r\n2. Students studying in Class XI of the Higher Secondary School courses of the XII Class of the Multipurpose High School will not be eligible for it being a continuous school course.\r\n\r\n3. In cases where X class examination is treated equivalent to matriculation, students are eligible for the scholarship if they fulfill the above criteria.','Post-Matric Scholarship for the Economically Backward Class  provide financial support to the Economically Backward Class (EBC) students studying at post-matriculation or post-secondary stage to enable them to complete their education.','1.You submit the completely filled Application form along with the following documents:\r\n       \r\n       a.A passport size photograph with your signature on it.\r\n       b.Attested copy of certificate of degree/diploma.\r\n       c.Authorized Caste certificate.\r\n       d.Valid Income certificate  \r\n       ','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/pdf/PostMS-EBC2015.pdf',' ','Post-Matric Scholarship for the Economically Backward Class is for diploma, Class 11, 12, undergraduate, postgraduate and P.hd students. Lets fill the form and appply.','Post-Matric Scholarship for Economically Backward Class-ScholFin',' ','',0,0,0),(155,'Interest Subsidy on Educational Loan for Overseas Studies for Economically Backward Classes','Ministry of Social Justice and Empowerment, Government of India',0,0,0,100000,'2015-08-02 13:06:54','1.) You can apply for this scheme anytime during the year.\r\n2.) You should check the page again in the month of August-September for updated deadlines. ',3,0,0,0,'1.) You won\'t have to pay any interest on the educational loan. The interest will be covered by the Government of India.',0,1,'2015-08-02 13:06:54',3,'1. You must have a secured admission in courses for Masters, M.Phil or Ph.D levels abroad.\r\n\r\n2. The loan will be given for the study in all overseas institutions, recognised by the Govt of India.\r\n\r\n3. You must avail the loan from the bank under the Education Loan Scheme of the Indian Banks Association (IBA).\r\n\r\n4. You parent\'s income must not be more than Rs. 1,00,000/- p.a.\r\n\r\n\r\n ','Interest Subsidy on Educational Loan for Overseas Studies for Economically Backward classes awards provides subsidy to deserving students belonging to the weaker sections of the society and provide them opportunities for higher education abroad.','1. You should approach the bank for applying for this educational loan.\r\n\r\n2. For list of designated banks, please the website','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/pdf/g-ISELforEBC1415.pdf',' ','Interest Subsidy on Educational Loan for Overseas Studies for EBC 2015-16 provides interest free loans to study abroad. Lets fill the form and apply button.','Interest Subsidy on Educational Loan for Overseas Studies for EBC','http://www.scholfin.com/scholarship-details/Interest-Subsidy-on-Educational-Loan-for-Overseas-Studies-for-Economically-Backward-Classes/','',0,0,0),(156,'Pre Matric Scholarship for Scheduled Caste SC students','Ministry of Social Justice and Empowerment, Government of India',2500000,0,0,200000,'2015-08-02 13:06:54','The deadline for each state is different. You can contact your school regarding any information/queries about the scholarship.You should check the page again in the month of August-September for updated deadlines. ',3,1,2,350,'A. For HOSTELER: \r\n     1. Rs. 350/- p.m. for 10 months as scholarship money.\r\n     2. Rs. 1000/- p.a. as book and ad-hoc grant.\r\n\r\nB. For DAY-SCHOLAR:\r\n     1. Rs. 150/- p.m. for 10 months as scholarship money.\r\n     2. Rs. 750/- p.a. as book and ad-hoc grant.\r\n\r\n',0,1,'2015-08-02 13:06:54',2,'1. You must belong to the Scheduled Caste (SCs) and a student of a recognised govt school.\r\n\r\n2. Your parent must not earn more than Rs. 2 lakh p.a.\r\n\r\n3. You must not be enjoying any other scholarship schemes.','Pre Matric Scholarship for Scheduled Caste SC students is an aid for SC children in classes IX and X, encouraging them to pursue basic education.','1.) You submit the completely filled Application form along with the following documents:\r\n       \r\n       a.A passport size photograph with your signature on it.\r\n       b.Attested copy of certificate of degree/diploma.\r\n       c.Authorized Caste certificate.\r\n       d.Valid Income certificate  \r\n       ','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/pdf/pmsscnew.pdf',' ','Pre Matric Scholarship for Scheduled Caste SC students is for Class 9 and 10 students with a monthly stipend and books grant. Lets fill the form and apply now!','Pre Matric Scholarship for SC 2015-16- ScholFin','http://www.scholfin.com/scholarship-details/Pre-Matric-Scholarship-for-Scheduled-Caste-SC-students/','',0,0,0),(157,'Post Matric Scholarships for Scheduled Castes (SCs) studen