eme of Top Class Education for SC/ST Students ','Ministry of Social Justice and Empowerment, Government of India',2000,0,0,600000,'2015-08-02 13:06:54','1.) You should contact your institute office regarding notification/queries about the scholarship.\r\n2.) You should check the page again in the month of August-September for updated deadlines. ',3,1,4,2200,'The scholarship will cover:\r\n\r\n1. Tuition fees (with an upper limit of Rs. 2.00 lakh p.a., if you\'re in a private institution and an upper limit of Rs. 3.72 lakh p.a., if you\'re in a private commercial pilot training institution).\r\n2. Living expenses of Rs. 2220 p.m.\r\n3. Expenses for books and stationery of Rs.3000 p.a.\r\n4. A computer, limited to Rs. 45000 as one-time assistance.',0,1,'2015-08-02 13:06:54',2,'1. You are eligible for the scholarship programme if you are a student from all IIMs, IITs, NITs, commercial pilot training institutions, medical/law colleges and other institutions of excellence.\r\n\r\n2. For the list of the recognized institutes visit the sites.','The Central Sector Scholarship Scheme of Top Class Education for SC Students provides financial support for students who are admitted to a recognized institution, encouraging them to pursue higher studies.','1.) You should apply for this scholarship through your respective institute/college.','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/scdtopsch.php?format=print ',' ','Central Sector Scholarship Scheme of Top Class Education for SC is for students in engineering, medical, law, management courses with full tuition fee. Lets apply now!','Central Sector Scholarship Top Class Education for SC ','http://www.scholfin.com/scholarship-details/Central-Sector-Scholarship-Scheme-of-Top-Class-Education-for-SC-ST-Students/','',0,0,0),(159,'Rajiv Gandhi National Fellowship for SC/ST Candidates ','Ministry of Social Justice & Empowerment and Ministry of Tribal Affairs',2000,0,0,0,'2016-07-31 13:06:54','1. In the year 2015, 31st July was the last date of submitting completed applications.\r\n2. 31st July,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,1,5,16000,'A. Scholarships For SCIENCE, SOCIAL SCIENCE AND HUMANITIES:\r\n    \r\n     1. Rs. 25,000/- p.m. in the first two years as a Junior Research Fellow (JRF).\r\n     2. Rs.28,000/- p.m. for the remaining tenure as a Senior Research Fellow (SRF).\r\n\r\nB. Scholarships For ENGINEERING AND TECHNOLOGY:\r\n\r\n     1. Rs.25,000/- p.m. in the first two years as a Junior Research Fellow (JRF).\r\n     2. Rs.28,000/- p.m. for the remaining tenure as a Senior Research Fellow (SRF).\r\n\r\nC. Contingency charges: \r\n\r\n     1. HUMANITIES AND SOCIAL SCIENCES: \r\n\r\n     Rs. 10,000/- p.a. for initial two years.\r\n     Rs. 20,500/- p.a. for remaining tenure.\r\n\r\n     2. SCIENCE, ENGINEERING AND TECHNOLOGY:\r\n\r\n     Rs. 12,000/- p.a. for initial two years.\r\n     Rs. 25,000/- p.a. for remaining tenure.\r\n\r\nBesides, the host institution will be paid Rs. 3000/- p.a. for providing you infrastructure for research.\r\n\r\nFor the physically and visually challenged, Rs. 2000/- will be paid as escort/reader assistance.\r\n',0,1,'2015-08-02 13:06:54',1,'1.You are eligible for the scholarship programme if you are a SC/ST candidate, and admitted to an M.Phil./Ph.D. course in a recognised institution.\r\n\r\n2.If the progress in your research is found to be satisfactory, only then you will be eligible for the SRF programme.\r\n','Rajiv Gandhi National Fellowship for SC Candidate is an opportunity for the students of Scheduled Class (SCs)/ Scheduled Tribes (STs) for pursuing higher education and acquire degrees such as M.Phil. and Ph.D.','1. You can read the advertisement about this scheme from newspaper and the booklet.\r\n\r\n2. You should fill the form online, within a month,accordingly.\r\n','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://www.ugc.ac.in/rgnfsc/close.aspx','http://socialjustice.nic.in/Rajiv.php?format=print','Rajiv Gandhi National Fellowship for SC Candidate 2016 is for M.phill and P.hd courses in science, engineering, arts and humanities. Lets fill the form and apply','Rajiv Gandhi National Fellowship for SC 2016 - ScholFin ',' ','',0,0,0),(160,'IndusInd Foundation Merit Cum Means Scholarship 2015 ','IndusInd Foundation',600,0,0,0,'2015-09-30 13:06:54','1. In the year 2015, 30th September was the last date of submitting completed applications.\r\n2. 30th September,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. \r\n',3,1,4,1000,'Scholarships includes :\r\n\r\n1.) Amount of Rs.1000 p.m. for the entire course tenure.',0,0,'2015-08-02 13:06:54',0,'1. You should have passed the class 12th (or equivalent) examination in the applying year in first attempt and secured at least 80% marks in the exam.\r\n\r\n2. You must be admitted in a recognized institution for science/computer and management/arts/commerce/engineering.','IndusInd Foundation provides financial support to meritorious students to pursue their education at Degree level.','1. You should download the application form from the website & submit it along with following documents:\r\n     \r\n      a.Birth Certificate/ School leaving Certificate/ Class 10 Certificate. \r\n      b.Class 12 Mark Sheet and Certificate issued by the Board or principal of the school.\r\n      c.Bonafide certificate from the institute for the academic session 2015-16.\r\n      d.Valid Family Income Certificate.  \r\n      e.Fee Receipt issued by your institution.\r\n','The IndusInd Foundation,\r\nHinduja House,\r\n171, Dr. Annie Besant Road,\r\nWorli, Mumbai - 400018, INDIA\r\nTel: +91 22 2496 0707\r\nFax: +91 22 2493 3393\r\nEmail: indusindfoundation@gmail.com','http://indusindfoundation.com/Scholarship%20Application%20Form.pdf','http://indusindfoundation.com/Merit%20cum%20Scholarship%20scheme%20-%20Indusind%20Foundation.pdf','IndusInd Foundation Merit Cum Means Scholarship 2015 is for Undergraduate students in science, arts, commerce, engineering & medical.Let\'s fill the form and Apply!','IndusInd Foundation Merit Cum Means Scholarship 2015-ScholFin','http://www.scholfin.com/scholarship-details/IndusInd-Foundation-Merit-Cum-Means-Scholarship-2015/','',0,0,0),(161,'National Overseas Scholarship for SC','Ministry of Social Justice and Empowerment, Government of India',60,0,0,600000,'2015-08-02 13:06:54','The details of this scholarship scheme will be announced in May-June, through advertisements in newspapers and other media outfits.',3,2,3,15400,'A. FOR UNITED STATES OF AMERICA AND OTHER COUNTRIES EXCEPT UNITED KINGDOM\r\n      Allowance of USD 15400/- \r\n\r\nB. ONLY FOR UNITED KINGDOM\r\n      Allowance of GBP 9900/- \r\n\r\nNOTE: The scheme also covers air travel expenses.',1,1,'2015-08-02 13:06:54',3,'You must have at least 55% marks in your Bachelors\'/Masters\' degree.','Central Sector Scheme of National Overseas Scholarship for SC provides financial assistance to students pursuing Master level courses and Ph.D abroad in a recognized Institution.\r\n\r\n','1.) The application procedure will be mentioned in newspaper advertisement by the government.','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/pdf/revisedNOSSCD.pdf','  ','Central Sector Scheme of National Overseas Scholarship for SC 2016 provides financial assistance for Masters and P.hd courses abroad. Lets fill the form and apply now!','National Overseas Scholarship for SC 2016- ScholFin','http://www.scholfin.com/scholarship-details/National-Overseas-Scholarship-for-SC/','',0,0,0),(162,'The National Bravery Award','The Govt. of India & the Indian Council for Child Welfare (ICCW)',24,0,0,0,'2015-09-30 13:06:54',' ',0,0,0,0,'Total 24 children are presented with the National Bravery Award and they receive a medal, a certificate and a cash award.\r\n\r\nCategories of Awards presented to the selected Nominations:\r\n\r\n    Bharat Award since 1987 - The winner gets a Gold Medal\r\n    Geeta Chopra Award since 1978 + Silver Medal (Given to a girl)\r\n    Sanjay Chopra Award since 1978 + Silver Medal (Given to a boy)\r\n    Bapu Gaidhani Awards since 1988 + Silver Medal\r\n    General  National Bravery Awards since 1957 + Silver Medal\r\n\r\nOther benefits to the winners of National Bravery Award:\r\n\r\n    Awardees receive Gifts given by philanthropic organizations.\r\n    \r\nAwardees will be granted financial assistance until they complete their school education. The Financial scheme will be offered under Indira Gandhi Scholarship Scheme to those undertaking professional courses such as Engineering & Medicine and other students will receive the assistance till they complete their graduation.\r\n',0,0,'2015-08-02 13:06:54',0,'You must be between 6-18 years of age during the time of incident.','Every year, the Government of India awards 24 students during the Republic Day in New Delhi through the hands of the Hon\'ble Prime Minister of India.\r\nIncidents within the July 1- June 30 period will be considered for the awards. However, the date may be relaxed by a maximum period of 3 months at the discretion of the Selection Committee.','You can apply for the nominations by writing a letter in a prescribed format.\r\nNominations are invited from:\r\n\r\n    1. State/Union Territory Councils of ICCW\r\n    2. Various Departments of the State Government\r\n    3. Director Generals and Commissioners of Police of States and Union Territories.\r\n\r\nYour application must be recommended by any two of the following authorities:\r\n    1. Principal/Headmaster of your school.\r\n    2. Head of Panchayat/Zila Parishad General Secretary.\r\n    3. President of the State Council for Child Welfare.\r\n    4. Collector/DM/Govt. Official of equivalent rank.\r\n    5. Superintendent of Police of your area.\r\n    6. Police Official of higher rank. \r\n\r\nYou have to send a write-up of about 250 words in English/Hindi about the act of bravery of the child.\r\n\r\nEnclose birth certificate, newspaper clippings, FIR/Police diary filed at the police station along with the nomination.','4, Deen Dayal Upadhyaya Marg, \r\nNew Delhi- 110002\r\nPhone : 23239539, 23234508\r\nFax : 23232427, 23236616\r\nEmail-ID :  iccw.delhi@gmail.com, iccw@bol.net.in','http://iccw.in/grfx/NBA_nomation_form.pdf','http://iccw.in/scheme_details.html','The National Bravery Award is for 6-18 years school students.The Award will be presented by Honorable Prime Minister of India.Let\'s fill the form and Apply!','The National Bravery Award 2015 - ScholFin',' ','',0,0,0),(163,'Post Doctoral Fellowship to SC/ST Candidates ','Ministry of Social Justice and Empowerment, Government of India',100,0,0,0,'2015-08-02 13:06:54','Applications for the year 2015 has been closed, You should check the page again in the month of August-September for updated deadlines. ',3,2,5,38800,'1. Scholarships: Rs.25,000 p.m. for the first two years, preceded by Rs.30,000 p.m.\r\n2. Contingency: Rs.50,000/-p.a.\r\n3. Escorts/Reader/Assistance for the physically challenged: Rs. 2,000/- p.m.\r\n4. HRA.',0,1,'2015-08-02 13:06:54',0,'1. You must have a doctorate degree with a published research work credited to you.\r\n\r\n2. You must be below 50 years of age (male) or below 55 (female).\r\n\r\n','Post Doctoral Fellowship to SC/ST Candidates provides an opportunity to SC/ST candidates to undertake Postdoctoral research in Sciences, Engineering & Technology, Humanities and Social Sciences in Indian Universities/Institutions.','1.) You should apply online through UGC application portal.','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://www.ugc.ac.in/pdfss/amount_fellowship.aspx','http://www.ugc.ac.in/pdfnews/6242291_PDFSCST.pdf','Post Doctoral Fellowship to SC/ST 2016 is for Postdoctoral research in Sciences, Engineering & Technology, Humanities and Social Sciences. Lets apply now!','Post Doctoral Fellowship to SC/ST 2016 - ScholFin','http://www.scholfin.com/scholarship-details/Post-Doctoral-Fellowship-to-SC-ST-Candidates/','',0,0,0),(164,'Post Graduate Scholarships for Professional Courses for SC/ST Candidates ','Ministry of Social Justice and Empowerment, Government of India',1000,0,0,0,'2015-09-30 13:06:54','1. In the year 2015, 30th September was the last date of submitting completed applications.\r\n2. 30th September,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,1,3,7800,'A.For ME/Mtech student:\r\n     \r\n     1. Rs. 7,800 p.m.as scholarship money.\r\n     2. Rs. 15,000 p.a. as contingency allowance.\r\n\r\nB.If you are NOT an ME/Mtech student:\r\n     \r\n     1. Rs. 4,700 p.m.as scholarship money.\r\n     2. Rs. 10,000 p.a. as contingency allowance.',0,1,'2015-08-02 13:06:54',0,'1. You must have a graduate degree and obtained admission for post-graduate course in a recognized institution. \r\n\r\n2. If you are  pursuing post-graduate course in professional subjects by correspondence or by Distance Education mode, you are not eligible to apply for this scheme.','Post Graduate Scholarships for Professional Courses for SC/ST Candidates provides financial support to 1000 SC/ST candidates, encouraging them to pursue postgraduate level studies in Professional subjects at recognized Indian Institutions.','You can apply online from UGC portal.\r\n','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://www.ugc.ac.in/pgsprof/registration.aspx','http://www.ugc.ac.in/pdfnews/7014949_Pg-Prof.pdf','Post Graduate Scholarships for SC/ST Candidates provides financial assistance to 1000 SC/ST candidates to pursue postgraduate level studies. Lets fill the form and apply ','Post Graduate Scholarships for SC/ST  2015-16 - ScholFin',' ','',0,0,0),(165,'Silver Zone International Olympiad of Science (iOS’15)','SilverZone',300,0,0,0,'2015-08-31 13:06:54','The Silver Zone International Olympiad of Science (iOS’15) will be conducted in three stages:\r\n\r\n1. Level 1 on 19th November 2015 and 09th December 2015.\r\n2. Level 2 will be conducted in Jan/Feb 2016.\r\n3. Level 3 will be conducted in July/August 2016 at New Delhi. ',0,0,0,0,'A.Prizes for LEVEL 1 winners:\r\n\r\n     1. 4th to 10th Olympiad rank holders in each class will be awarded with wrist watches.\r\n     2. 11th to 25th Olympiad rank holders in each class will be awarded with exciting Gift.\r\n     3. 26th to 200th Olympiad rank holders in each class will be awarded with the topper achievement certificate.\r\n\r\nB. Prizes for LEVEL 2 winners:\r\n     1. First ranker from 11th and 12th will be awarded a cash prize of Rs. 51,000 and a winner\'s trophy.\r\n     1(a). First ranker from 1st to 10th will be awarded a tab and a winner\'s trophy.\r\n     2. Second ranker from each class will be awarded a digicam and a winner\'s trophy.\r\n     3. Third ranker from each class will be awarded a cash prize of Rs. 5000/- along with a winner\'s trophy.\r\n\r\nC. Prizes for LEVEL 3 winners: \r\n     Top 2 students will get a chance to visit NASA.\r\n\r\nD. Class toppers of each class in a school will be awarded gold, silver and bronze medals, provided they obtain at least 50% marks.\r\n\r\n     All the participants will be awarded the Student Participation Certificate (SPC).\r\n\r\n\r\n',0,2,'2015-08-02 13:06:54',2,'Students from class I-XII can participate in this exam.','The question paper will consist of two groups and the question paper will have 5-10% questions of \'Applied Sciences\':\r\n     1. Classes I-II : 30 questions.\r\n     2. Classes III-XII : 40 questions.\r\n\r\nThe duration of the exam is an hour.\r\nOMR sheets will pe provided to students from class III.','1. Level 1 and 2 of this examination will be held in your school.\r\n\r\n2. You can participate in International Olympiad of Science (iOS’15) only through your school, no individual entries are allowed.\r\n\r\n3. A fee of Rs.120/- is to be paid.\r\n\r\n4. Details of mode of payment is given in the registration form.\r\n\r\n5. The completely filled application form along with demand draft should be sent to the following address by the means of Speed Post, Registered post or Courier:\r\n     Society of Science Education\r\n     B-2, Ansal Chamber II,\r\n     Bhikaji Cama Place,\r\n     New Delhi - 110066, India.','B-2 Ansal Chamber II,\r\nBhikaji Cama Place,\r\nNew Delhi- 110066, India.\r\nE-mail: Info@silverzone.org\r\nPhone: +91-11-26166210\r\n           +91-11-26166211\r\n           +91-11-26166212','http://silverzone.org/PDF/2015/iOS/iOS_School_Registration_Form.pdf','http://silverzone.org/newweb/ios_informatics_olympiad.html','Silver Zone International Olympiad of Science (iOS’15) is Class 1-12 school students with class1-2 in one group and class3-12 in other.Let\'s fill the form and Apply!','International Olympiad of Science (iOS’15) - ScholFin',' ','',0,0,0),(166,'RGNIYD Sports Scholarships','Rajiv Gandhi National Institute of Youth Development',100,0,0,0,'2015-08-02 13:06:54','You should check the page again in the month of August-September for updated deadlines. ',3,1,2,1000,'Scholarships includes:\r\n\r\nA. NYK Sponsorship : For NYK volunteer for a minimum period of 2 years the scholarship will hostel and tution fees. \r\n\r\nB. NSS Scholarship : For NSS volunteer for period of 2 years, participated in the NSS activities for 240 hours and attended NSS special camp for 7 days, you\'ll be awarded an amount of Rs. 1000/- p.m. \r\n\r\nC. Merit Scholarship : FIRST and SECOND ranker\'s of the M.A. Degree programme shall be awarded Rs. 6,000/- per semester.',0,1,'2015-08-02 13:06:54',4,'This scholarship is available to all Indian students interested in sports and active in NYC and NSS.','Rajiv Gandhi National Institute of Youth Development offers 3 scholarships for youths interested in sports:\r\n\r\nA. NYK Sponsorship\r\n\r\nB. NSS Scholarships\r\n\r\nC. Merit Scholarship','Since no details are given on the website, you may directly contact the authorities for any information/queries.','Rajiv Gandhi National Institute of Youth Development\r\n(Institute of National Importance by the Act of Parliament No.35/2012)\r\nMinistry of Youth Affairs & Sports, Government of India\r\nChennai - Bangalore Highway, Beemanthangal,\r\nSriperumbudur – 602 105, \r\nTamil Nadu. India\r\nPhone : 044 - 27163127, 27162705','http://www.rgniyd.gov.in/content/sponsorships-scholarships-fellowships',' ','Rajiv Gandhi National Institute of Youth Development offers 3 scholarships for youths interested in sports: NYK Sponsorship,NSS Scholarships, Merit Scholarship. Lets appl','RGYIND Sports Scholarship 2015-16 - ScholFin',' ','',0,0,0),(167,'Nirankari Scholarship for Meritorious Students 2015 ','Sant Nirankari Charitable Foundation (SNCF)',0,0,0,350000,'2015-09-30 13:06:54','1. In the year 2015,30th September was the last date of submitting completed applications.\r\n2. 30th September,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines.  .',3,0,0,0,'The scholarship will only cover your tution fees.',0,0,'2015-08-02 13:06:54',1,'A. You must be admitted in a Medical/Engineering/MBA/PGDM/Architecture/CA/CFA/LLB, in an institution recognized by the central/state govt.\r\n\r\nB. You must have secured at least 95% in class XII examination. ','The amount of scholarship money will be decided by the education committee, SNCF.\r\nHalf of the scholarship candidacy is reserved for girls. However, if number of girl applicants are less, you will be considered.','A. You should download the application form from the website & submit it along with following documents\r\n\r\n     1. Family Income Certificate issued by Area SDM.\r\n     2. Institution admission letter.\r\n     3. Class 10th and 12th mark sheet.\r\n     4. Result of all the semesters\' examination passed from the institute.\r\n     5. Copy of fee receipt.\r\n     6. Copy of residence proof.\r\n     7. Bank account statement of Self/Father/Mother for last 6 months.\r\n     8. Copy of pass book & cancelled cheque.','Sant Nirankari Charitable Foundation,\r\nFirst Floor, Administrative Block,\r\nNirankari Complex,\r\nNirankari Chowk,\r\nBurari Road, Delhi, INDIA','http://cdn-media.nirankari.org/nirankarifoundation/wp-content/uploads/2015/05/NIRANKARI-RAJMATA-SCHOLARSHIP-SCHEME-FORM.pdf','http://nirankarifoundation.org/enrich/','NirankariScholarship for Meritorious Students 2015 is for engineer, medical, architecture, MBA, LLB, CA, CFA Undergraduate Students.Let\'s fill the form and Apply!','NirankariScholarship for Meritorious Students 2015 - ScholFin',' ','',0,0,0),(168,'Upgradation of Merit of Scheduled Caste (SC) Students ','Ministry of Social Justice and Empowerment, Government of India',2050,0,0,0,'2015-08-02 13:06:54','The deadline for each state is different. You can contact your school regarding any information/queries about the scholarship. You will be notified about the scholarship through newspaper advertisements. For any information/queries, contact your school administration.',2,0,0,25000,'You will receive an amount of Rs. 25,500 in total:\r\n\r\n1. Boarding and lodging charges: Rs. 900 p.m. (for 10 months)\r\n2. Pocket money: Rs. 300 p.m. (for 10 months)\r\n3. Books and stationery: Rs. 3000/-\r\n4. Honorarium to principal, experts and other incidental charges: Rs. 10,000 p.a.\r\n',0,1,'2015-08-02 13:06:54',4,'You must be a citizen of the Scheduled Castes and studying in class IX-XII.','Upgradation of Merit of Scheduled Caste (SC) Students provides free coaching and remedial classes to the Scheduled Castes (SCs) students studying classes IX-XII to enable them to complete their education, and encourage them to pursue higher education.','1. Some of the best schools in your area where the population of SC students are comparatively high will be chosen to provide free coaching and remedial classes. \r\n2. Schools like Kendriya Vidyalaya will be given preference.\r\n3. The scholarship will be announced through newspaper advertisements.\r\n','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://socialjustice.nic.in/upgrade.php?format=print','  ','Upgradation of Merit of Scheduled Caste (SC) students is for Class 9, 10, 11 and 12 students which provides free coaching and remedial classes. Lets apply now!','Upgradation of Merit Scheduled Caste SC 2015-16-ScholFin',' ','',0,0,0),(169,'Upgradation of Merit of Scheduled Tribes (ST) students  ','Ministry of Social Justice and Empowerment, Government of India',2000,0,0,0,'2015-08-02 13:06:54','The deadline for each state is different. You can contact your school regarding any information/queries about the scholarship. You will be notified about the scholarship through newspaper advertisements. For any information/queries, contact your school administration.',2,0,0,19500,