ence for this scheme if you choose from the following fields:\r\n\r\n1. Natural Resources and Environment ,Forestry,Tropical Agriculture,Computer Science,Mechanical Engineering.\r\n2. Water and Landscape Management. \r\n3. Economics and Finance.\r\n4. Ecology and Environmental Protection.\r\n5. Engineering Informatics.\r\n','UNESCO and Czech Republic offers this scholarships for undergraduate in order to boost human resource capacities in the developing Member States. ','1.) You should download the application form from the website and get it endorsed by the National Commission or Permanent Delegation before the deadline dates.\r\n\r\n2.) You should submit the following documents along with the form:\r\n        a. CV\r\n        b. Affirmation for returning back after completing your studies\r\n        c. Birth certificate translated into Czech language.\r\n        d. Medical reports.\r\n        e. Copy of foreign certificate.\r\n        f. Document proving the content and scope of education completed at a foreign school.\r\n        g. Document proving that the school is recognized by the state pursuant.\r\n\r\n\r\n','7, place de Fontenoy 75352 Paris 07 SP France\r\n1, rue Miollis 75732 Paris Cedex 15 France\r\nPhone : +33 (0)1 45 68 10 00\r\n\r\n','http://registr.dzs.cz/registr.nsf/registraceStep1.xsp?version=eng','http://www.unesco.org/new/en/fellowships/programmes/unescoczech-republic-co-sponsored-fellowships-programme-academic-year-2016-2017/','UNESCO/Czech Republic Co-Sponsored Fellowships Programme 2016-2017 is to take Undergraduate and Masters course in Czech Republic.Let\'s fill the form and Apply!','UNESCO/Czech Republic Fellowships Programme 2016 - ScholFin',' ','',0,0,0),(171,'Pre Matric Scholarship for Scheduled Tribes (ST) students ','Ministry of Social Justice and Empowerment, Government of India',0,0,0,200000,'2015-08-02 13:06:54','1.) The deadline for each state is different, for maharashtra state 31st October is the last date of submitting completed 