des the following for complete duration of the course:\r\n\r\n1. Tution Fees\r\n2. Maintenance expense\r\n3. Study tour expense\r\n4. Thesis typing/printing charges for Research Scholars\r\n5. Book expensealong with book bank facility \r\n6. Additional expensefor physically challenged students.\r\n\r\n',0,1,'2015-08-02 13:06:54',3,'1.If you are studying ANY post-matriculation or post-secondary courses in a recognized institution.\r\n\r\n2. In cases where X class examination is treated equivalent to matriculation, students are eligible for the scholarship if they fulfill the above criteria.','Post-Matric Scholarships for Schedules Tribes (STs) students provides financial support to the ST students studying at post matriculation or post-secondary stage, enabling them to complete their education.','1.Fill the Application form and submit it along with following documents:\r\n\r\n     a.  A passport size photograph with your signature on it.\r\n     b.  Attested copy of the certificate of degree/diploma.\r\n     c. Authorized Caste certificate. \r\n     d.  Income declaration by parents on non-Judicial stamp paper.\r\n     e. Acknowledgement receipt signed by the Head of the institution, if you applied for scholarship,previous year.\r\n','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://tribal.nic.in/Content/Post%20Matric.aspx','http://tribal.nic.in/WriteReadData/userfiles/file/PMS.pdf','Post Matric Scholarships for Scheduled Tribes ST is for Class 11, 12 , Diploma, undergraduate and postgraduate courses with a monthly stipend. Let\'s apply now','Post Matric Scholarships for ST 2016 - ScholFin ',' ','',0,0,0),(173,'Shining Star of Europe IV Video Competition 2015 ','Latvian and Luxembourg Presidencies 2015 of the Council of the EU and European Commission.',3,0,0,0,'2015-09-30 13:06:54',' ',0,0,0,1000,'The best three movies will be awarded a cash prize of 1000 euros by the Representation of the European Commission in Luxembourg.\r\n',2,2,'2015-08-02 13:06:54',0,'You must be between 13 to 30 years of age to participate in this competition.','The selection process of the winners will be done on the basis of the decision of the Jury (40%), Online votes (40%) and Public voting (20%). You will be judged on the basis of:\r\n\r\n1. Quality and attractiveness of the plot.\r\n2. Does the project demonstrate how the partners can become self-sustainable?\r\n3. Does the movie succeed to present a particularly fruitful example of development cooperation?\r\n4. Does the movie show activities of mutual benefit to all partners involved?\r\n5. Technical realisation is also considered.\r\n6. Creativity and innovation.\r\n','You have to apply online to participate in this competition:\r\n\r\nTheme: Development Cooperation, how can different cultures mutually support one another?\r\nDuration: About 150 seconds.\r\nLanguage: You can film the video in any language. However, english subtitles must be put in the video.\r\nSubmission: You have to upload the video on youtube/instagram/vine and mention the URL in the form.\r\n','Ask your questions and queries on \r\nhttp://www.shiningstarsofeurope.eu/contact/','http://www.shiningstarsofeurope.eu/participate/',' ','Shining Star of Europe IV Video Competition 2015 is for Undergraduate, Post-Graduate, Ph.D and Research students between 13-30years.Let\'s fill the form and Apply!','Shining Star of Europe IV Video Competition 2015 - ScholFin',' ','',0,0,0),(174,'National Overseas Scholarship for ST ','Ministry of Social Justice and Empowerment, Government of India',15,0,0,60000,'2015-08-02 13:06:54','The details of this scholarship scheme will be announced in May-June, through advertisements in newspapers and other media outfits.',3,2,3,15400,'A. FOR UNITED STATES OF AMERICA AND OTHER COUNTRIES EXCEPT UNITED KINGDOM\r\n    Allowance of USD 15400/- will be awarded \r\n\r\nB. ONLY FOR UNITED KINGDOM\r\n    Allowance of GBP 9900/-  will be awarded \r\n\r\n\r\n',1,1,'2015-08-02 13:06:54',3,'You must have at least 55% marks in your Bachelors\'/Masters\' degree.','Central Sector Scheme of National Overseas Scholarship for SC provides financial assistance to students pursuing Master level courses and Ph.D abroad in a recognised Institution.\r\n\r\n','The application procedure will be mentioned in newspaper advertisement by the government.','Shri J. P. Dutt\r\nDeputy Secretary (Cdn.),\r\nMinistry of Social Justice and Empowerment,\r\nRoom. No. 740, \'A\', Wing, Shastri Bhawan,\r\nDr. Rajendra Prasad Road,\r\nNew Delhi - 110001 (India)\r\nEmail: jashap.dutt@nic.in','http://tribal.nic.in/Content/National%20Overseas.aspx',' ','Central Sector Scheme of National Overseas Scholarship for ST 2016 provides financial assistance for Masters and P.hd courses abroad. Lets fill the form and apply now!','National Overseas Scholarship for ST 2016- ScholFin',' ','',0,0,0),(175,'\"Ishan Uday\" For North Eastern Region ','Ministry of HRD, Government of India ',10000,0,0,450000,'2015-09-30 13:06:54',' ',0,1,4,5000,'The scholarship will provide an amount of Rs. 3500/- p.m. (for General Degree courses) and Rs. 5000/- (for Technical & Professional courses) through Direct Benefit Transfer (DBT). ',0,1,'2015-08-02 13:06:54',0,'You can apply for this scholarship if:\r\n1. You have passed class XII or equivalent exam from a school and a board, situated within NER. These include CBSE, ICSE and NIOS.\r\n2. You must have a secured admission in general degree/technical/professional courses in an institute recognised  by UGC under Section 2(f) of UGC Act, within and outside the States of NER. ','The objectives of the Special Scholarship Scheme for North Eastern Region are: \r\n\r\n1) To provide opportunities to its students for higher studies.\r\n2) To increase the Gross Enrolment Ratio (GER) in NE Region. \r\n3) To encourage students in NE region to take up professional education.  \r\n4) Optimum utilization of NER Budgetary Allocation. ','You can apply online from the UGC scholarship portal. \r\n','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nUGC Reception: 022-23239627 ','http://www.ugc.ac.in/ner/registration.aspx?f=other','http://www.ugc.ac.in/ner/Downloads/Instructions.pdf','\"Ishan Uday\" For North Eastern Region is for Undergraduate courses for Arunachal Pradesh, Assam, Meghalaya, Manipur, Mizoram, Nagaland and Tripura. Lets apply now!','\"Ishan Uday\" For North Eastern Region 2015-16 - ScolFin',' ','',0,0,0),(176,'Pre Matric Scholarship for Minority Students','Ministry of Minority Affairs',7500000,0,0,100000,'2015-10-31 13:06:54','31st October,2015 is the last date of submitting completed applications',0,1,4,950,'A. Admission fee from class VI to X\r\n     \r\n     Hostellers - Rs.500/- per annum \r\n     Day Scholars- Rs.500/- per annum \r\n\r\nB. Tuition fee from class VI to X \r\n     \r\n     Hostellers - Rs.350/- per month \r\n     Day Scholars- Rs.350/- per month \r\n\r\nC. Maintenance allowance is payable for a period not exceeding 10 months in an academic year\r\n     \r\n    (i) Class I to V\r\n     Hostellers - Nil\r\n     Day Scholars- Rs. 100/- per month\r\n\r\n    (ii) Class VI to X\r\n     Hostellers - Rs. 600/- per month \r\n     Day Scholars- Rs. 100/- per month\r\n\r\n',0,1,'2015-08-02 13:06:54',0,'1. You must belong to a minority committee to be eligible for this scheme.\r\n\r\n2. You must be studying in class I-X in private or government school recognised by your state/UT.','Pre Matric Scholarship for Minority Students provides financial support for the children\'s education and help them  to complete their school education.','You can apply for this scholarship directly through National Scholarship Portal.','Ministry of Minority Affairs, 11th Floor,\r\nParyavaran Bhawan, CGO Complex, Lodhi Road,\r\nNew Delhi-110003\r\nPhone: 011-24364279','https://registrations.scholarships.gov.in/login.do;jsessionid=F0C05C0C1CC32BD7B3B66A5D90F81AB5?mode=unspecified','http://www.minorityaffairs.gov.in/sites/upload_files/moma/files/Prematric_modified.pdf','Pre Matric Scholarship for Minority Students 2015-16 is for students of Class 1-10 with a monthly stipend. Lets fill the application form and apply now! ','Pre Matric Scholarship for Minority 2015-16 - ScholFin','http://www.scholfin.com/scholarship-details/Pre-Matric-Scholarship-for-Minority-Students/','',0,0,0),(177,'All India Poetry Competition 2015 ','The Poetry Society of India',12,0,0,0,'2015-09-30 13:06:54','.',0,0,0,10000,'There are six awards for both Hindi and English entries:\r\n\r\n1. FIRST RANKER will be awarded a cash prize of Rs.10,000.\r\n2. SECOND RANKER will be awarded a cash prize of Rs.5,000.\r\n3. THIRD RANKER will be awarded a cash prize of Rs.3,000.\r\n4. Besides, there are three COMMENDATION prizes worth of Rs. 1,000.',0,2,'2015-08-02 13:06:54',3,'1. You must be a resident/non-resident Indian to participate in this competition.\r\n2. You must not be a member of the Governing Board/Executive Committee of the Poetry Society (India) nor previous first prize poetry competition winner.\r\n\r\n','1. Your entry must either be a poem in English/Hindi, or English/Hindi translation of a poem from a recognised Indian language.\r\n2. Maximum length of an entry should be 40 lines.\r\n3. You can send multiple entries for this competition.','1. You can download the application form for the All India Poetry Competition from the website.\r\n2. If your poem is a translated one, you must enclose a scanned copy of the permission of its poet along with the poem and the DD.\r\n3. Send a copy of each poem to: hkkaul@gmail.com.\r\n4. You can send more than one entry.\r\n5. You have to pay the entry fee via Demand Draft (DD) from any bank payable to \"The Poetry Society (India)\", payable at New Delhi.\r\n6. Send the DD and poem to:\r\n     The Secretary\r\n     The Poetry Society (India)\r\n     L-67A, Malviya Nagar\r\n     New Delhi-110017\r\n','The Poetry Society (India)\r\nL-67A,\r\nMalviya Nagar,\r\nNew Delhi, India- 110017\r\nPhone : 91-11-26741111, 9891016667\r\n\r\nEmail-ID : hkkaul@gmail.com','http://www.indianpoetry.org/compmain.htm',' http://www.indianpoetry.org/','All India Poetry Competition 2015 is for Hindi and English poets of Class 1-12,Undergraduate, Post-Graduate, Ph.D and Research students.Let\'s fill the form and Apply!','All India Poetry Competition 2015 - ScholFin',' ','',0,0,0),(178,'Post Matric Scholarship for Minority Students','Ministry of Minority Affairs',900000,0,0,200000,'2016-10-15 13:06:54','1. In the year 2015, 15th October was the last date of submitting completed applications.\r\n2. 15th October,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,1,4,570,'A. For classes XI and XII\r\n    \r\n    If you are a Hosteler: Actual subject to a maximum ceiling of Rs.7,000 p.a.\r\n    If you are a Day Scholar: Actual subject to a maximum ceiling of Rs.7,000 p.a.\r\n\r\nB. For technical and vocational courses of XI and XII level.\r\n   \r\n    If you are a Hosteler: Actual subject to a maximum ceiling of Rs.10,000 p.a.\r\n    If you are a Day Scholar: Actual subject to a maximum ceiling of Rs.10,000 p.a.\r\n\r\nC. For undergraduate, post graduate.\r\n    \r\n    If you are a Hosteler: Actual subject to a maximum ceiling of Rs.3,000 p.a.\r\n    If you are a Day Scholar: Actual subject to a maximum ceiling of Rs.3,000 p.a.\r\n\r\nD. Maintenance Allowance:\r\n\r\n     i) Classes XI and XII including technical and vocational courses of this level\r\n        Hosteler: Rs.380 P.M\r\n        Day Scholar: Rs.230 P.M\r\n\r\n    (ii) Courses other than technical and professional courses at undergraduate and post-graduate level\r\n         Hosteler:  Rs.570 P.M\r\n         Day Scholar: Rs.300 P.M\r\n\r\n    (iii) M. Phil and Ph.D.\r\n         Hosteler: Rs.1200 P.M\r\n         Day Scholar: Rs.550 P.M',0,1,'2015-08-02 13:06:54',0,'1. You must score at least 50% marks in your last year\'s examinations. \r\n\r\n2. Your parents/guardians income cannot exceed Rs. 2 lakh.','Post Matric Scholarship for Minority Students is awarded to meritorious students belonging from economically weaker sections and provide them better opportunities for education, and encouraging them to aim for higher education.','You can apply for directly through National Scholarship Portal or Minority Welfare Scholarship System.','Ministry of Minority Affairs, 11th Floor,\r\nParyavaran Bhawan, CGO Complex, Lodhi Road,\r\nNew Delhi-110003\r\nPhone: 011-24364279','https://registrations.scholarships.gov.in/login.do;jsessionid=EFEC8189B7054E43E0EBE7BEFB9B79D1?mode=unspecified','http://164.100.167.39/postmatric/admin1/internalIndex.jsp ','Post Matric Scholarship for Minority Students is for Class10,11, Diploma, undergraduate and Postgraduate studies with a monthly Stipend. Lets apply now!','Post Matric Scholarship for Minority 2015-16 - ScholFin ',' ','',0,0,0),(179,'Schwarzman Scholarship Program 2015 ','Schwarzman College, China affiliated to Tsighua University',200,0,0,0,'2016-10-01 13:06:54','1. In the year 2015, 1st October was the last date of submitting completed applications.\r\n2. 1st October,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',0,0,0,3500,'Selected candidates will receive scholarship that includes:\r\n\r\n1. Tuition Fees & Room rent.\r\n2. Return trip to Beijing at the beginning and end of the academic year.\r\n4. In-country study tour\r\n5. Books and essential supplies\r\n6. Lenovo laptop and a smartphone\r\n7. Health insurance\r\n8. Personal stipend of $3,500',1,0,'2015-08-02 13:06:54',0,'1. You must complete ALL degree requirements by June 30, 2016.\r\n\r\n2. You must be between 18-29 years of age.\r\n\r\n3. You must score minimum scores mentioned below in these TOEFL, IELTS and PTE language tests\r\n        TOEFL iBT: 100\r\n        TOEFL PBT: 600\r\n        IELTS: 7\r\n        PTE Academic: 68\r\n','Schwarzman Scholarship Program provides scholarship to near 200 students per year, irrespective of their nationality. \r\n\r\n\r\n','1.You should apply online through the application portal.\r\n\r\n2.You should enclose academic certificates, recommendation letters (three at least), a self-introductory video of 30 seconds, Current resume/CV and an essay of three sections:\r\n\r\n    Personal Statement: Word limit 750 words.\r\n    Leadership Essay: Word limit 500 words.\r\n    Current affairs Essay: Word limit 500 words.\r\n\r\n\r\n3. Currently enrolled undergraduate students must request an assessment from their university using the Schwarzman Scholars Institutional Assessment Form.','Tsinghua University\r\nShunde Building, Room 128\r\nHaidian District, Beijing\r\n100084 P.R. China\r\nPhone : + (86) 10 6279 6901\r\nEmail-ID : SchwarzmanScholars.AsiaPacific@iie.org','https://schwarzmantsinghua.hobsonsradius.com/ssc/aform/x7BT75B00x6G0x6702at.ssc?_ga=1.21256443.171295009.1439026210','http://schwarzmanscholars.org/wp-content/uploads/2015/06/schwarzman_scholars_application_instructions-6.1..pdf','Schwarzman Scholarship Program 2015 is for Undergraduate students in any field wishing to go for Post-Graduate studies in China.Let\'s fill the form and Apply!','Schwarzman Scholarship Program 2015 - ScholFin',' ','',0,0,0),(180,'Inlaks Theatre Awards 2016 ','Inlaks India Foundation',3,0,0,0,'2015-10-01 13:06:54',' ',0,1,1,10000,'1. If you win a short-term award, the funds will be paid upfront, your mentor/institution will have to submit a letter as proof that you have attended the corresponding course.\r\n\r\n2. For long-term award (three months or more), you\'ll be given half the amount at the beginning. Rest will be paid at the midpoint of your term. You\'ll have to submit a progress report signed by the appropriate authority.\r\n ',0,0,'2015-08-02 13:06:54',1,'1. You must have recently awarded a graduate/Post-Graduate degree from a recognised institution to be eligible for this course.\r\n2. Candidates not having a degree, but an excellent record in theatre arts will also be considered. \r\n3. You must be below 35 years of age.','The selection process consists of two rounds. If you\'re selected for round two, you\'ll have to appeared for an audition.','1. You must send a letter from your mentor/institution, proposing that you\'re attending the skill enhancement programme.\r\n    \r\n2. Send an application with your name, educational qualifications, contact address, permanent address and birth certificate.\r\n   \r\n3. If you have applied for Inlaks Awards earlier then you have to mention that too.\r\n\r\n4. Other Documents to be sent alongwith:\r\n\r\n     A. An essay giving details of present occupation and achievements (about 300 words).\r\n     B. A formal proposal of what training/workshop etc. you would like the award for. Also, mention what you\'ll do with the award money (about 500 words)\r\n     C. If it is a workshop/training that you intend to attend, details of the same as well as acceptance to that workshop/training must be submitted.\r\n     D. The time periods as well as the dates for any proposed training/workshop etc. must be submitted with the proposal.\r\n     E. Letter of acceptance from Guru/ Guide / Institution under whom, you\'re working.\r\n     F. Reference letters from three eminent theatre persons.\r\n     G. A CD / DVD with a sample of your work. 4 copies of this CD / DVD has to be sent.\r\n\r\n5. The applications may be sent to the following address:\r\n\r\nInlaks India Foundation , \r\n86 / 87, Atlanta, \r\nNariman Point, \r\nMumbai - 400 021\r\nTel : 22884351\r\n','Inlaks India Foundation , \r\n86 / 87, Atlanta, \r\nNariman Point,\r\nMumbai - 400 021\r\n\r\n\r\nMumbai \r\nTel : 022- 22884351, Fax :022- 22885190\r\nE-mail: info@inlaksfoundation.org\r\n\r\nDelhi\r\nTel : 91-11-26741260\r\nE-mail: inlaksindia@gmail.com\r\n','http://inlaksfoundation.org/inlaks-theatre-award.aspx',' ','Inlaks Theatre Awards 2016 is for recently graduated or Post-Graduated students in the field of theater arts less than 35 years of age.Let\'s fill the form and Apply!','Inlaks Theatre Awards 2016 - ScholFin',' ','',0,0,0),(181,'Inlaks Fine Arts Awards 2016','Inlaks India Foundation',5,0,0,0,'2015-10-01 13:06:54','1. In the year 2015, 1st October was the last date of submitting completed applications.\r\n2. 1st October,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',0,0,0,300000,'The Award is worth Rs.3,00,000/- for a period of one year.\r\n\r\nNOTE: You will have to attend an art residency programme in India for a period of 4 weeks during that year.',0,0,'2015-08-02 13:06:54',0,'1. You must be an emerging artist of age below 30 years.\r\n\r\n2. You must be a graduate/post graduate or a final year student from a recognised institute for visual arts.\r\n\r\n3. You should be a participant in an art exhibition if you don\'t have a degree.','The Inlaks Fine Arts Awards 2016 provide financial support to young artists in their budding years to develop their creative talent. ','A. An essay giving details of present occupation and achievements (about 300 words).\r\n\r\nB. Mention what you\'ll do with the award money (about 500 words).\r\n\r\nC. Send an application with your name, educational qualifications, contact address, permanent address and birth certificate.\r\n\r\nD. Send max. 10 images your work on CD/DVD. Send hard copies of the pictures as well.\r\n\r\nE. Send max. 5 videos on CD/DVD.\r\n\r\nF. You should send the all the required documents on the address mentioned on the website.','Inlaks India Foundation\r\n86/87 Atlanta,\r\nNariman Point,\r\nMumbai 400 021.\r\n\r\nMumbai \r\nTel : 022- 22884351, Fax :022- 22885190\r\ninfo@inlaksfoundation.org\r\n\r\nDelhi\r\nTel : 91-11-26741260\r\nE-mail: inlaksindia@gmail.com\r\n','http://inlaksfoundation.org/inlaks-fineart-award.aspx',' ','Inlaks Fine Arts Awards 2016 is for recently graduated or Post-Graduated students in the field of visual arts under the age of 30.Let\'s fill the form and Apply!','Inlaks Fine Arts Awards 2016 - ScholFin',' ','',0,0,0),(182,'Merit cum means Scholarship for Minority Students ','Ministry of Minority Affairs',60000,0,0,250000,'2015-08-02 13:06:54','1.You should check the page again in the month of August-September for updated deadlines. ',3,2,4,30000,'A. For HOSTELER:\r\n    \r\n     1. Maintenance Allowance: Rs 10,000 p.a.\r\n     2. Course Fee: Rs 20,000 p.a.\r\n\r\nB. For DAY-SCHOLAR:\r\n     \r\n     1. Maintenance Allowance: Rs 5,000 p.a.\r\n     2. Course Fee: Rs 20,000 p.a.',0,1,'2015-08-02 13:06:54',0,'1. You must be admitted to a college offering technical/professional courses to be eligible for this scheme.\r\n\r\n3. For the list of institutions applicable for this scholarship, you can check http://momascholarship.gov.in/minority_scholarship/internalIndex.jsp','Merit cum means Scholarship for Minority Students  provides financial support to the students belonging to minority communities, encouraging them to pursue professional and technical courses.','You must apply from the National Scholarship Portal.','Ministry of Minority Affairs, 11th Floor,\r\nParyavaran Bhawan, CGO Complex, Lodhi Road,\r\nNew Delhi-110003\r\nPhone: 011-24364279','https://registrations.scholarships.gov.in/login.do;jsessionid=EFEC8189B7054E43E0EBE7BEFB9B79D1?mode=unspecified','http://momascholarship.gov.in/minority_scholarship/internalIndex.jsp','Merit cum means Scholarship for Minority Students 2015-16 is for Undergraduate courses in Engineering, medical, law, arts, management, commerce and management. Lets apply','Merit cum means Scholarship for Minority 2015-16 - ScholFin',' ','',0,0,0),(183,'Nai Udaan for Minority Students ','Ministry of Minority Affairs',800,0,0,45000,'2015-08-02 13:06:54','You should check the page again in the month of August-September for updated deadlines. ',3,0,0,50000,'You will be awarded:\r\n\r\n1. Rs. 50,000/- if you acquire a Gazetted post.\r\n\r\n2. Rs. 25,000/- if you acquire a Non-Gazetted post.\r\n',0,1,'2015-08-02 13:06:54',1,'(I) The candidate should belong to one of the Minority Communities i.e. Muslims, Christians, Sikhs, Buddhists, Jains and Parsis.\r\n\r\n(ii) The total annual income of family should not exceed to Rs. 4.50 Lakh.\r\n\r\n(iii) Candidates should have passed the Prelims Examination conducted by UPSC, State PSC, SSC etc.\r\n','Nai Udaan for Minority Students provide financial support to the minority candidates clearing prelims conducted by UPSC,SSC and SPSCand assist them to compete for appointment in Civil Services.','1.) You should download the application form through the website and send it to the address mentioned on the website along with required documents. \r\n','Ministry of Minority Affairs, 11th Floor,\r\nParyavaran Bhawan, CGO Complex, Lodhi Road,\r\nNew Delhi-110003\r\nPhone: 011-24364279','http://minorityaffairs.gov.in/sites/upload_files/moma/files/guidelines-UPSC.pdf','http://minorityaffairs.gov.in/sites/upload_files/moma/files/Advt.-UPSC.pdf','Nai Udaan Scholarship for Minority 2015-16 is for students who have cleared the prelims of UPSC, SSC ,State PSC etc with a prize of Rs 50000. Lets apply now!','Nai Udaan Scholarship for Minority 2015-16 - ScholFin ',' ','',0,0,0),(184,'Nestle Nutrition Institute Research Fellowship 2015','Nestlé Nutrition Institute ',0,0,0,0,'2016-10-01 13:06:54','1. In the year 2015, 1st October was the last date of submitting completed applications.\r\n2. 1st October,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,0,0,40000,'For a member of a research project, the scholarship will cover:\r\n\r\n1. Round-trip travel allowance.\r\n2. Lodging allowance.\r\n3. Stipend money and\r\n4. Study allowance.\r\n\r\n',8,0,'2015-08-02 13:06:54',0,'1. You must have qualified to a post-graduate degree.\r\n\r\n2. You must study at an academic/medical institution.\r\n\r\n3. You must not be outside your country for more than 12 months during the last three years before the date of application.\r\n\r\n4. You must NOT leave the country before applying.\r\n\r\n5. If you\'ve completed more than half of a course you\'ve already enrolled in, you are mot eligible to apply.','The Nestle Nutrition Institute offers scholarships to deserving students who have skills in performing research in the fields of health and nutrition of mother and child.\r\n','A. You should submit an application form along with the following enclosures:\r\n\r\n    1. Details of you current training,\r\n    2. Curriculum Vitae (CV),\r\n    3. A plan of activities and achievements you tend to aim for in the next 12 months.\r\n    4. Two letters of recommendation (1 from the institution you are working in institution 1 from your host institution).\r\n    5. A letter stating that you\'ll return to your nation upon completion of the programme.\r\n\r\n','Ask your questions and queries on https://www.nestlenutrition-institute.org/Info/Pages/ContactUs.aspx','https://www.nestlenutrition-institute.org/Education/scholarships/Pages/DetailsforFellowshipapplication.aspx#grant','https://www.nestlenutrition-institute.org/Education/scholarships/Pages/default.aspx','Nestle Nutrition Institute Research Fellowship 2015 is a research training for Post-Graduated students in the field of  mother and child health and nutrition.','Nestle Nutrition Institute Research Fellowship 2015-ScholFin',' ','',0,0,0),(185,'Padho Pardesh Interest Subsidy for Minority Students  ','Ministry of Minority Affairs',600,0,0,600000,'2015-08-02 13:06:54','You can apply for this scheme anytime during the year.You should check the page again for updated deadlines. ',1,0,0,0,'The interest on educational loan will be covered by the Government of India up to a period which induces Course period + one year after completion of course or six months after getting employment.',0,1,'2015-08-02 13:06:54',1,'1. You must have a secured admission in courses for Masters, M.Phil or Ph.D levels abroad.\r\n\r\n2. You must avail the loan from the bank under the Education Loan Scheme of the Indian Banks Association (IBA). Any private, government, cooperative bank will be taken into consideration.\r\n\r\n3.You family\'s income must not be more than Rs. 6,00,000/- p.a.\r\n\r\n4. For the list of approved courses, click on Apply button and go to the last page.','Padho Pardesh Interest Subsidy for Minority Students supports finacially to deserving students belonging to the weaker sections of the society and provide them opportunities for higher education abroad.','You must inform your bank about the scheme of \'Padho Pardesh\' by the Ministry of Minority Affairs. The bank will then feed your information into the online portal.\r\n\r\n','Ministry of Minority Affairs, 11th Floor,\r\nParyavaran Bhawan, CGO Complex, Lodhi Road,\r\nNew Delhi-110003\r\nPhone: 011-24364279','http://www.minorityaffairs.gov.in/sites/upload_files/moma/files/padhopardesh_eng_0.pdf','http://www.minorityaffairs.gov.in/sites/upload_files/moma/files/FAQs-Students.pdf','Padho Pardesh Interest Subsidy for Minority 2015-16 grants 100% subsidy on Educational loan for studying abroad in different fields. Lets fill the form and apply!','Padho Pardesh Interest Subsidy Minority 2015-16 | ScholFin',' ','',0,0,0),(186,'23rd San Diego Latino Film Festival Poster Competition 2016','Media Arts Center San Diego',10,0,0,0,'2015-10-01 13:06:54',' ',0,0,0,1000,'A. The winner will be honoured and will be awarded a cash prize of $1,000 at the San Diego Latino Film Festival.\r\nB. Top TEN finalists will win 2 tickets to the San Diego Latino Film Festival.',1,2,'2015-08-02 13:06:54',0,'Anyone can participate in this contest and submit any type of artw