 the first two years as a Junior Research Fellow (JRF).\r\n     2. Rs. 28,000/- p.m. for the remaining tenure as a Senior Research Fellow (SRF).\r\n\r\nC.) The Contingency charges are as follows:\r\n\r\n     1. SCIENCE AND ENGINEERING:                    2. ARTS AND COMMERCE:\r\n\r\n     Rs. 10,000/- p.a. for initial two years.                  Rs. 12,000/- p.a. for initial two years.\r\n     Rs. 20,500/- p.a. for remaining tenure.                Rs. 25,000/- p.a. for remaining tenure.\r\n    \r\nD.) Institution will pay Rs. 3000/- p.a. for providing you infrastructure for research.\r\n\r\nE.) For the physically and visually challenged- Rs. 2000/- p.m. ',0,1,'2015-08-02 13:06:54',0,'1.You must belong to the minority community & must be admitted to an M.Phil./Ph.D. course in a recognised institution.\r\n\r\n2. Prior clearance of NET/SLET examination will not be a prerequisite for award of Maulana Azad National Fellowship for minority students for M.Phil/Ph.D.\r\n\r\n','Maulana Azad National Fellowship For Minority Students provides finacial support to the minority communities students to encouraging them to pursue higher studies such as M. Phil and Ph.D.','You can apply for this scholarship through UGC Scholarship Portal.','Ministry of Minority Affairs, 11th Floor,\r\nParyavaran Bhawan, CGO Complex, Lodhi Road,\r\nNew Delhi-110003\r\nPhone: 011-24364279','http://www.ugc.ac.in/manf/close.aspx','http://www.ugc.ac.in/pdfnews/4084285_manf-guidlines.pdf','Maulana Azad National Fellowship For Minority Students 2016 is for M.phil and P.HD courses with a monthy stipend of Rs 25,000. Lets fill the form and apply now!','Maulana Azad National Fellowship For Minority 2016 - ScholFin',' ','',0,0,0),(188,'Wild Wisdom Online Quiz Contest ','WWF India in association with the Ministry of Forests & Climate Change and the Central Board of Secondary Education (CBSE)',5,0,0,0,'2015-08-02 13:06:54','The Wild Wisdom Online Quiz Contest will be conducted in three stages:\r\n\r\n1. Level 1 on 31st October 2015 and 2nd November 2015.\r\n2. Level 2 on 4th and 5th November 2015.\r\n3. Level 3 on 6th and 7th November 2015.\r\n\r\n ',0,0,0,0,'A. Top three winners will receive a tablet.\r\nB. 4th and 5th place contestants will receive a bicycle.\r\nC. Participants will be awarded consolation prizes like \r\n     1. Wild Wisdom wristbands and stickers.\r\n     2. Student Participation Certificate (SPC).\r\n     3. Goody bag (will be delivered by post).',0,2,'2015-08-02 13:06:54',0,'Students from class IX-XII can participate in this quiz.\r\n\r\nNOTE: If the elimination round is held at your school, you cannot participate in the online quiz contest.\r\n','The Wild Wisdom Quiz will be based on the theme : \'Secrets of Soil\'\r\n\r\n1. In LEVEL 1, 30 questions are to be answered in 15 minutes.\r\n2. In LEVEL 2, 40 questions are to be answered in 20 minutes.\r\n3. In LEVEL 3, 60 questions are to be answered in 30 minutes.\r\n','You can register online, a registration fee of Rs. 100/- has to be paid.','WWF India,\r\n172 B, Lodhi Estate,\r\nNew Delhi- 110003 \r\nPhone :011 41504790\r\nMobile : 9717073958, 9013376779\r\nE-mail-ID : wildwisdom@wwfindia.net, asharma@wwf.panda.org','http://quiz.wwfindia.org/students.aspx',' ','Wild Wisdom Online Quiz Contest is for class 9-12 school students in 3 levels.The theme of this quiz is \"Secrets of Soil\".Let\'s fill the form and apply now!','Wild Wisdom Online Quiz Contest 2015 -ScholFin',' ','',0,0,0),(189,'Maulana Azad National Scholarship for Girls 2015 ','Maulana Azad Education Foundation, Ministry of Minority Affairs',0,1,0,100000,'2016-09-30 13:06:54','1. In the year 2015, 30th September was the last date of submitting completed applications.\r\n2. 30th September,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,2,2,6000,'1. You will be awarded a net amount of Rs. 12,000 over a period of two years:\r\n\r\n2. Rs. 6000/- will be paid during the XI standard.\r\n\r\n3. Rest will be paid after submission of marksheet and verification certificate (attested by the institution).\r\n\r\n4. You must secure at least 55% in 11th std.\r\n\r\n5. You have to personally submit the documents to the Office of the Foundation, before 30th September of that year.',0,1,'2015-08-02 13:06:54',0,'1. This scheme is open only for girl students belonging to the minority communities.\r\n\r\n2. Your family income cannot be more than Rs. 1,00,000/-.\r\n\r\n3. You must be a student of a recognised institution.','Maulana Azad National Scholarship for Girls awards scholarship to support girl students belonging to the minority communities, hence encouraging them and their families to pursue their higher education','You can apply online through the website.','Shri Madhukar Naik Dheeravath\r\nSecretary\r\nMaulana Azad Education Foundation\r\n(Ministry of Minority Affairs, Govt. of India)\r\nMaulana Azad Campus,Chelmsford Road\r\nOpposite New Delhi Railway Reservation Centre\r\nNew Delhi 110 055\r\nContact No. +91-11-23583788/23583789\r\nFax No. +91-11-23561945\r\nEmail:secy-maef@nic.in','http://maef.nic.in/REGDemo.aspx','http://maef.nic.in/Instructions.aspx','Maulana Azad National Scholarship for Girls 2015 is for girl student of Class 11 & 12 with a yearly scholarship of Rs 6000. Lets fill the Online application and apply!','Maulana Azad National Scholarship for Girls 2015 - ScholFin ',' ','',0,0,0),(190,'Harvard Academy Scholars Program 2015 ','The Harvard Academy- Founded in 1986',5,0,0,0,'2016-10-01 13:06:54','1. In the year 2015, 1st October was the last date of submitting completed applications.\r\n2. 1st October,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,0,0,67000,'1.For POST-DOCTORAL scholar- $67,000 p.a.\r\n\r\n2.For PRE-DOCTORAL scholar-   $31,000 p.a.\r\n\r\nAlso, the scholarship will fund your travel for research and conferences, for hiring research assistants and health insurance.',1,0,'2015-08-02 13:06:54',0,'You must be currently pursuing a Ph.D. or should be qualified as a Ph.D. in the last three years.','The Harvard Academy Scholars Program 2015 identifies and financially supports students in the field of social sciences.','A) You should submit the application form along with the following documents: \r\n    \r\n    1. Cover letter.\r\n    2. Curriculum Vitae (CV) or resume.\r\n    3. Research proposal (maximum 2500 words).\r\n    4. Official Ph.D. program transcript.\r\n    5. Letter of recommendation from three professionals.\r\n\r\nB) You should send the application form to the address mentioned on the website. ','Weatherhead Center for International Affairs\r\n1727 Cambridge Street\r\nCambridge, MA 02138\r\nTel : 617.495.2137\r\nFax : 617.496.9592\r\nEmail-ID : khoover@wcfia.harvard.edu (Kathleen Hoover, Program Coordinator)','https://harvardacademystudies.communityforce.com/Funds/Search.aspx','http://academy.wcfia.harvard.edu/programs/academy_scholar','Harvard Academy Scholars Program 2015 is for Pursuing/Recently pursued a PhD in social sciences (Including history and law).Let\'s fill the form and apply now!','Harvard Academy Scholars Program 2015 - ScholFin',' ','',0,0,0),(191,'Post-Graduate Indira Gandhi Scholarship for Single Girl Child ','University Grants Commission',0,1,0,0,'2015-09-30 13:06:54','1. In the year 2015, 30th September was the last date of submitting completed applications.\r\n2. 30th September ,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',0,1,2,3100,'1. The scholarship will cover for both the years of your post-graduation.\r\n\r\n2. You will be awarded Rs. 3100/- p.m. for 10 months in a year.\r\n',0,1,'2015-08-02 13:06:54',0,'1. You must be a single girl child (or exceptionally, a twin daughter) in your family, without any siblings.\r\n\r\n2. You must be a 1st year student of a Master\'s Degree course in a recognised institution.\r\n\r\n3. You must be below 30 years of age.\r\n','Post Graduate Indira Gandhi Scholarship For Single Girl Child provides financial support to single girl child to pursue them and encourage them to achieve their higher education in a non-professional courses only. \r\n\r\n','You should apply through the UGC Scholarship website.','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nUGC Reception: 011-23239627 ','http://www.ugc.ac.in/sgc/registration.aspx','http://www.ugc.ac.in/pdfnews/6456190_SGC20132015GuidelinesAmendedEnglish.pdf','Post-Graduate Indira Gandhi Scholarship for Single Girl Child is for PG courses in all fields with a stipend of Rs 3100 per month. Lets fill the form and apply!','PostGraduate Indira Gandhi Scholarship Single Girl Child 2015-16',' ','',0,0,0),(192,'Post-Graduate Merit Scholarship For University Rank Holders  ','University Grants Commission',3000,0,0,0,'2015-09-30 13:06:54','1. In the year 2015, 30th September was the last date of submitting completed applications.\r\n2. 30th September date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,1,3,3100,'The total number of scholarships in the first academic year would be 3000.The duration of the scholarship will be two years only.\r\n',0,1,'2015-08-02 13:06:54',0,'A.You must be admitted to a full-time Post-Graduate course and must have secured first/second rank at the undergraduate level in your stream.\r\n\r\nB.The following branches are taken into consideration:\r\n     \r\n     1. Life Sciences\r\n     2. Physical Sciences\r\n     3. Chemical Sciences\r\n     4. Earth Sciences\r\n     5. Mathematical Sciences\r\n     6. Social Sciences\r\n     7. Commerce\r\n     8. Languages ','Post-Graduate Merit Scholarship For University Rank Holders provides financial support to students to pursue their aim to earn their Master’s Degree. \r\n','You can apply online through the UGC scholarship portal and submit it along with the following documents:\r\n \r\n1) Attested copy of university undergraduate-degree. \r\n\r\n2) Valid Admission certificate. \r\n\r\n3) A verification certificate by the institute where, students has taken admission to 1st Year  P.G. Course. \r\n\r\n ','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nUGC Reception: 011-23239627 ','http://www.ugc.ac.in/urh/registration.aspx','http://www.ugc.ac.in/pdfnews/3457230_URH-Guidelines.pdf','Post-Graduate Merit Scholarship For University Rank Holders 2015-16 is for first and second rank at Undergraduate level with a stipend of 3100pm. Lets apply!','PostGraduate Scholarship For University Rank Holders 2015-16',' ','',0,0,0),(193,'Post Doctoral Fellowship To Women Candidates ','University Grants Commission',100,1,0,0,'2015-05-31 13:06:54','31st October,2015 is last date of submitting completed applications',0,1,5,38800,'1. Rs. 18,000/- p.m. in the first two years as a Junior Research Fellow (JRF).\r\n2. Rs.20,000/- p.m. for the remaining tenure as a Senior Research Fellow (SRF).\r\n3. Rs.38,800/- p.m. for fresh candidates.\r\n4. Rs.46,500/- p.m. for experienced research holders.\r\n5. Rs.46,500/- p.a. as contingency allowance for five years.\r\n6. 10% of the Post Doctoral Fellowship will be paid to the host institution\r\n7. For the physically and visually challenged, Rs. 2000/- p.m. will be paid as escort/reader assistance.\r\n',0,1,'2015-08-02 13:06:54',0,'1) You must have a Ph.D. degree, preferably with valid research papers\r\n\r\n2) Category:             Percentage required:                            Upper Age limit:\r\n\r\n   General/Open        55% marks at UG & 60% at PG level        55 years\r\n   SC/ST/OBC           50% at UG level and 55% at PG level       60 years','“Post Doctoral Fellowship for Women candidates” known as “Part Time Research Associateship for Women” aims to provide support to Ph.D. women candidates, encou