 to participate in various research projects','You Should apply for this scholarship through the UGC portal.','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nUGC Reception: 011-23239627 ','http://www.ugc.ac.in/ramanpdf/registration.aspx','http://www.ugc.ac.in/ramanpdf/Downloads/Raman%20Guidelines%202015-16.pdf','Raman Fellowship for Post Doctoral Research in United States of America 2015-2016 is for P.hD holders with a stipend of $3000 pm. Lets fill the form and apply now!','Raman Fellowship for Post Doctoral Research in USA 2015-16  ',' ','',0,0,0),(195,'Dr. S. Radharkrishnan Post Doctoral Fellowship In Humanities And Social Sciences (Including languages) ','University Grants Commission',200,0,0,0,'2015-08-02 13:06:54',' You should check the page again in the month of August-September for updated deadlines. ',3,1,3,38000,'A. Scholarships include:\r\n     \r\n     1. Rs. 38,800/- (per month) in first year.\r\n     2. Rs. 40,300/- (per month) in second year.\r\n     3. Rs. 41,900/- (per month) in third year.\r\n\r\nB.Their is also contingency charges of Rs. 50,000/- p.a. for three years.\r\n\r\nC.For the physically and visually challenged, Rs. 2000/- p.m. ',0,1,'2015-08-02 13:06:54',0,'1) You must have a Ph.D. degree, preferably with research papers to your credit.\r\n \r\n2)  Category:           Percentage required:                               Upper Age limit:\r\n\r\n    General/Open      55% marks at UG & 60% at PG level           35 years\r\n    SC/ST/OBC         50% at UG level and 55% at PG level          60 years\r\n\r\nNote:-Candidate must identify a Guide for his/her postdoctoral research work and obtain his /her consent for the guidance. \r\n  ','The objective of this award is to support and encourage student to pursue advanced studies and research in the field of Humanities and Social Sciences, including languages in Indian Universities and Colleges.','You can apply online through the UGC Scholarship Portal.','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nUGC Reception: 011-23239627 ','http://www.ugc.ac.in/dsrpdfhs/close.aspx','http://www.ugc.ac.in/pdfnews/9246425_XII-Plan-guidelines-Radhakrishnan.pdf','Dr. S. Radharkrishnan Post Doctoral Fellowship In Humanities & Social Sciences including languages is for 3 years. Stipend of Rs 38800. Lets fill the form and apply!','Post Doctoral Fellowship In Humanities & Social Sciences-ScholFin',' ','',0,0,0),(196,'Swami Vivekananda Single Girl Child Scholarship for Research in Social Sciences ','University Grants Commission',300,1,0,0,'2015-05-31 13:06:54','31st May is last date of submitting completed applications.',0,1,5,12400,'The amount of Scholarship is :\r\na) Rs.12,400/- (per month) for first two years\r\nb) Rs.15,500/- (per month) for third and fourth year \r\n(Extendable for fifth year in exceptional circumstances)',0,1,'2015-08-02 13:06:54',0,'i) Any single girl child of her parents. \r\nii) Only girl child in the family without having any brother or the girl student who are twin daughters/ fraternal daughter may also apply for scholarship under the aforesaid scheme. \r\niii)The scheme is applicable to such a single girl child who has taken admission in regular, full -time Ph. D. program in Social Sciences in any recognized University/Institute. Admission to Ph.D. Course in Distance education mode is not covered under the scheme.\r\n\r\nAge : Girl students up to the age of 40 years for general and 45 years for the reserved category SC/ST/OBC and Physical handicapped at the time of admission in Ph.D courses are eligible.\r\n ','Swami Vivekananda Single Girl Child Scholarship for Research in Social Sciences is organization which provide financial support for girls to pursue higher education in field of Social Sciences. \r\n','You should submit the application form through website along with following documents:\r\n1.)Proof of being single girl child- An affidavit on Rs.50/- Stamp paper from the\r\n    student/parent duly attested by SDM / First Class Magistrate / Gazetted Officer (not below the\r\n    rank of Tahsildar) copying the prescribed languages.\r\n2.)Mark-sheet for Under-Graduate and Post-Graduate degree.','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nUGC Reception: 011-23239627 ','http://www.ugc.ac.in/svsgc/close.aspx','http://www.ugc.ac.in/pdfnews/0003922_guidelines-SWAMI-Vivekananda.pdf','Swami Vivekananda Single Girl Child Scholarship for Research in Social Sciences 2016 provides Rs 12400 pm. No of Scholarships-100. Lets fill form and apply now!','Swami Vivekananda Single Girl Child Scholarship 2016-ScholFin','http://www.scholfin.com/scholarship-details/Swami-Vivekananda-Single-Girl-Child-Scholarship-for-Research-in-Social-Sciences/','',0,0,0),(197,'LFI Students’ Design Competition 2015','Landscape Foundation of India',4,0,0,0,'2015-10-15 13:06:54',' ',0,0,0,50000,'A. Eight winners will be selected, four of which will be rewarded with cash prizes, the remaining will get certificates.\r\n    1. First Prize: Rs. 50,000/-\r\n    2. Second Prize: Rs. 30,000/-\r\n    3. Third Prize: Rs. 15,000/-\r\n    4. Shriya Anand Award: Rs. 21,000/-\r\nB. The winners\' entries will be feature in the Journal of Landscape Architecture, LA.',0,2,'2015-08-02 13:06:54',0,'1. You must be have achieved a Master\'s degree in Landscape Architecture/ M.arch in any discipline.\r\n2. You must be a B.Arch/D.Arch/B.Planning\r\n3. You must have done a graduate as well as post-graduate diploma in Art/Design.\r\n4. You must have recently graduated from any one of the courses above.','The theme for Landscape Foundation India Students’ Design Competition 2015 for this year’s competition is Water – precious in design. The result of this competition will be announced on October 28, 2015.','A.You must submit the online application form and send the following alongwith:\r\n     1. Registration fee