logy (Government of India)\r\nElectronics Niketan, 6, CGO Complex,\r\nLodhi Road, New Delhi: 110003\r\ne-Mail: webmaster[at]deity[dot]gov[dot]in\r\nPhone No. : +91-11-24301851\r\nFax No. : +91-11-24363101\r\nHelpline Numbers:040-23120300','https://registrations.scholarships.gov.in/login.do?mode=unspecified','http://mhrd.gov.in/sites/upload_files/mhrd/files/upload_document/Guidelines_CSS_Scholarship.pdf','Central Scheme of Scholarship For College And University Students 2015-16 is for Undergradaute and Postgraduate in Commerce, science and humanities. Lets fill the form!','Central Scheme of Scholarship For College And University 2015-16 ',' ','',0,0,0),(199,'Scholarship for Post-Matric Studies In Hindi','Ministry of Human Resource Development, MHRD',2500,0,0,0,'2015-08-02 13:06:54','1. The details of this scholarship scheme will be announced in May-June 2016, through advertisements in newspapers and other media outfits.\r\n2. For a blank application form and other documents, you have to send a letter to govt of your state/UT.',3,1,4,500,'The amount of this scholarship are as follows:\r\n1. Class XI and XII: Rs. 300/- (per month).\r\n2. B.A./ B.Sc./ B.Com (pass/honors) or, an equivalent examination: Rs. 500/- (per month).\r\n3. M.A./ MLitt and equivalent courses, and Hindi teacher\'s training course/Ph.D.: Rs. 1000/- (per month).\r\n',0,1,'2015-08-02 13:06:54',2,'1. You will be awarded this scholarship only if your mother tongue is not Hindi and if you study in a Non-Hindi speaking states.\r\n2. You must secure at least 60% marks in the qualifying examination. ','The Scholarship for Post-Matric Studies In Hindi provides financial support to non-Hindi speaking students and encourage them to learn Hindi, also enabling them to appear for government posts where knowledge in Hindi is essential.','You should submit the application form along with following documents:\r\n1. One passport size photograph with signature.\r\n2. One attested copy of the certificate(s) achieved since matriculation.\r\n3. You must apply for this scheme only through the government of your state.\r\n','Praveen Kumar\r\n230-C, Shastri Bhawan, \r\nNew Delhi\r\nOffice: +91-11-23383432\r\nFax: +91-11-23381264\r\nE-mail: praveen.kumar.nic.in','http://mhrd.gov.in/sites/upload_files/mhrd/files/upload_document/Guidelines_Non_Hindi_Speaking.pdf',' ','Scholarship for Post-Matric Studies In Hindi is applicable for Class 11, 12, B.A, B.Sc, B.Com, M.A , M.Litt and P.hd courses. Lets fill the form and apply now!','Scholarship for PostMatric Studies In Hindi 2015-16 - ScholFin',' ','',0,0,0),(200,'Special Scholarship Scheme For Jammu & Kashmir','All India Council for Technical Education (AICTE)',5000,0,0,600000,'2015-08-02 13:06:54','You should visit the page again in the month April 2016 for updated deadline.',3,2,4,300000,'The following are the amount for this scholarship:\r\n1.General degree courses    -Rs. 30,000/- p.a.\r\n2.Engineering courses.         -Rs. 1,25,000/- p.a.\r\n3.Medical studies.                -Rs. 3,00,000/- p.a.\r\n4.Hostel fees and incidentals.-Rs. 1,00,000/- p.a.',0,1,'2015-08-02 13:06:54',0,'1. You must be a resident of Jammu and Kashmir.\r\n2. You must study in a school affiliated with Central Board of Secondary Education (CBSE) or State Board of Jammu & Kashmir.\r\n3. You must have secured an admission to general degree courses, engineering and medical studies in govt. colleges/ institutes/ other non-govt. institutes recognized by AICTE or UGC, or institutes created through an Act of the State Government, located outside the State of Jammu & Kashmir ','The Special Scholarship Scheme For Jammu & Kashmir aims to provide financial supportto the students, hence encouraging them to pursue higher studies. \r\n5,000 scholarships are awarded every year accordingly: \r\n4500 for general degree courses,250 for engineering courses & 250 for medical courses.','You can submit the online application form through their website along with the following documents:\r\n1. Joining report in the allotted college.\r\n2. Fee Receipts (Tuition / Hostel/ other incidental charges) for the Academic Year for\r\nwhich the scholarship is being claimed .\r\n3. In case if student not residing in the Hostel:-\r\na) Certificate From University/Institute regarding Reasonability of Rent claime\r\n4. Book receipts in the name of students detailing names of books purchased for the\r\nAcademic Year for which the scholarship is being claimed and duly affested by the\r\nAuthorized signatory of the Institute.\r\n5. Copy of first two page of Bank Pass Book clearly indicating followings:\r\na) Name of Account holder b) Name and Address of the Bank\r\nc) IFSC Code, CBS Code d) Bank Account Number\r\n6. Copy of Aadhar Card','All India Council for Technical Education\r\nNew Delhi\r\n7th Floor, Chanderlok building, Janpath, \r\nNew Delhi-110001\r\nPhone: 011-23724188','http://www.aicte-jk-scholarship-gov.in/','http://mhrd.gov.in/sites/upload_files/mhrd/files/upload_document/RevGuidelinesJK.pdf','Special Scholarship Scheme For Jammu & Kashmir 2016 is for medical, engineering and other courses outside Jammu and Kahmir. Lets fill the form and apply now!','Special Scholarship Scheme For Jammu&Kashmir 2016-ScholFin',' ','',0,0,0),(201,'Atlas Shrugged Essay Contest 2015','Ayn Rand Education',84,0,0,0,'2015-10-23 13:06:54',' ',0,0,0,10000,'1. The winner of FIRST prize will win $20,000.\r\n2. 3 winners of SECOND prize will win $2,000.\r\n3. 5 winners of THIRD prize will win $1,000.\r\n4. 25 FINALISTS will win $100.\r\n5. 50 SEMI-FINALISTS will win $50.\r\n',1,2,'2015-08-02 13:06:54',0,'You must be a student of class XII, an undergraduate course or a postgraduate student.\r\n\r\nEmployees of the Ayn Rand Institute, its board of directors and their immediate family members are not allowed to enter in this competition.\r\n\r\nPast first-place winners are not eligible for this contest.','Topics for the Atlas Shrugged Essay Contest are: \r\n\r\n    1. At his trial, Hank Rearden declares: “The public good be damned, I will have no part of it!” What does he mean? How does this issue relate to the novel’s theme?\r\n    2. Who is John Galt?\r\n    3. What is the meaning of money to Francisco d’Anconia? To James Taggart? How do these characters’ views on money relate to the events of the story?\r\n\r\nThe essay must be within 800-1,600 words.','You can submit their essay online.\r\nOr, you can mail the written essay with stapled cover sheet to:\r\n\r\nAtlas Shrugged Essay Contest \r\nThe Ayn Rand Institute \r\nP.O Box 57044 \r\nIrvine, CA 92619-7044','Atlas Shrugged Essay Contest, \r\nThe Ayn Rand Institute P.O. Box 57044 \r\nIrvine,CA 92619-7044\r\nPhone : 949-222-6550 ext. 259\r\nEmail-ID : essays@aynrand.org','http://essaycontest.aynrandnovels.org/AtlasShrugged.aspx','http://www.aynrand.org/students/essay-contests#overview','Atlas Shrugged Essay Contest 2015 is for Class 12, Undergraduate and Graduate Students of any nationality to win $20,000.Let\'s fill the form and apply now!','Atlas Shrugged Essay Contest 2015 - ScholFin',' ','',0,0,0),(202,'4th Delhi International Film Festival 2015','The Social Circle, NDMC & Delhi Tourism',10,0,0,0,'2015-09-30 13:06:54','1. In the year 2015, 30th September was the last date of submitting completed applications.\r\n2. 30th September ,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',0,0,0,0,'The winners of the Delhi International Film Festival will be awarded under the following categories:\r\n\r\n1. Best film,Short Film,Documentary,Actress,Actor,Director,Animation,Film,Student,Best Cinematography.\r\n2. DIFF Lifetime Achievement Award\r\n3. DIFF \'MINAR-E-DILLI\' Award',0,2,'2015-08-02 13:06:54',0,'The competition is open for all.\r\nYour film must be in its original language with English subtitles and a synopsis.\r\n\r\n    \r\n','You can submit your entry for the following categories:\r\n\r\n1.Feature Film/Fiction\r\n2.Feature Film/ Non Fiction\r\n3.Documentary /Fiction\r\n4.Documentary /Non Fiction\r\n5.Short Film/Fiction\r\n6.Short Film/ Non Fiction\r\n7.Animation Film /Fiction\r\n8.Animation Film /Non Fiction\r\n9.Green Film/Fiction\r\n10.Green Film /Non Fiction\r\n11. Student Film\r\n12. Cinema across the Border\r\n13. NRI Film\r\n \r\n\r\nAfter getting selected for the scheme,it will be the responsibility of the producers to provide the following:\r\n        Press kit\r\n        Trailer of the submitted film for advertising the festival\r\n        3-5 Posters (Minimum A3 size) and flyers. ','You must sent the hard copy of the application form, pictures, synopsis and CV along with the DVD of the film to the address mentioned on website.\r\n','Delhi International Film Festival\r\nE-294, East of Kailash\r\nNear Kailash Colony Metro Station, New Delhi-110065\r\nPhone: 011-41641787, +91- 9958472498, 9999651680.\r\nEmail-ID : 1diff2012@gmail.com\r\n                info@delhiinternationalfilmfestival.com','http://www.delhiinternationalfilmfestival.com/entry-form/film/','http://www.delhiinternationalfilmfestival.com/','4th Delhi International Film Festival 2015 is for Class 1-12, Undergraduate, Graduate, Post-Graduate, Ph.d and Research Students.Let\'s fill the form and apply now!','4th Delhi International Film Festival 2015 - ScholFin',' ','',0,0,0),(203,'Central Scheme to Provide Interest Subsidy (CSIS)  ','MHRD',0,0,0,600000,'2015-08-02 13:06:54',' You should visit the page again for updated deadlines. ',1,0,0,0,'The scheme provides interest subsidy during the course period, followed by a tenure of six months/ till the date of getting a job (whichever is earlier).',0,1,'2015-08-02 13:06:54',1,'1. You can apply for this scholarships only once, either at the undergraduate level, or the post-graduate level.\r\n2. You must be pursuing technical/ professional course in a recognized Indian institution.',' The Government of India provides full Interest Subsidy (CSIS) to students who have applied for an educational loan.\r\n\r\nNOTE: The scheme is active during the course period, followed by a tenure of six months/ till the date of getting a job.','1. You should approach the bank for applying for this educational loan.\r\n2. For list of applicable banks, please visit this link http://www.ugc.ac.in/page/Educational-Loan.aspx ','University Grants Commission (UGC)\r\nBahadur Shah Zafar Marg, New Delhi\r\nPin:110 002\r\nIndia\r\nUGC Reception: 011- 23239627 \r\n','http://mhrd.gov.in/scholarships-education-loan-4','http://mhrd.gov.in/sites/upload_files/mhrd/files/upload_document/IBAM.pdf','Central scheme to provide interest subsidy (CSIS) provides interst free education loan to diploma, undergraduate and postgraduate students. Lets fill the form and apply!','Central scheme to provide interest subsidy CSIS-ScholFin',' ','',0,0,0),(204,'CBSE Merit Scholarship for Single Girl Child  ','Central Board of Secondary Education',0,1,0,0,'2015-09-30 13:06:54','30th September,2015 the last date of submitting completed applications ',0,1,2,500,'The amount of scholarships is Rs. 500/- per month.Scholarship is provided for a maximum period of two years.',0,1,'2015-08-02 13:06:54',0,'1.) All Single Girl Students, who are the only child of their parents;, who have secured 60% / 6.2 CGPA or more marks /grades in CBSE Class X Examination and are studying Class XI & XII in School\r\n(affiliated with CBSE) whose tuition fee is not more than Rs. 1,500/- p.m. during\r\nthe academic year, shall be considered for the purpose. In the next two years, the\r\ntotal enhancement in tuition fee in such school shall not be more than 10% of the\r\ntuition fee charged.\r\n2.) NRI applicants of the Board are also eligible for the award. The tuition fee\r\n     for the NRIs has been decided maximum of Rs. 6,000/- per month.\r\n3.) Candidates who have passed CBSE Class X Examination in 2015 will be\r\n     considered.','The scheme is aimed to recognize the efforts of the parents in promoting education among girls and to provide encouragement to meritorious students.','1. You can apply for this scholarship Online through CBSE website.\r\n2. You should submit the application form attested by the School Principal of their respective institution/colleges.  \r\n3. You should also submit Original Affidavit attested by the First Class Judicial Magistrate/ SDM/\r\n    Executive Magistrate, as mentioned on the Board’s website.','Academics, Research, Training & Innovation wing \r\n\'Sikhsha Sadan\', 17, Rouse Avenue, Institutional Area, \r\nNear ITO, New Delhi - 110002\r\nTel: 91-11-22044166\r\nEmail: scholarship.cbse@nic.in','http://59.179.16.89/cbse/2015/sgcx/sgcxForm1.aspx','http://cbse.nic.in/Scholarship/Webpages/Guidelines%20for%20SGCX%20(Fresh%20&%20Renewal)_2015.pdf','CBSE Merit Scholarship for Single Girl Child is for Class 11 and 12 girl students with a stipend of Rs 500 per month. Lets fill the form an apply now!','CBSE Merit Scholarship for Single Girl Child 2015- ScholFin','http://www.scholfin.com/scholarship-details/CBSE-Merit-Scholarship-for-Single-Girl-Child/','',0,0,0),(206,'Priyamvada Birla Scholarship ','Madhav Prasad Priyamvada Birla Apex Charitable Trust',25,0,0,75000,'2015-08-02 13:06:54','1. In the year 2015, 2nd August was the last date of submitting completed applications.\r\n2. 2nd August,2016 date is expected date. You should check the page again in the month of July-August for updated deadlines. ',3,2,4,24000,'The scholarship of Rs. 24,000/- per year will be awarded to 25 aspirants.',0,0,'2015-08-02 13:06:54',0,'1. You must be admitted in institute in West Bengal and with an aim to pursue a full-time course in B.A., B.Com., B.Sc., BBA, BCA, LLB, BE / B. Tech, MBBS / BDS.\r\n2. The family income should exceed more than Rs. 75,000/- p.a.\r\n3. Students will be shortlisted on the basis of their marks in AISSCE, ISC, IB, Higher Secondary Exams result.\r\n','The Priyamvada Birla Scholarship aims to financially support students thus encouraging them to pursue higher education.   ','A. You can apply online through the official website.\r\nB. For OFFLINE applications: \r\n 1. Download the application form via the website.\r\n 2. Submit the documents mentioned in the application form.\r\n  3. Submit the application to your institution.\r\n  4. The institution must forward it to the address mentioned on website.\r\n','South Point High School\r\n82/7A Ballygunge Place Kolkata - 700019\r\nWest Bengal, India.\r\nTel: +91 33 24405115 \r\n        +91 33 24405042\r\n        +91 33 24404043\r\n ','http://pbs.southpoint.edu.in/','http://pbs.southpoint.edu.in/Brochure%20English%202015.pdf','Priyamvada Birla Scholarship 2015 is for Undergraduate students of West Bengal for Engineering, Science, arts, BCA, and all other courses. Lets fill the form & apply now!','Priyamvada Birla Scholarship 2015 - ScholFin ',' ','',0,0,0),(207,'Junior Science Talent Search Examination (JSTSE) 2015-16','Science Branch of Directorate of Education, Government of NCT of Delhi',150,0,0,0,'2015-10-30 13:06:54','The Junior Science Talent Search Examination (JSTSE) will be held on 31 January, 2016.\r\n',0,0,0,0,'Total 150 students will be awarded under this scholarship each year.',0,0,'2015-08-02 13:06:54',2,'You must be a student of class IX to participate in this exam.','The examination consists of two papers:\r\n\r\nA. General Knowledge \r\n  1. No. of Questions: 50 \r\n  2. Marks: 50 \r\n        3. Time Allotted: 50 min\r\n\r\nB. General Science and Mathematics \r\n  1. No. of Questions: 150 \r\n 2. Marks: 150 \r\n  3. Time Allotted: 150 min.','1. You can apply for the Junior Science Talent Search Examination (JSTSE) through your school only.\r\n2. The examination is free of cost.\r\n3. Attest three copies of your application form from the head of your institution. Enclose caste/PH certificate, if applicable.\r\n4. Submit the documents to the following address:\r\n\r\nScience Branch Office\r\nGovernment of NCT, Delhi\r\nDirectorate of Education, Science Branch\r\nOld Gargi College Building (behind LSR College)\r\nLajpat Nagar-4, New Delhi-24','Government of NCT, Delhi\r\nDirectorate of Education, Science Branch\r\nOld Gargi College Building (behind LSR College)\r\nLajpat Nagar-4, New Delhi-24\r\nPhone- 011- 26280413\r\nEmail- sciencebranch@gmail.com','http://it.delhigovt.nic.in/writereaddata/Cir2014521241.pdf',' ','Junior Science Talent Search Examination (JSTSE) 2015-16 is for school students of class 9.Students can participate through school.Let\'s fill the form and Apply now!','Junior Science Talent Search Examination 2015 - ScholFin',' ','',0,0,0),(208,'International Taxation Essay Competition 2015','Foundation for International Taxation',5,0,0,0,'2015-11-30 13:06:54',' ',0,0,0,0,'Five winners will be honoured at the International Taxation Conference to be held in Mumbai on 3-5 December, 2015.\r\n',0,2,'2015-08-02 13:06:54',0,'You must be below 35 years of age.','1. You can write your essay on any topic of International Taxation.\r\n2. The essay cannot be more than 10,000 words, including foot-notes and appendices.\r\n3. The essay must be original and not published elsewhere.','You have to submit the essay via mail to internationaltax.foundation@gmail.com. ','Ms. Anju Kalra, Co-ordinator\r\nFoundation for International Taxation\r\n622, Maker Chambers V, \r\n6th Floor, 221 Nariman Point, \r\nMumbai - 400021\r\nTel: Ms. Anju Kalra, 91-22-2202 4259/61 \r\nFax: 91-22-2202 4260 \r\nEmail: internationaltax.foundation@gmail.com','http://www.fitindia.org/downloads/file_4_52.pdf',' ','International Taxation Essay Competition 2015 is for Undergraduate, Post-Graduate, Ph.D, Research and school students below 35 years of age.Let\'s fill the form & Apply.','International Taxation Essay Competition 2015 - ScholFin',' ','',0,0,0),(209,'S.G.P.C. Cambridge Scholarships ','Shiromani Gurdwara Parbandhak Committee, Amritsar, Punjab',0,0,0,0,'2015-08-02 13:06:54','Applications under this scholarship scheme are accepted throughout the year.You should visit the page again for updated deadlines.',1,2,5,25000,'1. You will be awarded an amount of 25000/- GBP p.a., provided you are admitted in a research degree course to the University of Cambridge. \r\n2. The amount of scholarship will be shared equally (50:50) by S.G.P.C. and University of Cambridge through CCT.',3,0,'2015-08-02 13:06:54',1,'1. You must be a Sikh by religion.\r\n2. You will have to give an undertaking in the form of Judicial Bond to Director Education, SGPC that after completion of your course, you will be working as an employee in any institution of Higher Education of SGPC for at least 3 years. ','Shiromani Gurdwara Prabandhak Committee, Amritsar, in association with the University of Cambridge has launched this scholarship scheme, aiming to provide financial support to students to pursue higher studies in foreign. ','1. You should download the application form from the website and send it by post to address mentioned on website\r\n2. You should also submit a DD of Rs 1,000 along with the application form.','Dr.Vandana Narula\r\nMob: 09876933333\r\nE-Mail: vandananarula@rediffmail.com\r\n\r\nOr \r\n\r\nDirectorate Of Education\r\nShiromani Gurdwara Parbandhak Committee\r\nKalgidhar Niwas, Sector 27B, Chandigarh Madhya Marg, \r\nChandigarh\r\nPhone: 0172-2640101, 2640102','http://desgpc.org/download.php?form=Registration%20Form.pdf','http://desgpc.org/uk.html','Shiromani Gurdwara Parbandhak Committee S.G.P.C. Cambridge Scholarships is for Sikh students for M.phil and P.hd in Cambridge university. Fill the form and apply now','S.G.P.C. Cambridge Scholarships 2015-16 - ScholFin',' ','',0,0,0),(210,'RMO Delhi 2015- Regional Mathematical Olympiad','Homi Bhabha Centre for Science Education (HBCSE) ',30,0,0,0,'2015-11-02 13:06:54','1. The Regional Mathematical Olympiad will be conducted on December 6, 2015 (Sunday) between 1 PM and 4PM.\r\n2. The Indian National Mathematics Olympiad 2015- INMO will be held on February 7, 2016.',0,0,0,0,'Around 30 students from each region are selected for Stage 2',0,2,'2015-08-02 13:06:54',2,'You must be a student of class IX-XI to participate in this competition.\r\nStudents from Class 8 may also take RMO at the discretion of the Regional Coordinator.','The duration of the paper will be in two slots: 2 and 3 slots each.\r\nThe first test is based on the MCQ pattern. The second paper consists of subjective questions.\r\n','If you are a student of Delhi/NCR region:\r\n1. You must apply online.\r\n2. Your school must approve the applications electronically.\r\n3. A DD of Rs. 100/- must be forwarded by your school to the following address:\r\n  Prof. A. Tripathi\r\n Department of Mathematics\r\n Indian Institute of Technology\r\n  Hauz Khas, New Delhi 110016.\r\n\r\nYour school must first register themselves be sending an email to Delhi RMO.','Prof. A.Tripathi\r\nDepartment of Mathematics\r\nIndian Institute of Technology\r\nHauz Khas, New Delhi 110016\r\nPhone: 011-26591486\r\nE-mail: rmo.delhi@gmail.com','http://rmodelhi.in/wp-login.php?action=register','http://rmodelhi.in/','RMO Delhi 2015 - Regional Mathematical Olympiad is for class 9-11 school students from Delhi, Faridabad, Ghaziabad, Gurgaon & NOIDA.Let\'s fill the form & Apply.','RMO Delhi 2015- Regional Mathematical Olympiad - ScholFin',' ','',0,0,0),(211,'Shri Brihad Bharatiya Samaj Scholarships ','Shri Brihad Bharatiya Samaj',200,0,0,60000,'2015-08-02 13:06:54','1. In the year 2015, 2nd August was the last date of submitting completed applications.\r\n2. 2nd August,2016 date is expected date. You should check the page again in the month of july-August for updated deadlines. ',3,0,0,0,' ',0,0,'2015-08-02 13:06:54',1,'1. If you are a first-year student, you must secure 70%, else 60%  marks in your previous examination.\r\n2. Female students studying in first year and above for Nursing and Education [minimum of 45% marks] are eligible.\r\n3. Your family income must be more than Rs. 60,000/-.\r\n4. You must have obtained a first-class degree from a recognised university and must have a consistently a first-class score from SSC examination.\r\n5. You must not be above 27 years of age.\r\n','Shri Brihad Bharatiya Samaj offers Scholarships for the meritorious Indian students and overseas students of Indian origin, undergoing full-time Professional Degree courses, hence encouraging them to pursue education and do research.','Interested students should apply on a plain paper to giving all details including the percentage of marks and class obtained in all examinations commencing from SSC along with a 25 cms ×18 cms self-addressed envelope with Rs.20/- stamps affixed on the following address:\r\n\r\nShri Brihad Bharatiya Samaj\r\nNo. 178, N. K Mehta International, \r\nBackbay Reclamation, Nariman Point, \r\nMumbai - 400021\r\nPhone:022 2202 0113\r\n\r\n\r\nNOTE: The prescribed application forms will be sent only to those students who possess the requisite qualifications','Shri Brihad Bharatiya Samaj\r\nNo. 178, N. K Mehta International, \r\nBackbay Reclamation, Nariman Point, \r\nMumbai - 400021\r\nPhone:022 2202 0113',' ',' ','Shri Brihad Bharatiya Samaj Scholarships 2016 is for undergraduate studies in India and abroad foe Engineering, medical etc.  Lets fill the form and apply now!','Shri Brihad Bharatiya Samaj Scholarships 2016- ScholFin',' ','',0,0,0),(212,'Education Means Based Grants- Dorabji Tata Trust','Sir Dorabji Tata Trust',0,0,0,0,'2015-12-31 13:06:54','Your application must reach the office by 31st December of this year. You are eligible to apply after paying the current year\'s fees.',0,0,0,0,'The amount awarded will be based on the income of your family.',0,0,'2015-08-02 13:06:54',1,'You must be a student studying in Mumbai.','The Sir Dorabji Tata Trust extends financial assistance and supports students for the cost of their studies in Mumbai.','Candidates may apply for an Education Means Grant by submitting a detailed application, along with 