e your query directly at http://www.chevening.org/contact-us','https://chevening.tal.net/vx/lang-en-GB/mobile-0/appcentre-1/brand-3/candidate','http://www.chevening.org/apply','Chevening Scholarship 2015 for Study in UK is for Graduate students with 2 years of work experience to pursue Post-Graduate degree.Let\'s fill the form & Apply now.','Chevening Scholarship 2015 for Study in UK - ScholFin',' ','',0,0,0),(214,'J.N. Tata Endowment for Higher Education','Sir Dorabji Tata Trust',0,0,0,0,'2016-03-09 13:06:54','1. The application is to be submitted from December 8, 2015 to February 16, 2016.\r\n2. The forms must reach the Endowment\'s office before March 9, 2016.\r\n3. You must visit the website during December 2015 for updates.',3,0,0,600000,'1. The J.N. Tata Endowment offers loan scholarships only.\r\n2. The loan amount can only be between Rs.1,50,000/- and  Rs.6,00,000/-\r\n3. Selected scholars may also qualify for a gift scholarship from the Jamsetji Tata Trust and a Travel Grant from the Sir Dorabji Tata Trust.\r\n4. You may also get a gift scholarship which amount to a maximum of Rs 10,00,000/-',0,0,'2015-08-02 13:06:54',1,'1. You must be a citizen of India to apply for this scholarship.\r\n2. You must be below 45 years of age.','The J.N. Tata Endowment offers loan scholarships for higher studies abroad. The loan amount ranges between Rs.1,50,000/- and  Rs.6,00,000/-. ','1. You should fill the application form from the Endowment’s administrative office, personally.\r\n2. Else, you can request for the form through money order or DD in favour of “The J. N. Tata Endowment” mentioning your full name, contact numbers and address.\r\n3. Shortlisted candidates will be called in for a personal interview in Mumbai, between March and June.','The J.N. Tata Endowment, Administrative Office, \r\nMulla House, 4th floor, \r\n51, M.G. Road, \r\nFort Mumbai 400 001.\r\n\r\nTel: (022) 66658282, 66657681, 66657198, 66657774\r\nEmail: alotankar@tatatrusts.org; \r\n          sjadhav@tatatrusts.org; \r\n          srane@tatatrusts.org\r\n ','http://www.dorabjitatatrust.org/id/72/J.N.%20Tata%20Endowment%20for%20the%20Higher%20Education%20of%20Indians/',' ','J.N. Tata Endowment for the Higher Education is for studies in Abroad for undergraduate, postgraduate,  Phd and research studies. Lets fill the form and apply now','J.N. Tata Endowment for the Higher Education 2016 - ScholFin ',' ','',0,0,0),(215,'Bhaskara Advanced Solar Energy (BASE) Fellowship ','The Department of Science and Technology, Govt. of India, and the Indo-U.S. Science and Technology Forum (IUSSTF)',7,0,0,0,'2015-11-15 13:06:54',' ',0,0,0,0,'The following will be awarded under this scheme:\r\n\r\n1. Monthly Stipend\r\n2. Return Airfare\r\n3. Emergence expense.\r\n',0,0,'2015-08-02 13:06:54',2,'1. You must be below 40 years & must have Ph.D. in Science/Engineering/Technology.\r\n3. You must be a permanent employee in a public-funded R&D Laboratory/S&T institution (non-private)/recognized academic institute (University/College) in India.\r\n4. You must be a researcher in the field of Solar Energy.\r\n5. You must have letter of acceptance from a reputed U.S. institution of technology/science, where you will undertake research work.\r\n','The Bhaskara Advanced Solar Energy (BASE) Fellowship aims to financially support the Ph.D. scholars and encourage them to pursue research in the field of solar power.\r\n','Submit the application along with the following documents:\r\n\r\n1. Acceptance letter from host institute in the United States.\r\n2. Letter of Endorsement/No-Objection Certificate, as per the format indicated on Page 6 of the application form, from the Head of the parent institution.\r\n3. Applications are to be forwarded by the Head of the Institution and should be submitted electronically to jcerdc@indousstf.org.\r\n','Indo-U.S. Science and Technology Forum\r\nFulbright House 12, Hailey Road New Delhi – 110001\r\nPhone: +91-11-42691700/709 \r\nE-mail: jcerdc@indousstf.org','h