an Tata Trust',0,0,0,0,'2016-08-02 13:06:54','1. Students proceeding for session between the months July, August and September have to submit the application to the Trust\'s office, after finalizing the university for which they wish to join.\r\n2. Students proceeding for the spring session have to contact the Trusts 3-4 prior to the date of departure, after finalizing the university for which they wish to join.\r\nYou should check the page for updated deadlines.',1,0,0,0,' ',0,0,'2015-08-02 13:06:54',1,'1. You must be a student pursuing  post-graduate/doctoral studies.\r\n2. You must be a professional going for your mid-career programmes, a seminar or a conference abroad. \r\n ','Sir Ratan Tata Trust Travel Grant aims to provide support for travel expenses to the students proceeding for post-graduate and doctoral studies and for professionals proceeding for their mid-career programmes or to attend seminars and conferences abroad.','Submit the Application form along with the following documents.\r\n1. Resume.\r\n2. Admission letter from the university in which you secured an admission abroad.\r\n3. Letter of invitation from organizers, along with the leave letter from your employer(s).\r\n4. Recent pay slip(s) of all earning members in your family.\r\n\r\n\r\nSend the above documents along with the form to the address mentioned on the website.','The Secretary & Chief Accountant\r\nSir Ratan Tata Trust\r\nBombay House\r\nHomi Mody Street\r\nMumbai - 400 001\r\nIndia\r\nTel: 022 6665 8282\r\nFax: 022 6665 8013','http://srtt.org/individual_grants/travel_grants.htm',' ','Sir Ratan Tata Trust Travel Grant is for travelling abroad for post graduate, doctoral and P.hd studies and professional candidates. Lets fill the form and apply now','Sir Ratan Tata Trust Travel Grant 2015-16 | ScholFin',' ','',0,0,0),(218,'Sir Ratan Tata Trust Sports Grant ','Sir Ratan Tata Trust',0,0,0,0,'2015-08-02 13:06:54',' ',1,0,0,0,'The scholarship is provided for all forms of sports, and covers the expenses required for equipment, training gear, coaching and admission fees in any recognized sports institute.',0,0,'2015-08-02 13:06:54',1,'1. You must be a sportsperson competing at the district/state/national/international level.\r\n2. You can be a student pursuing professional courses in sports sciences and sports coaching.\r\n3. You can be a former sportsperson living in impoverished conditions.','Sir Ratan Tata Trust Sports Grant aims to provide financial support to extraordinary sportsperson living in in underprivileged conditions to encourage them to be successful in their life. ','1. Personal written application letter (written by your parents if you\'re below 18 years of age).\r\n2. Photocopies of certificates and paper clippings of achievements & resume.\r\n4. Detail of allowance. \r\n5. Disability certificate (if applicable),\r\n\r\nAll the application should be send by post to the address mentioned on the website.   \r\n\r\n','Sir Ratan Tata Trust, \r\nMulla House (Jehangir Wadia Building), \r\nThird floor, 51, \r\nMahatma Gandhi Road, \r\nMumbai 400 001.\r\nTel: 022 6665 8282 \r\nFax: 022 6665 8013\r\n ','http://srtt.org/individual_grants/sports_grants.htm',' ','Sir Ratan Tata Trust Sports Grant is for sportspersons of all ages for district, state, national and international level. Lets fill the form and apply now!','Sir Ratan Tata Trust Sports Grant 2015-16 | ScholFin',' ','',0,0,0),(220,'Commonwealth Scholarships for Master\'s and PhD study ','The Commonwealth Scholarship Commission',0,0,0,0,'2015-11-19 15:00:52',' 19 November 2015 is the last date to submit the application form.',0,0,0,1200,'The candidate will get the following benefits under this scheme:\r\n1. Airfare,tuition and examination fees.\r\n2. Living expense of about £1,034 per month and £1,268 per month.\r\n3. Expense for study-related travel within UK and overseas as well.\r\n4. Travel expense for Ph.D. scholars for mid-term visit home.\r\n5. Expense for Spouse of £222 per month, if you\'re living with your spouse.\r\n6.Expense for Child of £222 per month for the first child and £109 per month for the second and third child under the age of 16.\r\n7. For those who are widowed, divorced or a single parent child, expense of £444 per month for the first child, and £109 per month for the second and third child under the age of 16 will be covered\r\n',2,0,'2015-08-18 15:00:52',1,'A. You must be intending to pursue studies in the UK in September/October 2016.\r\nB. You must be awarded with either of the following before October 2016.\r\n  1. A first degree of at least upper second class (2:1) honours standard.\r\n  2. A second class degree.\r\n 3. A relevant postgraduate qualification','The Commonwealth Scholarship and Fellowship Plan (CSFP) is one of the prestigious\r\nscholarship schemes for international study in the world\r\n\r\nYou can apply for a Commonwealth Scholarship for the following levels of study:\r\n1. Master’s (one-year course only).\r\n2. PhD.\r\n','Commonwealth Scholarships does not accept direct applications under this scheme. You can apply through the following bodies:\r\n1. National nominating agencies: This is the main route of application.\r\n2. Selected universities/university bodies, which can nominate their own academic staff.\r\n3. Selected non-governmental organizations and charitable bodies.\r\n\r\n ','Woburn House \r\n20-24 Tavistock Square \r\nLondon WC1H 9HF \r\nUnited Kingdom','http://cscuk.dfid.gov.uk/apply/scholarships-developing-cw/',' ','Commonwealth Scholarships for Master\'s and PhD study is for Undergraduate and Postgraduate students.Let\'s fill the form & Apply now.','Commonwealth Scholarships 2015 - ScholFin',' ','',0,0,0),(221,'Sitaram Jindal Foundation Scholarship ','Sitaram Jindal Foundation',12000,0,0,0,'2015-08-18 15:00:52','Applications are accepted throughout the year.You should visit the page again for updated deadlines.',1,1,3,1000,'Followings are the categories of scholarships. Each category has been assigned a different amount of scholarship:\r\nCategory:\r\n 1.  - XI and XII class students (BPL Students Only)\r\n 2.  - ITI Students \r\n 3.  - Graduate and Postgraduate Courses \r\n 4.  - Diploma courses\r\n 5.  - Engineering & Medicine Courses\r\n\r\n\r\n',0,0,'2015-08-18 15:00:52',1,'All Indian students are eligible to apply.','The Sitaram Jindal Foundation (SJF) which established in 1969 is a organization which aims to support the poor (but deserving) students in various fields. ','1. You should download the application form through the website.\r\n2. You should attached the following documents with form:\r\n  i.)   Valid Income certificate, not more than two years old.\r\n  ii.)  Physical Disability certificate (if applicable).\r\n  iii.) Copy of SSLC/SSC marksheet and of the last exam passed.\r\n iv.) For those who belong to hostel should a get a certificate from the Warden or owner of private accommodation.\r\n        v.)  For widows and Ex-servicemen : \r\n                 a) PPO.\r\n                 b) Ex-servicemen Widow I-Card. \r\n                 c) Relationship Dependency Certificate.','The Trustee\r\nSitaram Jindal Foundation\r\n\"NATURELLE\"\r\nNo.11, Green Avenue, Behind Sector D III,\r\nVasant Kunj, New Delhi 110 070\r\nPh.011-26890962/63','http://www.sitaramjindalfoundation.org/scholarships.php','http://www.sitaramjindalfoundation.org/assets/images/file/application_form_annex2.pdf ','Sitaram Jindal Foundation Scholarship is for Class 11, 12, diploma, undergraduate, engineering, medical, postgraduate and MBA courses. Lets fill the form and apply! ','Sitaram Jindal Foundation Scholarship 2015-16 | ScholFin ',' ','',0,0,0),(222,'National Handwriting Competition 2015 ','Ask India Society',3,0,0,0,'2015-11-30 15:00:52','Last date for receiving school\'s registration form and DD: 30th November 2015.\r\nLast date to receive student\'s answer sheets: 15th December 2015.',0,0,0,5000,'ROUND 1 will be held in your school. Top three students in each category will be awarded with \'Handwriting Champ of the School\' certificate and medal.\r\nROUND 2 will be held at the state level. Top three winners from each category will be awarded with \'Handwriting Champ of the State\' trophy, a certificate, and gift hamper worth Rs. 2000/-.\r\nROUND 3 will be held at national level. Top three winners from each category will be awarded with \'Handwriting Champ of the Nation\' trophy, a certificate, and gift hamper worth Rs. 5000/-.\r\n',0,0,'2015-08-18 15:00:52',2,'Category A – Students of class I, II, III, IV.\r\nCategory B – Students of class V, VI, VII, VIII.\r\nCategory C – Students of class IX, X, XI, XII.','1. The examination will be held in English.\r\n2. The question paper for Category B and C will be the same. Category A has to write in a four-ruled paper.\r\n3. The duration of the exam is 20 minutes.\r\n4. There will be only one written exam and the same answer sheet will be evaluated for further rounds/levels.','1. You can apply for this scholarship only through your school. A DD of Rs. 70/- in the name of ASK LEARNING CENTRE payable at CHENNAI and the School Registration Form, should reach there before  November 30, 2015.\r\n2. The school-level exam will be conducted before November 30, 2015.\r\n','Ask Learning Centre, \r\n#8/28, Vada Agaram Street, Mehta Nagar,\r\nOff Nelson Manikyam Road, \r\nAbove Dr.Shaji\'s Clinic,Choolaimedu, \r\nChennai - 600029 \r\nTamil Nadu\r\nTel : 044-23741200 / 08056001200\r\nEmail-ID : info@smartwrite.in','http://www.handwritingcompetition.com/guidelines.html',' ','National Handwriting Competition 2015  is for Class 1-12th school/college students.Application is to be made through schools.Let\'s fill the form & Apply now.','National Handwriting Competition 2015 - ScholFin',' ','',0,0,0),(223,'Charles Wallace India Trust Scholarships 2016-17 ','Charles Wallace India Trust',0,0,0,0,'2015-11-30 15:00:52','30 November 2015 is the deadline for Charles Wallace India Trust long term awards.',0,0,0,0,'Ten long-term prizes will be awarded and winners will get an opportunity to study Art and Heritage Conservation in UK for up-to an year. The trust will cover all the expenses including accommodation and living.\r\n',0,0,'2015-08-18 15:00:52',0,'1. You should hold a first degree/diploma & should be between 25 and 38 years of age.\r\n2. Preference will be given to those students who have work experience.','Note:CWIT does not support two year courses.\r\nCWIT covers the following Arts and Heritage Conservation fields of study:\r\n\r\nArts & Visual Arts.\r\nPerformance(e.g. Dance, Drama, Music, Directing.)\r\nFilm - including Script Writing and Direction.\r\nPhotography.\r\nDesign (but not Architecture).\r\nCurating.\r\nArt History.\r\n\r\nHeritage Conservation:\r\n\r\nConservation architecture.\r\nManagement of heritage projects or sites.\r\nConservation of materials such as timber, stone, metal including metal structures, Armour, paintings, photographs and film. \r\nConservation of landscape.\r\nManagement of museums and collections.','Your application should include:\r\n1. Statement of Purpose, mentioning the course you intend to follow, and future plans.\r\n2. IELTS certificate.\r\n3. Letter of invitation for the internship/course/programme.\r\n4. Portfolio/CV.\r\nSubmit the hard copy of application form to the nearest British Council centre. \r\n\r\nAfter selection you will be called by the British Council for an interview in Delhi in late February 2016. Results of the interviews are announced in month of April.','British Council Division \r\nBritish Deputy High Commission \r\n901, 9th Floor, Tower 1 One Indiabulls Centre 841, \r\nSenapati Bapat Marg Elphinstone Road \r\nMumbai\r\n400 013 India\r\nPhone: 1-800-102-4353\r\nFax: +91 22 6748 6814\r\nEmail: mumbai.enquiry@in.britishcouncil.org','http://www.britishcouncil.in/study-uk/scholarships/charles-wallace-trust/long-term',' ','Charles Wallace India Trust Scholarships 2016-17 is for Graduate, post-graduate, ph.d and research students aged between 25-38 years.Let\'s fill the form & Apply.','Charles Wallace India Trust Scholarships 2016-17 - ScholFin',' ','',0,0,0),(224,'TATA Scholarship- Cornell University ','Tata Education and Development Trust',20,0,0,0,'2016-01-02 15:00:52','The deadline for early decision is 1st November 2015 and for Regular decision is 2nd January 2016.',0,0,0,0,'The scholarship will be awarded annually; recipients will receive the scholarship for the duration of their undergraduate studies at Cornell for tuition and accommodation fees.',0,0,'2015-08-18 15:00:52',0,'A. To be eligible for the scholarship, you must be a citizen of India and admitted to an undergraduate course in Cornell.\r\n\r\nB. Preference will be given to the students admitted in one of the following courses:\r\n1. College of Architecture, Art, and Planning.\r\n2. College of Engineering.\r\n3. College of Agriculture and Life Sciences.\r\n4. Colleges in the biological sciences, physical sciences, and other “hard” sciences.\r\n5. College of Social Sciences.\r\n','The TATA Scholarship Fund provides financial aid to about 20 students through scholarship. Outstanding and extraordinary students will get an opportunity to have access to Cornell University, regardless of financial circumstances.','Undergraduate applicants will be eligible for consideration for the Tata Scholarship if they have completed the admission application and have applied for financial aid. All undergraduate applicants must apply for financial aid by completing the financial aid application process for international students.\r\n\r\nTo apply for international financial aid the following documentation is required:\r\n\r\n1. Complete the College Scholarship Service (CSS) PROFILE.\r\n2. Additional information may be requested by the Office of Financial Aid.','Undergraduate Admissions Office\r\nCornell University\r\n410 Thurston Avenue\r\nIthaca, NY 14850\r\nEmail: admissions@cornell.edu','http://admissions.cornell.edu/apply/international-students/tata-scholarship',' ','TATA Scholarship Cornell University is for undergraduate students from India to study in Cornell University. Total Scholarships- 25. Lets fill the form and apply now!','TATA Scholarship Cornell University 2015-16 | ScholFin',' ','',0,0,0),(225,'Teach for India Fellowship','Teach for India',0,0,0,0,'2016-02-02 15:00:51','You are eligible to apply ONLY for one of the following deadlines:\r\n1 :  27th October, 2015\r\n2 :  8th December, 2015.\r\n3 :  2nd February, 2016.\r\n\r\n. ',0,2,2,17000,'1. You will be a paid a salary of Rs. 17,500 p.m.\r\n2. Separate expense  will be covered if you relocate from your home city & expense for school supplies will also be covered.',0,0,'2015-08-18 15:00:51',0,'1. You must attain your undergraduate degree by last week of May 2016. \r\n2. You must be a citizen of India/citizen of Indian origin.','Teach For India Fellowship is a two-year paid task during which you have to work as full-time teachers in under-resourced and low-income schools. throughout the Fellowship, Teach For India enables students to learn from better teachers.\r\n\r\nDuring the second year of the fellowship, you\'ll have to do a school/community level project to address one major obstacle to learning in that community.','You can apply online from the official website.','Teach For India\r\nGodrej One, 2nd Floor\r\nPirojshanagar, Eastern Express Highway\r\nVikhroli (East)\r\nMumbai – 400079\r\nTel : +91 22 25185821/25185823','http://apply.teachforindia.org/user/register',' ','Teach for India Fellowship is for graduate and postgraduate students with a stipend of Rs 17,000pm for teaching 2 years in a school. Lets fill the form and apply!','Teach for India Fellowship 2016 - ScholFin ',' ','',0,0,0),(226,'Fountain Magazine Essay Writing Contest 2015 ','Fountain Magazine',5,0,0,0,'2015-11-30 15:00:51',' ',0,0,0,1500,'1. Winner of the FIRST prize will win a cash prize of $1,500.\r\n2. Winner of the SECOND prize will win a cash prize of $750.\r\n3. Winner of the THIRD prize will win a cash prize of $300.\r\n4. Besides, two candidates will get honourable mentions worth $200.\r\n\r\n',1,2,'2015-08-18 15:00:51',0,'Open to all','The Fountain Magazine Essay Writing Contest 2015 is a national level essay-writing competition. \r\n\r\nThe topic of the Essay will be: What do you think the theme of the 21st century will be?The age of connections? Rebirth of faith? Clash of civilizations? Age of the internet? Rise of fundamentalism? Interstellar travel? Gender equality? Human trafficking? WW III? Artificial intelligence? Genetics? Cooperation? Competition? Spiritual revolution? Secularism? Values? Ethics?…\r\n\r\nThe word limit is 1500-2500 words.','You have to apply online through the official page and submit your essay.','The Fountain Magazine\r\n345 Clifton Avenue, Clifton,\r\nNJ 07011 USA\r\nTel: +1 888 234 2823\r\nFax: (973) 457-7334','http://essay.fountainmagazine.com/index/sendarticle','http://www.fountainmagazine.com/essaycontest','Fountain Magazine Essay Writing Contest 2015 is for Class1-12th, Undergraduate, post-graduate, ph.d and research students.Let\'s fill the form & Apply now.','Fountain Magazine Essay Writing Contest 2015 - ScholFin',' ','',0,0,0),(227,'WIGH Fellowship 2016-2017 at Harvard University ','Weatherhead Center for International Affairs and Volkswagen Foundation.',0,0,0,0,'2015-12-15 13:52:58','1. The last date for application is 15th December 2015.\r\n2. The last date of submission of letter of reference is 8th January 2016.',0,0,0,50000,'Besides you\'ll get time, guidance, office space, and access to facilities of the Harvard University.',0,0,'2015-08-20 13:52:58',0,'You must hold a Ph.D. degree, or must be receiving one by May 2016.\r\n','The WIGH Fellowship aims to support students aiming for global development and who propose to analyze the interconnections—cultural, economic, ecological, political and demographic—among world societies.','You should apply WIGH fellowship through their website. \r\nYou must hold cover letter which describes applicant’s academic field and proposed or actual research topic,Required Documents,educational profile.','Jessica Barnard\r\nWeatherhead Initiative on Global History\r\nWeatherhead Center for International Affairs\r\nHarvard University\r\n1727 Cambridge Street\r\nCambridge, MA 02138\r\nUSA\r\nEmail-ID: jbarnard@fas.harvard.edu','https://academicpositions.harvard.edu/postings/6255','http://wigh.wcfia.harvard.edu/content/wigh-fellowships-2016-2017','WIGH Fellowship 2016-2017 at Harvard University - Study of Global History is for Ph.D students for one year with stipend of $50,000.Let\'s fill the form & Apply.','WIGH Fellowship 2016-2017 at Harvard University - ScholFin',' ','',0,0,0),(228,'ADB Bank Japan Scholarship Program 2015','ADB Bank',0,0,0,0,'2015-12-31 13:52:58','The deadline varies for each institution. For details/queries, contact your school administration.',1,0,0,0,'The ADB Bank provides 2-year scholarship to deserving students. The scholarship scheme cover the following:\r\n1. Tuition fees.\r\n2. Housing allowances.\r\n3. Medical insurance.\r\n4. Travel expenses.\r\n\r\nBesides, research scholars will be funded for thesis preparation.',0,0,'2015-08-20 13:52:58',0,'1. You must be a graduate student (with good academic record) admitted in an M.A/Ph.D. course in a recognised institution.\r\n2. You must have at least two years of professional work experience.\r\n3. You should be below 35 years of age. For senior officials and managers, the age limit is 45 years.','The ADB Bank Japan Scholarship Program aims to provide financial-aid to deserving and meritorious candidates, hence encouraging them to undertake postgraduate studies in economics, management, science and technology,  and other development-related fields.','1. You can get information/application form from the chosen academic institution(s).\r\n2. Enclose the following documents alongwith your application form:\r\n 1. Latest Income Tax Return OR Certificate of your salary.\r\n  2. Certificate of Family Income.\r\n','Room 7729 East\r\nAsian Development Bank\r\n#6 ADB Avenue, Mandaluyong City 1550, Metro Manila, \r\nPhilippines\r\nTel: +632 636 2444, +632 636 2456','http://www.adb.org/site/careers/japan-scholarship-program/procedures-applying','http://www.adb.org/site/careers/japan-scholarship-program/frequently-asked-questions','ADB Bank Japan Scholarship Program 2015 is for Graduate students who wish to pursue Post-Graduate studies or Ph.D degree.Let\'s fill the form and Apply now.','ADB Bank Japan Scholarship Program 2015 - ScholFin',' ','',0,0,0),(229,'Tata Building India Online essay competition for 2015-16 ','Tata Group of Companies',0,0,0,0,'2016-07-31 18:07:27',' ',0,0,0,0,'Winning entries will receive Certificates and fabulous prizes.\r\nAll winners will receive citation.\r\nPrizes will be awarded for school, city and national level winners.',0,2,'2015-09-10 18:07:27',0,'Class 6-12','Topic for the Essay: After registration random topics would be displayed.\r\nThe students gets 90 Minutes to write the essay with a maximum word limit of 1000 words.','Online Registration: Click here for online registration of Tata Building Online Essay Competition.  Registration should be done online.\r\nMultiple entries could be sent by a participant.\r\nThe latest entry submitted by the participant will be considered for evaluation.','Email-ID:  tatabuildingindia@tata.com ','http://tatabuildingindia.com/New-Site/index.php/essay','http://tatabuildingindia.com/New-Site/index.php/tbi-online','Tata Building India Online essay competition for 2015-16 is for class 6-10 school students and 11-12th college students from arts, science or commerce field.','Tata Building India Online essay competition 2015- ScholFin',' ','',0,0,0),(230,'International Maths Olympiad IMO 2016','International Mathematical Olympiad',0,0,0,0,'2016-07-16 18:07:27','This is the expected deadline according to last year. You are advised to visit the website few months prior to confirm the same.',3,0,0,0,'Students will be given Gold medals,  Silver medals, Bronze medals & Honourable mentions as per their performance in the Maths Olympiad.',0,2,'2015-09-10 18:07:27',0,'Class 9, 10 and 11','The International Mathematical Olympiad (IMO) is the World Championship Mathematics Competition for High School students and is held annually in a different country.IMO 16 will be held in Hong Kong.','In order to participate and represent their respective countries, candidates have to first take part in RMO i.e. Regional Mathematical Olympiad and then after qualifying RMO, they will be able to take part in INMO  i.e. Indian National Mathematical Olympiad.\r\nThe top 30-35 students in merit from all over the country are chosen as INMO awardees.\r\nThe INMO awardees are invited to a month long training camp in April-May each year at the Homi Bhabha Centre for Science Education (HBCSE), Mumbai. The INMO awardess of the previous years who are eligible for IMO 2015 are also called. based on a number of selection test,the final selection of best 6 students is made to represent India in IMO 2016.\r\nThen, the selected candidates list will be sent to the authority IMO from India\'s end.','Email-ID: srisr@ipst.ac.th \r\n               amporn.ta@cmu.ac.th','http://www.imo-official.org/','http://www.imo2016.org/Home.php','International Maths Olympiad IMO 2016 is going be held in Hong Kong. Class 9,10 and 11th students who have cleared RMO and INMO are eligible for this competition.','International Maths Olympiad IMO 2016 - ScholFin',' ','',0,0,0),(231,'The Barakat Trust Scholarships','Barakat Trust ',21,0,0,0,'2016-02-15 18:07:27','1. In the year 2015,15 February  was the last date of submitting completed applications.\r\n2. 15 February ,2016 date is expected date. You should check the page again for updated deadlines. ',3,0,0,10000,'Scholars and Related Projects: \r\n1.) One Senior Visiting Scholarship of £10,000.00 to enable an established Muslim scholar from the Islamic world to come to the UK for three months to carry out a specific programme of research.\r\n2.) Grants with an upper limit of £1,000 each towards research trips, projects, documentation, and education programmes. \r\n3.) Applications for assistance of over £1,000 each towards research trips, projects, documentation, and education programmes.\r\n\r\nConservation: \r\n4.) Grants with an upper limit of £7,000 each towards a conservation project or the training of a conservator.\r\n\r\nPer Diem for Conferences: \r\n5.) Grants with an upper limit of £1,000 each towards attending a conference.\r\n\r\nPublication: \r\n6.) Grants towards the cost of publication of between £1,500 and £6,000.\r\n\r\nDigitisation: \r\n7.) A grant of up to £50,000 per year, for a maximum of three years, towards the costs of making available online any collection of Islamic art, architecture or archaeology. The grant is made from zak?t, and therefore only Muslims and Islamic institutions (including libraries and museums in Islamic lands) are eligible to apply. Institutions which can raise matching funds may receive priority. Successful applicants must undertake to adhere to the standards for digitisation agreed with the Barakat Trust.\r\n\r\nB. Grants for Study in Oxford\r\n\r\nOne Post-Doctoral Research Scholarship of £18,000: B.1. To enable a senior Muslim post-doctoral scholar to spend from October to June in Oxford to carry out a specific programme of research or prepare such research for publication. Please see the separate guidelines to this grant.\r\n\r\nOne Junior Graduate Scholarship: B.2. To cover one year\'s fees for a Muslim student already accepted by the Faculty of Oriental Studies to read for an M.St or M.Phil in Islamic Art and Archaeology at the University of Oxford. Renewal for the second year of the M.Phil may be granted to candidates who perform well in the qualifying examination, but the grant may not be extended to cover doctoral studies.',3,2,'2015-09-10 18:07:27',0,'1. Applicants for scholarships and academic research must have completed at least a B.A. degree.\r\n2. Trust will not accept applications in any other field than Islamic Art History, Architecture and Archaeology under any circumstances..','The Barakat Trust is a UK registered charity which provides financial support for the study and research of the material and visual cultures of Islamic societies and provides scholarships and grants in Islamic Art History, Architecture, and Archaeology institutions at post-graduate and post-doctoral level. ','You should download the application form from the website and submit the following documents along with the form-\r\n\r\n1. An electronic example of your work.\r\n2. Two references sent independently from referees, which must be received by the closing date for applications. Referees should be acquainted with the candidate and his or her work, and in the case of scholarly research, should be senior academics. ','The Administrator\r\nThe Barakat Trust\r\nThe Oriental Institute\r\nThe University of Oxford\r\nOxford OX1 2LG\r\nUK\r\n\r\nEmail ID - barakat.trust@orinst.ox.ac.uk','http://www1.barakat.org/index.php/en/application-process',' ','The Barakat Trust Scholarships is for Muslim and Islamic students for studies in architecture, archaeology, history and arts in UK and abroad.','The Barakat Trust Scholarships 2016 - ScholFin',' ','',0,0,0),(232,'Nikon Small World Photomicrography Competition 2016','Nikon',20,0,0,0,'2016-04-30 18:07:27',' ',0,0,0,3000,'1ST PRIZE\r\n$3,000\r\n\r\n2ND PRIZE\r\n$2,000\r\n\r\n3RD PRIZE\r\n$1,000\r\n\r\n4TH PRIZE\r\n$800\r\n\r\n5TH PRIZE\r\n$600\r\n\r\n6TH PRIZE\r\n$400\r\n\r\n7TH–10TH PRIZES\r\n$250\r\n\r\n11TH–20TH PRIZES\r\n$100\r\n\r\nHONORABLE MENTIONS\r\nA commemorative print.\r\n\r\nKindly Note: The award winning prize money has to be redeemed in exchange of Nikon products only, directly from Nikon USA, and cannot be redeemed for cash',1,2,'2015-09-10 18:07:27',0,'All amateurs and professionals(18 years & above) can apply.','Nikon Corporation conducts Nikon International Small World Competition every year since 1975  and offers a chance to the photomicrographers across the globe to communicate and to enhance the image making culture uniform for amateurs and professionals.The Photomicrographs must be taken using a light microscope and should be original work of the photographers and should not be submitted anywhere else.','The applicants are required to apply through Online Application System \r\nThe applicants will have to fill in the Small World Contest application form and upload their work.\r\nApplicants can submit max 3 photos & 1 video.','Nikon’s Small World Competition,\r\nNikon Instruments Inc., \r\n1300 Walt Whitman Road, Melville, \r\nNY 11747-3064 USA\r\nEmail- info@nikonsmallworld.com','https://www.microscopyu.com/smallworld/registration/entrypage1.aspx','http://www.nikonsmallworld.com/photo/info','Nikon Small World Photomicrography Competition 2016 is for both amateurs and professional photomicrography above 18 years of age.Let\'s fill the form and apply!','Nikon Small World Photomicrography Competition 2016-ScholFin','http://www.tooplate.com/','',0,0,0),(233,'Fountainhead Essay Contest 2015 by Ayn Rand ','Ayn Rand Education',175,0,0,0,'2016-04-29 18:07:27',' ',0,0,0,10000,'1ST PLACE\r\n$10,000\r\n1 Winner\r\n\r\n2ND PLACE\r\n$2,000\r\n5 Winners\r\n\r\n3RD PLACE\r\n$1,000\r\n10 Winners\r\n\r\nFINALISTS\r\n$100\r\n45 Winners\r\n\r\nSEMIFINALISTS\r\n$50\r\n175 Winners',1,2,'2015-09-10 18:07:27',3,'Class 11 and 12 students of any region.\r\nPast first-place winners are not eligible for this contest.\r\n','Fountainhead Essay Contest 2015 by Ayn Rand  is an essay competition where students have to write an essay on any of the three topics : \r\n\r\nWhy does Roark say that his refusal of the Manhattan Bank Building contract is “the most selfish thing you’ve ever seen a man do”?\r\n\r\nEllsworth Toohey and Gail Wynand both spend much of their lives consciously seeking power over others. But is their quest for power the same? How do each man’s goals and motivations contrast to those of Roark?\r\n\r\nThe conventional view is that in life one can either achieve practical success or be moral, but not both. What view of the relation between the moral and the practical is conveyed in The Fountainhead? What is the novel’s conception of success? Of morality? Explain by reference to characters and events in the story.','Online: Candidates can submit their essay online. \r\n\r\nOffline: Candidates can mail their duly written essay with stapled cover sheet to:\r\nThe Fountainhead Essay Contest \r\nThe Ayn Rand Institute \r\nP.O Box 57044 \r\nIrvine, CA 92619-7044','The Fountainhead Essay Contest\r\nThe Ayn Rand Institute \r\nP.O. Box 57044 Irvine, CA 92619-7044\r\n\r\nTel : 949-222-6550 ext. 259\r\nEmail-ID : essays@aynrand.org','https://www.aynrand.org/students/essay-contests#submit','https://www.aynrand.org/students/essay-contests#overview','Fountainhead Essay Contest 2015 by Ayn Rand is an essay competition for 11 and 12th class students with science, commerce or arts as their major.Let\'s fill the form and a','Fountainhead Essay Contest 2015 by Ayn Rand - ScholFin',' ','',0,0,0),(234,'Udayan Shalini Fellowships - USF ','Udayan Care',1000,1,0,96000,'2015-09-10 18:07:27',' ',1,0,0,24000,'1. For Class XI - XII - Rs 24000\r\n2.  After Class XII\r\n     a) College - Rs 42000\r\n     b) Vocational Studies - Rs 24000\r\n     c) Higher Studies - Rs 96000',0,0,'2015-09-10 18:07:27',1,'1. Girls who have completed Class X and are studying in Class XI from Government/Government subsidize schools are eligible to apply for the Udayan Shalini Fellowships.\r\n2. Total income of the family members/ guardian should not exceed Rs. 96,000/- per annum.\r\n3. Minimum marks required for Fellowships for academic courses is 60%\r\n4. Candidates are required to obtain admission to the desired school prior to seeking Fellowships.\r\n\r\nNOTE: You must be a permanent resident of one of the following cities\r\na. Delhi    \r\nb. Dehradun    \r\nc. Kolkata    \r\nd. Kurukshetra    \r\ne. Aurangabad   \r\nf. Phagwara   \r\ng. Haridwar   \r\nh. Gurgaon  \r\ni. Hyderabad \r\nj. Jaipur','The Udayan Shalini Fellowships initiated in 2002, aim to ensure no girl with the drive to learn is denied her dream, due to lack of support.','Girls who have completed Class X, appear for a N.A.T- a test conducted by Udayan Care, which actually determines the qualities of students.\r\n1. You should fill the application form and submit it on the address mentioned on website.\r\n2. After the forms gets valuated, students selected are called for a written test. \r\nwritten test topics includes:\r\n     a.   general knowledge.\r\n     b.   personal aptitude.\r\n     c.   awareness on social issues.\r\n3. After clearing the test students are called for an interview with the family to evaluate the girl\'s needs and support of the family.\r\n4. After the interviews, applicants are visited at home by our social worker/s to assess the overall situation of the candidate\r\n5. Those finally selected are awarded the Udayan Shalini Fellowships.\r\n\r\nYou can download the application form from the website and send it by post to the given address.','UDAYAN CARE\r\n16/97A, 1st Floor Vikram Vihar,\r\nLajpat Nagar – IV, New Delhi – 110024\r\nTelephone No. 011-46548105/06\r\nEmail: usf@udayancare.org','http://www.udayancare.org/Admission-Process.html ','http://www.udayancare.org/Application%20form%2015-16%20-%20Delhi%20-%20Website%20(1).pdf','Udayan Shalini Fellowships is for girl students of Class 11 and 12 residing in Delhi,Dehradun,Kolkata,Kurukshetra,Aurangabad, Phagwara,Haridwar,Gurgaon,Hyderabad,Jaipur','Udayan Shalini Fellowships 2016 - ScholFin',' ','',0,0,0),(235,'Vishwa Konkani Scholarship - Bachelor Program ','Vishwa Konkani Student Scholarship Fund',400,0,0,450000,'2016-07-10 18:07:27','Online applications are open from June 10th to July 10th every year.You should check the page again in the month of June-July for updated deadlines. ',0,0,0,40000,' ',0,0,'2015-09-10 18:07:27',0,'1. Students with Konkani language as their mother tongue, who have completed their Pre-University course and are pursuing degree education in any branch of Engineering or Medical streams may apply for this Scholarship Programme.\r\n2. Only students who are seeking admission to the First year of the respective courses may apply.\r\n3. 70% in core subjects and Entrance Rank within 20,000. (For Lateral Entry the Entrance Rank should be within 3000)','Vishwa Konkani Scholarship - Bachelor Program is the Flagship programme of VKSSF and awards Scholarships for Bachelor Degree Education in the streams of Engineering and MBBS. The Scholarship Amount of Rs. 30,000 and Rs. 40,000 per year per student respectively. Since its inception in 2010 VKSS has awarded more than 2000 Scholarships under this programme.','1. You should create a Scholarship Common Application Platform (SCAP) Account on website.\r\n2. You should build your profile page & then directly view and apply for the scholarship.','Konkani Bhas Ani Sanskriti Prathistan\r\n(Konkani Language and Cultural Foundation)\r\nWorld Konkani Centre, Konkani Gaon,\r\nShakti Nagar, Mangalore 575016\r\n\r\nPhone: 91 824 2231877, 2231887\r\n\r\nEmail: baraya@vishwakonkani.org, \r\n          worldkonkani@gmail.com','http://konkanischolarship.com/','http://vishwakonkani.org/scholarships/#','Vishwa Konkani Scholarship Bachelor Program is for undergraduate first year students of engineering and medical/MBBS whose mother tongue is Konkani.','Vishwa Konkani Scholarship Bachelor 2016 | ScholFin',' ','',0,0,0),(236,'Vishwa Konkani Master Degree Scholarship ','Vishwa Konkani Student Scholarship Fund',0,0,0,450000,'2016-07-10 18:07:27','Online applications are open from June 10th to July 10th every year.You should check the page again in the month of June-July for updated deadlines. ',0,0,0,0,'The rate of scholarship varies from discipline to discipline.',0,0,'2015-09-10 18:07:27',0,'1. Students with Konkani language as their mother tongue, who are willing to secure admissions & who have completed their Bachelor Degree course and pursuing Master Degree education in any course can apply for this Scholarship.\r\n2. Only students who are seeking admission to the First year of the respective courses may apply.\r\n3. Aggregate of 70% Marks or 7.75 CGPA','VKSSF offers Scholarships for Master Degree courses in any discipline.Students with Konkani language as their mother tongue, who are willing to secure admissions & who have completed their Bachelor Degree course and pursuing Master Degree education in any course can apply for this Scholarship.','1. You should create a Scholarship Common Application Platform (SCAP) Account on website.\r\n2. You should build your profile page & then directly view and apply for the scholarship.','Konkani Bhas Ani Sanskriti Prathistan\r\n(Konkani Language and Cultural Foundation)\r\nWorld Konkani Centre, Konkani Gaon,\r\nShakti Nagar, Mangalore 575016\r\n\r\nPhone: 91 824 2231877, 2231887\r\n\r\nEmail: baraya@vishwakonkani.org, \r\n          worldkonkani@gmail.com','http://konkanischolarship.com/','http://vishwakonkani.org/scholarships/#','Vishwa Konkani Scholarship Masters Program is for students of all disciplines whose mother tongue is Konkani and want to pursue higher education in any field.','Vishwa Konkani Scholarship Masters 2016 | ScholFin',' ','',0,0,0),(237,'Developing Solution Master’s Scholarship to study in UK ','Nottingham University',105,0,0,0,'2015-04-24 18:07:27','1. In the year 2015, 24th April was the last date of submitting completed applications.\r\n',0,0,0,0,'100% tuition fee waiver - 30 rewards\r\n50% tuition fee waiver - 75 rewards',0,0,'2015-09-10 18:07:27',0,'1.You should be classified as an overseas student for fee purposes.\r\n2.You should hold an offer to start a full-time masters degree including MRes, at Nottingham for September 2016 in an area of study within the:\r\na.Faculty of Engineering,Medicine & Health Sciences,Science\r\nb.Geography School – courses related to the area of Environment, \r\nc.Business School – courses allied to Operations Management,\r\nd.School of Law – MSC Law and Environmental Science.\r\n3.Students who are pursuing  studying in the UK(presently) are not eligible to apply. \r\n','Developing Solution Master’s Scholarship to study in UK  is to pursue master\'s degree from Nottingham University.While awarding the scholarship, preference will be given to those students who have pursued studied outside their parent country earlier.','You should make an online application for the Scholarship on the official website of University of Nottingham.','International Office:\r\nC Floor, YANG Fujia Building\r\nJubilee Campus, Wollaton Road\r\nNottingham, NG8 1BB, UK','http://www.nottingham.ac.uk/studywithus/international-applicants/scholarships-fees-and-finance/scholarships/scholarshipdetails/dev-sol-masters.aspx',' ','Developing Solution Master’s Scholarship to study in UK is for students who wants to pursue post-graduation from Nottingham University. Let\'s fill the form and apply now.','Developing Solution Master’s Scholarship 2016 - ScholFin','http://www.scholfin.com/scholarship-details/Developing-Solution-Master-s-Scholarship-to-study-in-UK/','',0,0,0),(238,'Anthem Essay Competition 2015 by Ayn Rand','Ayn Rand Education',236,0,0,0,'2016-03-25 18:07:27',' ',0,0,0,2000,'1ST PLACE\r\n$2,000\r\n1 Winner\r\n\r\n2ND PLACE\r\n$500\r\n5 Winners\r\n\r\n3RD PLACE\r\n$200\r\n10 Winners\r\n\r\nFINALISTS\r\n$50\r\n45 Winners\r\n\r\nSEMIFINALISTS\r\n$30\r\n175 Winners',1,2,'2015-09-10 18:07:27',3,' Class 8, 9 and 10','Anthem Essay Competition Topics\r\n\r\n“It is a sin to write this.” So begins Anthem. What is the significance of this opening line to the story and to the meaning of the novel? What view of morality does it embody? What is Equality 7-2521’s eventual assessment of his sin and why? Explain.\r\n\r\nPolitically, Anthem depicts a collectivist society. What ideas do the rulers appeal to in order to justify their collectivist society? How do its rulers retain their power? What enables Equality 7-2521 to escape his society and envision an alternative?\r\n\r\nAnthem portrays a totalitarian world of the future. In contrast to other such portrayals, the world of Anthem is technologically primitive. What does this imply about the nature of science and technology and the conditions for technological progress, and how do events of the story establish that view?','Essay must be no fewer than 600 and no more than 1,200 words in length.\r\n\r\nOnline: Candidates can submit their essay online.\r\nOffline: Candidates can mail their duly written essay with stapled cover sheet to:\r\n\r\nAnthem Essay Contest \r\nThe Ayn Rand Institute \r\nP.O Box 57044 \r\nIrvine, CA 92619-7044','Anthem Essay Contest \r\nThe Ayn Rand Institute \r\nP.O Box 57044 \r\nIrvine, CA 92619-7044\r\n\r\nEMAIL: mail@aynrand.org\r\nPHONE: 949-222-6550\r\nFAX: 949-222-6558','https://www.aynrand.org/students/essay-contests#submit',' ','Anthem Essay Competition 2015 by Ayn Rand is for class 8, 9 and 10th students of any nationality with prize money of 2000USD. Let\'s fill the form and apply now.','Anthem Essay Competition 2015 by Ayn Rand 2016 - ScholFin',' ','',0,0,0),(239,'Vishwa Konkani- Study Abroad Scholarship','Vishwa Konkani Student Scholarship Fund',0,0,0,0,'2015-09-10 18:07:27','Applications are open from June 10th to July 10th every year.You should check the page again in the month of June-July for updated deadlines. ',1,0,0,100000,' ',0,0,'2015-09-10 18:07:27',0,'1.Students with Konkani language as their mother tongue, who are willing to secure admissions in any of the foreign University may apply for this scholarship and students who are willing to seek admission to the First year of the respective courses may apply.\r\n2.70% in core subjects and Entrance Rank within 20,000. (For Lateral Entry the Entrance Rank should be  within 3000)\r\n3.The Family Income of the candidate should not exceed Rs. 4.5 Lakhs per annum.','VKSSF offers Scholarships for pursuing higher education outside India, with Scholarship Amount of Rs. 1.00 Lakh per year per student. Students with Konkani language as their mother tongue, who are willing to secure admissions in any of the foreign University may apply for this scholarship.','1. You should create a Scholarship Common Application Platform (SCAP) Account on website.\r\n2. You should build your profile page & then directly view and apply for the scholarship.','Konkani Bhas Ani Sanskriti Prathistan\r\n(Konkani Language and Cultural Foundation)\r\nWorld Konkani Centre, Konkani Gaon,\r\nShakti Nagar, Mangalore 575016\r\n\r\nPhone: 91 824 2231877, 2231887\r\n\r\nEmail: baraya@vishwakonkani.org, \r\n          worldkonkani@gmail.com','http://www.konkanischolarship.com/','http://vishwakonkani.org/scholarships/','Vishwa Konkani Study Abroad scholarship is for students with Konkani language as the mother tongue with a scholarship of Rs 1 lakh. No parental income limit.','Vishwa Konkani Study Abroad Scholarship 2016 - ScholFin',' ','',0,0,0),(240,'B.D.Bangur Educational Loan Scholarships - NIRMAAN ','B D BANGUR ENDOWMENT',0,0,0,0,'2015-09-10 18:07:27','Advertisements are placed in the leading newspapers and relevant magazines inviting applications for a particular year. Request for application forms should be sent to the office of Endowment at Kolkata yearlong.',1,0,0,100000,'1. The duration of the Endowment\'s loan depends on whether the applicant is in one of the IITs / IIMs or has admission to an institution abroad. In the former case, loans are for a maximum of four years. \r\n2. If the student has admission in a foreign institution, the maximum period of the loan is two years. \r\n3. The Endowment may also consider assistance to candidates for Doctoral studies, as well as those pursuing local certificate and diploma courses in fields such as Photography, Journalism, Health, Sports & Fitness, etc.\r\n4. The maximum amount of loan scholarship will be Rs.1,00,000/-. \r\n5. The sum provided would be sufficient to enable a candidate to meet initial travel and term expenses. Thereafter the candidate will be expected to raise funds from other sources, such as University Scholarship, Fellowship, teaching assistantship or campus jobs.',0,0,'2015-09-10 18:07:27',1,'Applicants for the Endowment\'s loan scholarships must meet the following eligibility criteria: \r\n\r\n1. You must be an Indian Nationals below 35 years of age & shoul be able to establish basic financial need.\r\n2. If you are in the normal academic disciplines, they you should be graduates with a proper academic record of distinction from an recognize Indian university & for those who are   in the final year of a Degree course are also be eligible. However, the selection will be done on good performance in the Final Degree examination. In exceptional cases, loan scholarships may be given for undergraduate studies if the course, deemed otherwise appropriate to the Endowment\'s objective, is not available in India.\r\n3. At the time of applying for the loan scholarship, you should have applied for admission to a University.\r\n','B.D.Bangur Educational Loan Scholarships - NIRMAAN with its focus on education,this organization is committed to support the Indian Nationals who are willing to pursue higher education and become successfully qualified persons.','Advertisements are published in the leading newspapers and magazines to invite applications for a particular year. You should the send a request for application forms to the office of Endowment at Kolkata.\r\nYou should attached the following documents while applying:\r\n1. Bio-data that includes academic background in which subjects offered and Class obtained in particular final examination are   mentioned properly.\r\n2. proof of admission & date of birth.\r\n4. Details of financial support.\r\n5. Report card of the Examinations like GRE, GMAT, TOEFL, etc. (copy)\r\n6. A Postal Order of Rs.50/- towards cost of brochure, application form and courier charges.\r\n4. The Application Form must reach the office of the Endowment on or before the specified date.\r\n\r\n* After selection you will be called for an interview at Kolkata/Mumbai before the Selection Committee\r\n* If you get selected for final interview then from places outside Kolkata/Mumbai beyond 500 kms and upto 750 kms will be paid an amount of Rs.500/- and   from places beyond 750 kms will be paid an amount of Rs.1,000/- towards travel expenses.','B. D. BANGUR ENDOWMENT\r\n\r\n31, Chowringhee Road,\r\nKolkata - 700 016\r\nPhone : +91 33 40029662\r\nEmail : nirmaan@bdbangurendowment.com\r\nShweta Bux\r\nMobile: 8017810567\r\n\r\nDhritiman Dhar \r\nMobile: 9830850150\r\n\r\nA.S.Bhabra \r\nPhone: +91 33 40029644.','http://www.bdbangurendowment.com/education.html',' ','B.D.Bangur Educational Loan Scholarships NIRMAAN is for undergraduate, postgraduate and doctoral studies in India and abroad with a loan of Rs 1 lakh.','B.D.Bangur Educational Loan Scholarships NIRMAAN 2016 - ScholFin',' ','',0,0,0),(241,'GREAT Scholarships for Uk ','British Council',400,0,0,0,'2015-09-10 18:07:27','The scholarships are college specific. Each college has a different application deadline.You should check the website accordingly.',1,0,0,3000,' ',3,0,'2015-09-10 18:07:27',0,'1. You must be an Indian National.\r\n2. You should be planning to study for any of the following disciplines: Engineering, Law, Business, Art & Design, Biosciences and IT','The British Council is a organization which offers scholarships valued around 1.5 million pounds. It inludes more than 400 scholarships.So this is a valuable chance for any Indian students who are willing to pursue their education in UK\r\nStudents can receive these scholarships which includes 83 scholarships under-graduate and 318 scholarships under post-graduate courses. ','You should apply for the scholarship when you are taking admission to any of the colleges specified on the website.','British Council New Delhi\r\nBritish Council Division\r\nBritish High Commission\r\n17 Kasturba Gandhi Marg\r\nNew Delhi - 110 001 \r\n\r\nPhone: 1-800-102-4353\r\nFax: +91 11 2371 0717\r\nEmail: delhi.enquiry@in.britishcouncil.org','http://www.britishcouncil.in/great-scholarships',' ','GREAT Scholarships for Uk is offered by British Council India for studying undergraduate and postgraduate courses in Engineering, Law, Business, Art & Design, Biosciences','GREAT Scholarships Uk 2015-16 | ScholFin',' ','',0,0,0),(242,'Dr Manmohan Singh Scholarship ','University of Cambridge',1,0,0,0,'2015-10-31 18:07:27','  ',0,0,0,0,'The scholarships cover:\r\n1. Academic fees. \r\n2. International airfare,UK Visa.\r\n3. Monthly stipend. \r\n',0,0,'2015-09-10 18:07:27',0,'Applicants should be able to meet the following criteria:\r\n\r\n1. Any Indian with legal Indian passport who is under 35 years of age.\r\n2. Should have no past noticeable exposure related to UK education or any receipt of funding from UK government.\r\n3. Should possess a Master’s (PG) degree from considered Indian university with a 1\'st class award in appropriate subject or field by Oct\'15.\r\n4. Should aim to seek full-time Doctoral research degree from Cambridge University & able to display indication of leadership aspect.','The Dr Manmohan Singh Scholarships aim to back students from India to seek doctoral studies at St John’s College, Cambridge.This Scholarships is eligible for only those students who manage to gets an offer of admission at St John’s College. ','Application process:\r\n1.You should consider a suitable doctoral programme and then visit  www.graduate.study.cam.ac.uk to make a formal application & then must select St John’s College as their 1st choice of college.\r\n2.You should inform on Graduate Studies Application Form (GRADSAF) that you are applying for the Dr Manmohan Singh Scholarships & also to do the section applying to get funding from the university.\r\n3.You should complete the College Application form attached to notify St John’s that you have applied to the University and intend to get considered for the Scholarship & then must submit the form to St John’s by 15 January 2016.','For any queries:\r\n\r\nEmail: drmanmohansinghscholarships@joh.cam.ac.uk\r\nWeblink: http://www.joh.cam.ac.uk/contact-us-3','http://www.joh.cam.ac.uk/dr-manmohan-singh-scholarships',' ','Dr Manmohan Singh Scholarship is for studying PHD at St. Johns College, University of Cambridge in Science, economics and Social Science. Lets apply!','Dr Manmohan Singh Scholarship 2016 - ScholFin',' ','',0,0,0),(243,'Imagine Cup\'16 Game Competiton','Microsoft',3,0,0,0,'2016-04-23 18:07:27',' ',0,0,0,50000,'Each National Final competition may offer prizes at the discretion of the local\r\nMicrosoft subsidiary operating that competition.\r\n\r\nEvery World Semifinalist team who advances to 3rd round will receive a trip to the\r\nImagine Cup 2016 Worldwide Finals in Seattle, Washington, USA, in July, 2016, to compete at\r\nthe World Finals. \r\n\r\nAt the World Finals, the top three teams in the Games Competition will receive the\r\nfollowing cash prizes : \r\nFirst Place:$50,000 USD\r\nSecond Place:$10,000 USD\r\nThird Place: $5,000 USD',1,2,'2015-09-10 18:07:27',0,'Students who are above 16 years of age can apply.','The Imagine Cup Games Competition is a best new student games tournament held at international level.The winning team will be awarded with $50,000(US).\r\n\r\nYour software must be in one of the following formats for installation depending on its platform.\r\nWindows: A standard SETUP.EXE or an .MSI Windows Setup application to install your app on a Windows PC.\r\nWindows Phone: A standard XAP or APPX setup file for deployment to Windows Phone devices.\r\nWindows Azure: The web tier of your project must be deployed to Windows Azure and you must supply the full URL to your site and/or services. \r\n','1.To get an entery into 1st Round , you should register your team on the official website.\r\n2.If your team clears 1st round then you can proceed for round 2 and so on.','Microsoft Corporation \r\nOne Microsoft Way \r\nRedmond, WA 98052 \r\nUSA\r\nE-mail: imagine@microsoft.com, icindia@microsoft.com','https://www.imaginecup.com/category/index/2',' ','Imagine Cup\'16 Game Competiton is for students above 16 years of age which includes creating a game on windows. Let\'s fill the form and apply now!','Imagine Cup\'16 Game Competiton - ScholFin',' ','',0,0,0),(244,'Inlaks Research Travel Grants','Inlaks Shivdasani Foundation ',1,0,0,0,'2016-10-01 10:45:07','1. In the year 2015, 1st October was the last date of submitting completed applications.\r\n2. 1st October,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,0,0,0,'This Scholarships offers financial guidence for a maximum of 3 months at various foregin institutions.\r\nIt will cover:\r\n\r\n1. Reasonable airfare, Maintenance expenses.\r\n2. Funds for buying material and books.',0,0,'2015-09-17 10:45:07',0,'1. You should hold a valid PhD enrollment for at least two years & not more than four years & should be less than 35 years of age on 31 december while applying year.\r\n2. You should hold a 1st class degree of Bachelor’s or Master’s level or preferably both.\r\n\r\nNote: This Scholarships is only available for Humanities and Social Sciences field and the granted Scholarships must be used by students within the nine months of the date of award.','The Inlaks Research Travel Grant is organize to support enrolled PhD. students of Indian institutions to initiate short-term visits to foreign institutions  to gather material, use facilities and to discuss with professionals.','1.You should download the application form from website and then submit Fully filled form for ‘Inlaks Research Travel Grant’ \r\n\r\n2.You should submit a fully documented draft on the subject of the your research and any other analysis done in your subject. \r\n\r\n3.You should show any confirmation of having a discussion with specific authority or with foregin universities & should also give a confirmation  that you have received a positive from them.\r\n\r\n4.The fully filled forms and other enclosures must be submitted by post to the following address\r\n   : 86/87 Atlanta, Nariman Point, Mumbai 400 021\r\n\r\nProcedure for selection:\r\n5. You are expected to go through a two-tier selection procedure.\r\n    a. First round short-listing on the basis of the written record submitted by the students.\r\n    b. Second and final round: Personal interview of the short-listed students.','Delhi\r\nInlaks India Foundation \r\nc/o ICGEB\r\n(International Centre for Genetic Engineering and Biotechnology)\r\nAruna Asaf Ali Marg\r\nNew Delhi 110067\r\nTel : 91-11-26741260 \r\nE-mail: info@inlaksfoundation.org','http://inlaksfoundation.org/inlaks-research-grant.aspx#AppForm',' ','Inlaks Research Travel Grants is for PHD candidates of humanities and social sciences for travelling abroad. Lets fill the form and apply now!','Inlaks Research Travel Grants 2015-16 | ScholFin',' ','',0,0,0),(245,'Erach and Roshan Sadri Foundation Scholarship ','WORLD ZOROASTRIAN ORGANISATION, UK',0,0,0,0,'2016-09-10 10:45:07','1. In the year 2015, 9th September was the last date of submitting completed applications.\r\n2. 9th September,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',3,0,0,0,'Candidates will be preferred who is pursuing specialised degree courses such as in Medical stream,Engineering,Architecture, Designs,Hotel & Hospitality Management,Creative Arts and authorized Vocational courses.',0,0,'2015-09-17 10:45:07',0,'Zoroastrians(Parsis) candidates who are enlisted or applied as full-time students in a college, university or other flourished Universities.\r\nCandidates will be preferred according to the courses pursued in India or over abroad studies. \r\nTheir will no discrimination between eligible students for selection if they have one or both parents born as Zoroastrians(Parsis).','The Erach and Roshan Sadri Foundation Scholarship was initiated in 2008 to extract intellectual excellence & to guide Zoroastrian(Parsis) students pursuing meaningful courses of study in university or vocational programs held at well-established Universities. \r\n','1. The fully filled application form and desired additional information should be sent by post or as a scanned copy by email.\r\n2. Application forms can be recieved by sending an email-request to Sammy Bhiwandiwalla on president@w-z-o.org or can be downloaded from http://w-z-o.org/apply_funding.aspx.','Mr. Sammy Bhiwandiwalla, WZO \r\nEmail: president@w-z-o.org\r\n\r\nInternational office address:\r\nThe President, World Zoroastrian Organisation, “ERSF Scholarship”\r\n11 Beeches Wood, Kingswood, Surrey KT20 6PR, UK\r\n','http://www.w-z-o.org/apply_funding.aspx','http://www.w-z-o.org/downloads/ERSF_grant_appl.pdf','Erach and Roshan Sadri Foundation Scholarship (WORLD ZOROASTRIAN ORGANISATION, UK) is for higher studies in India and abroad for Parsi. Lets fill the form and apply now!','World ZOROASTRIAN Organisation Scholarship 2015-15 | ScholFin',' ','',0,0,0),(246,'ONGC Scholarship for SC/ST Students - 2015','ONGC (Oil and Natural Gas Corporation Limited)',500,0,0,450000,'2015-11-15 18:25:06',' ',0,1,4,4000,' ',0,1,'2015-10-01 18:25:06',0,'1. Candidate should be a student of 1st-year Graduate Engineering or MBBS courses or 1st year of Masters degree in Geology/Geophysics or MBA. The scholarship shall be admissible only for pursuing full-time regular courses by ISC/CBSE/MCI/AICTE/UGC/Associated Universities/State Education Boards/State Government/Central Government.\r\n2. Applicants pursuing 1st year of Master degree (two years course only) in Geology/Geophysics or MBA\r\n3. Candidate should have obtained minimum 60% marks in 12 class for Engineering and MBBS disciplines. Similarly 60% marks are necessary in graduation for P.G. Courses i.e. Geology/Geophysics/MBA. Overall Grade Point Average (OGPA/CGPA) of minimum 6.0 in 10 points scale of grading system. \r\n4.  Maximum 30 years as on October 1, 2015.\r\n5. Students applying should not be availing any other scholarship/financial assistance from any of the source. However, students getting fee waiver/ reimbursement of tuition fees from any of the State governments can apply for the scholarship.\r\n','ONGC Scholarship 2015 will be based on the performance of the students in class 12 in case of admission to Engineering/Medical courses and Graduation in case of admission to Post Graduate courses i.e. Geophysics/Geology/MBA.\r\nFinal list of the scholarships beneficiaries shall be posted on ONGC website by the third week of January, 2016.','1. Eligible candidates can download the ONGC Scholarship application form by clicking on the apply button.\r\n2. Application submitted should be duly verified and forwarded by the respective Head/ Principal/ Dean of the Institute, College or University in which applicant is pursuing his/her studies.\r\n3. Completely filled in application form  with all the required enclosures should reach to the designated office of ONGC on or before November 15, 2015','ONGC Limited,\r\nGreen Hills,Tel Bhavan,\r\nDehradun\r\nPhone: 0135-2792630/56\r\nFax:0135-2759364','http://www.ongcindia.com/wps/wcm/connect/2226a53a-e7d5-413a-b3a6-9ca6c0f54b22/appscst2015.pdf?MOD=AJPERES&CACHEID=2226a53a-e7d5-413a-b3a6-9ca6c0f54b22','http://www.ongcindia.com/wps/wcm/connect/050798df-5f13-4bad-b230-bbc0cc5d2d1a/advtscst2015.pdf?MOD=AJPERES&CACHEID=050798df-5f13-4bad-b230-bbc0cc5d2d1a','ONGC Scholarship 2015 is given to 500 SC/ST students worth Rs 48000 every year. Engineering, MBBS, MBA, Geology, Geophysics students are eligible. Let\'s fill the form an','ONGC Scholarship for SC/ST Students 2015 | ScholFin',' ','',0,0,0),(247,'PM scholarship scheme 2015-16 ','Department of Ex- Servicemen Government of India',4000,0,0,0,'2015-11-30 18:25:06',' ',0,1,5,2250,'PM Scholarship will be given to a total of 4000 students.\r\nRs. 2000 per month for boys. (Paid Annually)\r\nRs. 2250 per month for girls. (Paid Annually)\r\nPM scholarship will be given for a period of two to five years.',0,1,'2015-10-01 18:25:06',0,'1. Students who have taken admission in 2015-16 academic session in degree programme in BE, B Tech, BDS, MBBS, B Ed, BBA, BCA, B Pharma, etc. duly recognized by the respective Government regulatory bodies,such as All lndia Council for Technical Education, Medical council of India,UGC et\r\nMaster Degree Courses are not eligible for PMSS except MBA, MCA\r\n2. Students who have taken admission in 2015 are only eligible to apply for PMSS\r\n2015-16. Students should have scored 60% and above in Minimum Educational\r\nQualification (MEQ) i.e 10+2 / Diploma / Graduation.\r\n3. Students who are Dependent Wards / Widows of Ex Servicemen & Ex Coast Guard\r\npersonnel who died in harness / disabled due to causes attributable to military\r\nservice / coast guard service, irrespective of the rank.\r\n4. Dependent wards of Ex Servicemen / Ex Coast Guard personnel and their widows','Government of lndia has introduced PM scholarship scheme with effect from academic year 2006-07. Prime Minister\'s Scholarship application will be shortlisted based on Ex- Servicemen/ Ex- Coast Guard Category and percentage of marks obtained in Class 12.','1. Complete application to be forwarded on plain A4 size paper (typed or handwritten)\r\n2. Incase of difficulties in downloading the application, it can be obtained from KSB by sending a demand draft for Rs.30 in favour of \"Secretary, KSB\" payable at Delhi.\r\n3. Application form is to be deposited by individual to respective RSB / Directorate General of Coast Guard. Applications duly recommended by RSB/ Directorate General of Coast Guard will be considered by KSB.\r\n4. Superscription on the envelope: “Prime Minister’s Scholarship Scheme for the Academic Year 2015-16”\r\n5. Students should not send the PM Scholarship application form directly to KSBs.','Joint Director Training and Scholarship\r\nKendriya Sainik Board, MOD, West Block-4, Wing-7, 2nd Floor\r\nRK Puram, New Delhi-110066\r\nTel :011 26715250\r\nE-mail: jdpmscholarshipksb@gmail.com, pmscholarship@yahoo.co.in','http://www.desw.gov.in/sites/upload_files/desw/files/Application%20Form%20-%202015-16.pdf','http://www.desw.gov.in/sites/upload_files/desw/files/Information%20Brochure%20-%202015-16.pdf','PM scholarship scheme 2015-16  is given to 4000 students worth Rs2250 every year upto 5 years. BE, B Tech, BDS, MBBS, B Ed, BBA, BCA, B Pharma,MBA, MCA etc are eligible.','PM scholarship scheme 2015-16 | ScholFin',' ','',0,0,0),(248,'Ideapod Scholarship 2015','Ideapod',1,0,0,0,'2015-12-31 18:25:06',' ',0,0,0,2000,' ',1,0,'2015-10-01 18:25:06',0,'The candidate should be enrolled in a undergraduate or postgraduate degree program at recognized University across the world.','Interested candidates have to create an idea on Ideapod responding to the question \"what will Artificial Intelligence mean for work?\"\r\nIdeas can be up to 1000 characters long\r\nIt can include an image or YouTube/Vimeo video.','1. Ceate an account on Ideapod\r\n2. Uploaded the link of the idea and make sure to include the hashtag #futureofwork in the text of your idea.',' ','https://www.ideapod.com/scholarship',' ','Ideapod Scholarship 2015 is for undergraduate and post-graduate students of any nationality with scholarship of $2000. Let\'s fill the form and Apply now.','Ideapod Scholarship 2015 | ScholFin',' ','',0,0,0),(250,'5th Scholarship For Excellence In English (SEE) 2015-16 ','cience Olympiad Foundation and the British Council',120,0,0,0,'2015-12-31 18:25:06',' ',0,0,0,5000,'The Student will also receive a Merit Certificate as recognition of her/his excellence in English language.\r\nIt is a one time scholarship',0,0,'2015-10-01 18:25:06',2,'1. Class 3-10 students are eligible to apply.\r\n2. Only school can send the recommendations to SOF for SEE.\r\n3. The school must be a participant in the IEO 2016\r\n4. The student should have scored atleast 90% marks or equivalent grade in English subject in annual aggregate in previous class\r\n5. The student should have scored at least 85% or equivalent grade in previous year\'s exam as aggregate\r\n6. Student should score at least 80% marks in the IEO exam to be conducted in 2016','The scholarship is based on the recommendation of the principal/ head master/ head mistress.\r\nThe student who would be recommended will have to sit for the IEO exam to be conducted in Jan 2016.\r\nThe Selection of the SEE winners will be done from recommendations sent from school.','1. The application has to be sent through school, the school should be a participant in IEO to be conducted in Jan 2016\r\n2. Recommendation should be signed by the school Principal/Head Master/Head Mistress only\r\n3. Recommendation has to be in the enclosed format.','Admin Office : IIIrd Floor Plot 99, Sec - 44, Gurgaon - 122003 (Haryana)\r\nRegd Office : B-8, Taj Apartment, Ring Road, Adjacent Safdurjung Hospital, New Delhi - 110029\r\nMobile: 09312680857\r\nTelefax: 0124-4951200 \r\nEmail: info@sofworld.org','http://www.sofworld.org/sites/default/files/RECOMMENDATION%20FORM%20(SEE)_3.pdf',' ','5th Scholarship For Excellence In English (SEE) 2015-16 is for class 3-10 students. 120 students will be awarded Rs500 each. Let\'s fill the form and apply now.','5th Scholarship For Excellence In English(SEE)2015| ScholFin',' ','',0,0,0),(251,'TiEcon Nagpur Startup Scholarship (Startup Showcase)','TiE Nagpur',5,0,0,0,'2015-10-20 19:25:07',' ',0,0,0,0,'Top 5 scholarship winners will get a chance to showcase their startup in the TiEcon Nagpur 2015 conference. The BEST startups will BE BESTOWED WITH personalised GUIDANCE from one of the MOST SUCCESSFUL AND PROLIFIC investor MENTORS IN THE STARTUP COMMUNITY.',0,0,'2015-10-04 19:25:07',0,'1. You must be a startup (Startups at the ideation stage are not eligible to participate).\r\n2. Each individual team member from the startup must have registered for TiEcon Nagpur 2015.','1. What is TiE? \r\n\r\nThe Indus Entrepreneurs, TiE, is the most celebrated and largest non-for-profit organization, founded in Silicon Valley in 1992, working passionately towards fostering entrepreneurship around the world. TiE today has 61 chapters in 18 countries. TiE Nagpur chapter was inaugurated in Feb. 2009 by legendary international management guru (late) Prof. C.K. Prahalad. Tie Nagpur is one of the most vibrant and celebrated chapters in India.\r\n\r\n2. What is TiEcon Nagpur 2015?\r\n\r\nToday India is witnessing the rise of unicorns & dec acorns, disrupting the way businesses are done & customers are served. With speed & velocity as the new rules of the game, “the faster fish is eating (acquiring) the bigger fish”; & therefore the theme for this TiEcon is “The New Age Entrepreneurship”.\r\n\r\n3. What is TiEcon startup scholarship?\r\n\r\nTiEcon Nagpur Startup Scholarship 2015 is for startups who have a working prototype.The BEST startups will BE BESTOWED WITH personalised GUIDANCE from one of the MOST SUCCESSFUL AND PROLIFIC investor MENTORS IN THE STARTUP COMMUNITY.','You have to complete the online application form with details of your startup by 18th October 2015.','TiE Nagpur\r\nPlot No 15, Dandige Layout, Shankar Nagar\r\nNagpur, Maharashtra – 440010\r\nPhone: (0712) 6464066\r\nMobile: 9623382239\r\n           9595568009\r\n           7350640608','https://scholfin.formstack.com/forms/tiecon_startup_scholarship',' ','TIEcon Nagpur Startup Scholarship 2015 is for entrepreneurs and startups. The startups will get personalised one to one mentoring from one of the best investors.','TIEcon Nagpur Startup Scholarship 2015 | ScholFin',' ','',0,0,0),(252,'Young India Fellowship ','Ashoka University',225,0,0,0,'2016-02-28 19:25:07','1. Last date to submit applications for 1st round - 15th Dec 2015\r\n2. Last date to submit applications for 2nd round  28th Feb 2016',0,0,1,700000,'1.)The Fellowship includes:\r\n\r\na.) Tuition fees\r\nb.) All material, including shared text books\r\nc.) Fully furnished residence\r\n\r\n2. The average cost of the programme per Fellow is INR 7 lakhs with an additional INR 75,000 as food cost. Each Fellow is sponsored fully or partially by a sponsor.',0,0,'2015-10-04 19:25:07',0,'1.) You must have a recognized undergraduate or postgraduate degree in any discipline\r\n2.) You must not be more than 28 years of age as of 31 May, 2016\r\n3.) You must not got more than 3 years of work experience\r\n4.) You must have good academic and extra curricular engagement through school and college','The Young India Fellowship (YIF) is a one-year multidisciplinary postgraduate diploma programme in\r\nLiberal Studies at Ashoka University. The Fellowship brings together a group of bright young men and\r\nwomen who show exceptional intellectual ability and leadership potential, from across the country, and\r\ntrains them to become socially committed agents of change. ','1. You should apply online by registering yourself on the YIF website.\r\n2. You should download the application from the YIF website and fill it and send it to YIF office address mentioned below:\r\n\r\nOffice Address:\r\nYoung India Fellowship Programme,\r\nAshoka University,\r\nRajiv Gandhi Education City,\r\nKundli, Sonepat\r\nHaryana- 131029','Young India Fellowship\r\nPlot #2, Rajiv Gandhi Education City, \r\nKundli, Haryana - 131028 (India)\r\nContact No. : +91 8199977078 / +91 8199977076 \r\n+91 8222930504 / +91 9958293745 \r\nFor admissions queries: yifadmissions@ashoka.edu.in \r\nFor any other queries: yifinfo@ashoka.edu.in','http://yifp.in/Apply.aspx','http://yifp.in/Uploads/Brochure/YIF-Student-flyer2016.pdf','The Fellowship brings together a group of bright young men and women who show exceptional intellectual ability and leadership potential, from across the country, and trai','Young India Fellowship 2015-16','','',0,0,0),(253,'Gandhi Fellowship Program ','Kaivalya Education Foundation and Piramal Foundation',163,0,0,0,'2015-12-31 17:23:20','1. In the year 2015, 31st December was the last date of submitting completed applications.\r\n2. 31st December,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines. ',0,1,2,14000,'Scholarships includes:\r\n\r\n1.)monthly grant of Rs. 14,000\r\n2.)monthly phone allowance of Rs. 600\r\n3.)rent-free accommodation and other allowances as applicable.',0,0,'2015-10-12 17:23:20',0,'We are looking for students of top colleges across India who have demonstrated leadership quality through their work in both academic as well as extracurricular activities.\r\n\r\nExtracurricular leadership can be identified in the form of school captain of sports / art club teams, house captain, president or secretary of college events, participation at state / national / international level competitions.\r\n\r\nEntrepreneurial activities will be considered for leadership experience.','As a catalyst for school change, each fellow brings change in 5 schools by being a resource person for the school principals and by potentially impacting the lives of 1,000 children. Fellows assist teachers and identify when and where Headmasters (Principals) need extra support. Fellows interact and work with teachers, community members and education officials towards the goal of creating model schools.','1.) You should apply by submitting the online application form on the official website.','A 56 Panchsheel Enclave, \r\nNear Soami Nagar Bus Stop, \r\nNew Delhi-110017 \r\nPhone: 01126493385\r\n          +91 8800827862\r\nEmail: qasim@gandhifellowship.org','http://apply.gandhifellowship.org/','http://gandhifellowship.org/','Gandhi Fellowship Program is for students of top colleges demonstrated leadership quality with a monthly stipend of Rs 14,000. Lets apply now!','Gandhi Fellowship Program 2015-16 | ScholFin','','',0,0,0),(254,'Newcastle University India Scholarships 2016','  Newcastle University',10,0,0,0,'2016-06-30 17:23:20','1.) 30th June ,2016 is the last date of submitting completed applications.\r\n\r\n2.) You should check this page again for updated deadlines.',0,0,0,5000,'Scholarship award will include:\r\n\r\n1.) For U.G. (aspired)Candidates:  £5,000\r\n\r\n2.) For P.G. (aspired)candidates:   £3,000',3,0,'2015-10-12 17:23:20',0,'1.)You must be a Indian national and have been assessed as international/overseas for fees purposes\r\n\r\n2.)You must hold a Conditional or Unconditional offer on any master’s degree programme at Newcastle city campus\r\n\r\n3.)You intend to register to start your studies during the 2016-17 academic year\r\n\r\n4.)You are a self-funded student and not in receipt of other University or external awards\r\n\r\n5.)You must have an average of 60% or above in your Bachelors degree. If you are yet to complete your degree we will assess you on the basis of your results to date, providing you have    achieved an average of 60% or above and you are expecting to maintain/ increase this in your final semester/year.  Students with C.G.P.A scores can also apply if your percentage equivalence is 60% and above','Newcastle University India Scholarship financially support students of India to pursue their master’s degree program in Newcastle University, UK.','1.You should fill the application form online through the website & should attached the documents required with it. \r\n','International Office\r\nNewcastle University\r\nKing\'s Gate\r\nNewcastle upon Tyne\r\nNE1 7RU\r\nUnited Kingdom',' https://app.geckoform.com/public/#/form/A8zCMVfK',' http://www.ncl.ac.uk/postgraduate/funding/sources/internationalnoneustudents/nuindia.html',' ',' ',' ','',0,0,0),(256,'MTSE (Maharashtra Talent Search Examination)','Maharashtra Government',7,0,0,0,'2015-12-05 17:23:20','1.) MTSE 2016 will be held on April 23, 2016 (Saturday 10 AM -1 PM).\r\n\r\n2.) The last date to apply for MTSE 2016 is on December 5, 2015 without late fees and with late fees it is December 19, 2015.',0,0,0,1000,'1.) Students appearing in the state level merit list will be awarded state scholarship of Rs.1000 each for one year.\r\n\r\n2.) Students who could not secure place in the State level merit list but have made it in the District Level Merit List will be awarded to the District Scholarships of Rs. 400.\r\n\r\n3.)The number of students selected for the award of MTSE scholarships at state / district level depends upon the number of students appearing for the examination from the entire state and the marks secured.\r\n\r\n4.)Rs. 200 each will be awarded for those students who could not be awarded State or District Scholarships but have secured marks more than particular marks.\r\n\r\n5.)Rs. 125 each for one year for those students who could not awarded State or District Scholarships but have done well in their Talukas.\r\n\r\n6.)Besides these scholarships, some students will be awarded consolation prizes of Rs. 75.\r\n\r\n7.)Rs. 5000, Rs. 3000 & Rs. 2000 will be awarded to the first three students in the state level merit lists of rural and urban areas for each standard. A special prize of Rs. 500 will be awarded to a student standing first in each paper & every section of written examination.\r\n\r\n8.)Rs. 400 will be awarded to a certificate holder having   maximum marks amongst Hindi, Urdu, Gujarati and Kannad medium students.\r\n\r\n9.)The students securing 70 marks or more out of 200 in written examination will be awarded a certificate of merit. ',0,1,'2015-10-12 17:23:20',0,'1.) Students from Class 8-10 from recognized government schools are eligible to apply.\r\n2.) Students appearing for MTSE Class 9 should not have appeared for MTSE Class 8.\r\n3.) Students participating MTSE Class 10 should not have appeared for MTSE Class 8 & 9.','MTSE (Maharashtra Talent Search Examination) 2016 is a talent search exam conducted by N. Wadia College, Pune which aims to search talented students and to equip the students for NTS (Class 10) and other competitive examinations in future.\r\n','1.) You should download MTSE 2016 Application Form online from the official MTSE website.\r\n\r\n2.) You should obtain application form by paying the fees of Rs.150  in advance by cash. The address of MTS office is -\r\nMaharashtra Talent Search Examination\r\nN. Wadia College Campus,\r\nPune - 411001\r\n\r\n3.) You should get the  MTSE 2016 Application Form by sending MO/DD of Rs.200 to:\r\nThe DD should be drawn in the name of -Hon. Director, MTS Examination, Pune and payable at Pune.\r\n\r\nHon\'bl Director \r\nMaharashtra Talent Search Examination \r\nCompetitive Examination Guidance Centre, \r\nN. Wadia College Campus, \r\nPune - 411001\r\n\r\n4.)You should obtain the Application Form from the Headmaster / Principal of the school. Students will have to pay Rs. 150 for each form while filling the application form in school and should submit the completely filled application form in the school itself.\r\n\r\n5.) You should obtain the forms from the Coordinators: There are number of co-ordinators working in this project at District, Taluka and Bit levels. The application forms are also available with them. The Schools and Students may collect the forms from these co-ordinators and submit the completely filled application forms along with the Fees of Rs. 150. List of Coordinators','Hon\'ble Director,\r\nMaharashtra Talent Search Examination\r\nCompetitive Examination Guidance Centre,\r\nPune – 411001\r\n\r\nPhone No.         : 020 - 26168486\r\nFax                   : 020 - 26161479\r\nEmail.               : ctsewadia@gmail.com ',' http://www.mtsexam.org/MTSForm.pdf',' http://www.mtsexam.org/',' ',' ',' ','',0,0,0),(257,'RMIT Australia Undergraduate Scholarship 2016','RMIT University ',15,0,0,0,'2015-10-12 17:23:20','1.) December 1, 2015 is the last date of submitting completed applications.\r\n\r\n2.) You should check this page again for updated deadlines. \r\n ',0,2,0,25000,'The scholarship will be paid at AU$5,000 per year for the duration of the program.\r\n\r\n1.) For  2 year programs: AU$10,000\r\n\r\n2.) For  3 year programs: AU$15,000\r\n\r\n3.) For  4 year programs: AU$20,000\r\n\r\n4.) For  5 year programs: AU$25,000',1,0,'2015-10-12 17:23:20',0,'1.) You should be aim to persue an undergraduate degree program at RMIT’s College of Science, Engineering and Health\r\n\r\n2.) You should be an Indian citizen and should be applying from India\r\n\r\n3.) You should be enrolled in a Bachelor degree program offered by the College of Science, Engineering and Health in 1 Semester 2016.\r\n','RMIT Science Engineering & Health scholarships offered by RMIT University fiancailly support Indian International Students to persue an undergraduate degree program at RMIT’s University.','1.) You should select the program for which you are eligible & after that you should submit the application form for the same to RMIT. If the you receives an offer to study at RMIT in Semester 1, 2016 then you can apply for the Scholarship.\r\n\r\n2.) Yoy should fill the Scholarship Application Form available at the official website','RMIT University, \r\nGPO Box 2476, \r\nMelbourne VIC 3001 Australia\r\n\r\nPhone: +61 3 9925 2000','http://www1.rmit.edu.au/browse;ID=3il5jjkgsuma','http://www1.rmit.edu.au/browse/Current%20students%2FWork%20and%20study%20opportunities%2FScholarships/',' ',' ',' ','',0,0,0),(258,'Israel Government Scholarship for Foreign Students 2016','Israel Government',10,0,0,0,'2015-10-12 17:23:20','1.) November 28, 2015 is the last date of submitting completed applications.\r\n\r\n2.) You should check the page again in the month of for updated deadlines. \r\n',0,0,0,0,'1.) Depending on the type of Scholarship offered to the candidate (Full or Partial), either complete tuition fee will be paid or a part of the Tuition fee will be paid by the Israel government.\r\n\r\n2.) A monthly allowance will be given to the candidates for 8 months during their First academic year of studies.\r\n\r\nBasic Health Insurance: The Candidates will be covered with basic health insurance plan offered by Israel government.',0,0,'2015-10-12 17:23:20',0,'1.) You must be an India nationality to make applications for the scholarship with an age younger than 35 years.\r\n\r\n2.)You should have Master\'s Degree in relevant field with 60% marks or more for applying to the subjects Agriculture, Chemistry, Biology, Biotechnology, Environment studies  and Master\'s Degree in relevant field with 55% marks for the remaining subjects.\r\n \r\nNote: Applications of candidates who are already settled in abroad will not be considered.','Israel Government Scholarship for Foreign Students 2016 offered by Israel Government aims to financially support & encourage Indians students to pursue their higher education in various institutes in Israel. ','1.) You should download & submit the application form the website.\r\n\r\n2.) You should attached the letter describing the field the you intends to study in Israel, specifying the University.\r\n\r\n3.) You should attached the following documents along with the application form.\r\n    \r\n     a.Curriculum Vitae\r\n     b.Attested & Valid Academic Records\r\n     c.Atleast 2 letters of recommendations from lecturers/professors\r\n     d.Three photographs\r\n     e.Certifacite of Health\r\n\r\n4.) You should submi tthe application form along with documents on the website itself','Israel Embassy\r\n3 Aurangzeb Road\r\nNew Delhi 110011\r\n\r\nE-mail: scholarship@mfa.gov.il, info@newdelhi.mfa.gov.il\r\nTel: +91 11 30414500\r\n','http://mfa.gov.il/MFA/AboutTheMinistry/Documents/Scholarshipapplication.pdf','http://mfa.gov.il/MFA/AboutTheMinistry/Documents/scholarshipinstructions.pdf',' ',' ',' ','',0,0,0),(259,'Swiss Government Excellence Postdoctoral Scholarship 2016-17','Swiss Government',7,0,0,0,'2015-11-12 17:23:20','1.) 12th November,2015 is the last date of submitting completed applications.\r\n\r\n2.) You should check this page again for updated deadlines. \r\n',0,1,1,240000,'Scholarships includes the following rewards:\r\n\r\n1.) A monthly allowance of 3500 Swiss Francs (Approx. INR 2,40,000) \r\n2.) No tuition fee will be charged from the selected candidates for their studies.\r\n3.) Health Insurance.\r\n4.) Air fare expenses.\r\n5.) Housing Allowance of 20,000 will be provioded.\r\n6.) The candidates will get 1 year half-fare public transportation card.',8,1,'2015-10-12 17:23:20',1,'1.) You must be an India nationality to make applications for the scholarship with an age younger than 35 years.\r\n\r\n2.) The candidate making application should have Ph.D. degree obtained not before 5 years.','Swiss Government Excellence Postdoctoral Scholarship 2016-17 offered by Swiss Government aims to financially support Indians Ph.D. Scholars from all academic fields to pursue their research work in various Swiss Universities.','1.) You should obtain an application form by sending an email to Swiss Embassy, New Delhi.\r\n\r\n2.) You should attached the following documents along with application form\r\n\r\n     a.Copies of Passport and Photographs\r\n     b.Curriculum Vitae\r\n     c.Academic Documents\r\n     d.Research Proposal\r\n     e.Recommendation Letters\r\n     f.Confirmation letter from Swiss Professor\r\n     g.Health Certificate\r\n\r\n3.) You should submit all the attested documents along with the application form at Swiss Embassy office,New Delhi.','Swiss Embassy in New Delhi\r\nNyaya Marg, Chanakyapuri,\r\nNew Delhi- 110021. \r\n\r\nE-mail: ndh.scholarship@eda.admin.ch\r\nTel: +011 4995 9500\r\nWeb: www.eda.admin.ch/newdelhi','