ducation and Research\r\nG5, Swiss Complex, 33, Race Course Road, Bengaluru – 560001\r\nEmail:office@faer.ac.in','Foundation for Advancement of Education and Research\r\nG5, Swiss Complex, 33, Race Course Road, Bengaluru – 560001\r\n\r\nEmail:office@faer.ac.in','http://faer.ac.in/motorola/msp2015_16/msa_program_2015_16.pdf',' ',' ',' ',' ','',0,0,0),(262,'Central Sector Scholarship for Top Class ST Students ','Ministry of Tribal Affairs',0,0,0,200000,'2015-10-30 17:23:20','1.) October 30, 2015 is the last date of submitting completed applications.\r\n\r\n2.) You should check this page again for updated deadlines. \r\n  ',0,2,0,200000,'1.)Scholarship once awarded will continue till completion of the course subject to satisfactory performance.\r\n\r\nScholarships will cover:\r\n\r\na.)Full amount of tuition fee and other non-refundable dues in respect of Government/Government-funded institutions.\r\nb.) In case of students studying in private sector institutions a ceiling of Rs. 2.00 lakh per annum per student will apply normally\r\nc.)In case of students in private sector flying clubs for Commercial Pilot Training the ceiling is Rs. 3.72 lakh per annum per student\r\nd.)Living expense up-to Rs. 2200 per month per student.\r\ne.)Expenses related to books up-to Rs. 3000 per annum per student.\r\nf.)Cost of a latest computer along with accessories limited to Rs. 45,000/- as one time assistance during the entire course is paid to the student. ',0,1,'2015-10-12 17:23:20',0,'1.) Student must be of Indian nationality belonging to Scheduled Tribe Category.\r\n\r\n2.) Student must be a 12th pass-out student having secured admission in notified Institutions.\r\n\r\n3.) Student Studying in the Top Class Institutions would only be able to apply for the Top Class Scheme.The   List of Institutions are finalized by the Ministry /Department\r\n\r\n3.) Student Family Annual Income must not exceed more than Rs. 2 lakhs per annum.','Central Sector Scholarship Scheme for Top Class ST Students offered by Ministry of Tribal Affairs financially support ST students for pursing studies at Degree and Post Graduate level in various notified institutions.','1.) You should apply and fill the application form through the website only.','Ministry of Tribal Affairs\r\nGround floor, \'D\' wing, Shastri Bhawan, \r\nNew Delhi-110001\r\n\r\nHelp Line Numbers - 040-23120300 (All weekdays 9:00 AM - 5:30 PM)','http://registrations.scholarships.gov.in/loginpage.do;jsessionid=D743A930BB75F27CAD8FFFD44DBF5548',' ',' ',' ','http://scholfin.com/dashboard/','',0,0,0),(263,'KSCSTE Research Fellowship 2015- Kerala ','Kerala State Council for science, Technology & Environment (KSCSTE)',100,0,0,0,'2015-10-31 17:23:20','1.) October 31, 2015 is the last date of submitting completed applications.\r\n\r\n2.) You should check this page again for updated deadlines. \r\n ',0,1,3,34000,'Scholarships includes:\r\n\r\n1.) Monthly stipend of Rs. 16,000 for the first two years. \r\n\r\n2.) Housing Rent Allowance: Rs. 18,000 per month.\r\n\r\n3.) An annual contingency of Rs.20000 will be offered.',0,0,'2015-10-12 17:23:20',0,'1.)Student must be of Indian nationality and should not be be more than 35 years old as on January 1, 2016.\r\n\r\n2.)Student should have awarded MSc/M-Tech degree in any of the Mathematical Sciences, Life Sciences, Physical Sciences, Chemical Sciences, Earth, Atmospheric, Ocean and Planetary Sciences, Engineering Sciences and Environmental Sciences subjects.\r\n\r\n3.)Student should be from among the 1st ten rank /position holders from any of the Universities in Kerala.','KSCSTE Research Fellowship Scheme is offered by Kerala State Council for science, Technology & Environment (KSCSTE) which aims to support MSc/M.Tech rank holders from the Universities in Kerala to pursue their Ph. D. work.','1.) You should submit the application online through the website.\r\n\r\n2.) You should attached the following documents along with application form:\r\n \r\n    a.) A passport size photo.\r\n    b.) MSc./ M.Tech Certificate.\r\n    c.) Rank/position certificate.\r\n    d.) Birth Certificate.\r\n\r\n3.) You should send the completely filled application form to the address mentioned below.\r\n\r\nThe Head\r\nBasic Science Division\r\nKerala State Council for Science, Technology and Environment (KSCSTE)\r\nSasthrabhavan, Pattom, Thiruvananthapuram\r\nPin 695 004 KERALA ','SasthraBhavan, Pattom,\r\nThiruvananthapuram 695004\r\nKerala, INDIA.\r\nTel: ++91 + 471 2548254\r\nFax: ++91 + 471 2548254\r\nE-mail: bdskscste@gmail.com\r\nWebsite.www.kscste.kerala.gov.in','http://www.scigate.kerala.gov.in/fellowship/agree.php','http://www.scigate.kerala.gov.in/fellowship/',' ',' ',' ','',0,0,0),(264,'Swiss Government Excellence Research Scholarship 2016-17 ','Swiss Government',7,0,0,0,'2015-10-12 17:23:20','1.) 12th November,2015 is the last date of submitting completed applications.\r\n\r\n2.) You should check this page again for updated deadlines. \r\n ',0,1,1,130000,'Scholarships includes the following rewards:\r\n\r\n1.) A monthly allowance of 1920 Swiss Francs (Approx. 1,30,000 INR ) \r\n2.) No tuition fee will be charged from the selected candidates for their studies.\r\n3.) Health Insurance.\r\n4.) Air fare expenses.\r\n5.) Housing Allowance of 20,000 will be provioded.\r\n6.) The candidates will get 1 year half-fare public transportation card.',8,1,'2015-10-12 17:23:20',0,'1.) You must be an India nationality to make applications for the scholarship with an age younger than 35 years.\r\n\r\n2.) You should have a Master’s or Equivalent Degree recognized by Swiss Universities.\r\n\r\nNOTE:\r\n\r\n1.) Students who are in Switzerland for more than one year are not eligible for the Scholarship.\r\n2.) Applicants who have already been awarded with Swiss Government Excellence Research Scholarship are not eligible for making application second time.','Swiss Government Excellence Postdoctoral Scholarship 2016-17 offered by Swiss Government aims to finan