ould have a Master’s or Equivalent Degree recognized by Swiss Universities.\r\nNOTE:\r\n1. Students who are in Switzerland for more than one year are not eligible for the Scholarship.\r\n2. Applicants who have already been awarded with Swiss Government Excellence Research Scholarship are not eligible for making application second time. ','Swiss Government Excellence Postdoctoral Scholarship 2016-17 offered by Swiss Government aims to financially support post graduate students from all academic fields, who want to pursue Ph.D. from Switzerland and allows the selected candidates to spend 3 years in Switzerland doing their Ph.D. from any of the 10 Swiss Public Universities, Federal Institutes of Technology and Teaching & Research Institutes','1. You should obtain an application form by sending an email to Swiss Embassy, New Delhi.\r\n2. You should attached the following documents along with application form\r\n     a.Copies of Passport and Photographs\r\n     b.Curriculum Vitae\r\n     c.Academic Documents\r\n     d.Research Proposal\r\n     e.Recommendation Letters\r\n     f.Confirmation letter from Swiss Professor\r\n     g.Health Certificate\r\n3. You should submit all the attested documents along with the application form at Swiss Embassy office,New Delhi.','Swiss Embassy in New Delhi,\r\nNyaya Marg, Chanakyapuri,\r\nNew Delhi- 110021.    \r\n\r\nE-mail: ndh.scholarship@eda.admin.ch\r\nTel: +011 4995 9500\r\nWeb: www.eda.admin.ch/newdelhi ','http://www.sbfi.admin.ch/themen/01366/01380/02593/02676/index.html?lang=en',' ',' ',' ','http://scholfin.com/scholarship-details/Swiss-Government-Excellence-Ph-D-Scholarship-2016-17/','',0,0,0),(266,'Commonwealth Medical Fellowships 2016 ','UK Department for International Development (DFID) ',0,0,0,0,'2015-10-19 17:23:20','1.) You should submit the application to the nominating agency by November 19, 2015  and the nominating agency should forward the application to CSC by December 17, 2015.',0,1,1,1175400,'Fellowship rewards includes:\r\n\r\n1.) Airfare\r\n\r\n2.) Living Allowance: of £1,580 (Rs.158000) per month and £1,959 (195900) per month for those at universities in the London metropolitan area.\r\n\r\n3.) Arrival allowance\r\n\r\n4.) Study Travel Grants\r\n',0,0,'2015-10-12 17:23:20',0,'1.) You must be a Commonwealth citizen, refugee, or British protected person\r\n2.) You must be a permanent resident in a developing Commonwealth country\r\n3.) You must be employed by a hospital affiliated to a university\r\n4.) You should have been nominated to the CSC by an eligible institution\r\n5.) You should have been qualified as a doctor or dentist between October 1, 2006 and September 30, 2009 or before October 1, 2001','Commonwealth Medical Fellowships are offered by UK Department for International Development (DFID) to financially support and to provide mid-career medics and dentists from developing Commonwealth countries with the opportunity to enhance their clinical skills, and to have catalytic effects on their workplaces.\r\n','CSC does not accept direct applications for these scholarships. However, You should apply via any one of the following nominating bodies in the first instance:\r\n\r\n1.) In Pakistan, through the Higher Education Commission\r\n2.) Selected universities/university bodies, which can nominate their own academic staff at affiliated hospitals\r\n3.) In Bangladesh, India, and Sri Lanka, through the national University Grants Commission.\r\n4.) You should submit the application form and get endorsed it by one of the approved nominating bodies listed above.\r\n\r\nNote:\r\n1.) All applications must be made through your nominating body in your home country.\r\n2.)The CSC will not accept any applications that are not submitted via the EAS to a nominating body in your home country.\r\n\r\n','Woburn House \r\n20-24 Tavistock Square \r\nLondon WC1H 9HF \r\nUnited Kingdom\r\n\r\n eas@cscuk.org.uk','http://cscuk.dfid.gov.uk/apply/medical-fellowships/','http://cscuk.dfid.gov.uk/apply/eas/applicants/medical-fellowships/',' ',' ','http://scholfin.com/static/scholarship/images/comp.png','',0,0,0),(267,'Fedbank Hormis Memorial Foundation Scholarships','Fedbank Hormis Memorial Foundation',20,0,0,0,'2015-11-01 09:51:59','1. In the year 2015, 1st November was the last date of submitting completed applications.\r\n2. 1st November,2016 date is expected date. You should check the page again in the month of August-September for updated deadlines.  ',3,2,4,100000,'100% of the tuition fees as per the fee structure for seats allotted in the Government quota in Govt., Aided and Self-financing colleges, subject to a maximum of Rs. 1,00,000/- in a year up to the normal completion of course.',0,0,'2015-10-23 09:51:59',1,'Medicine (MBBS), Engineering (B.E/B.Tech), Agriculture (B.Sc), Nursing (B.Sc) and MBA courses.','Fedbank Foundation Scholarship is for engineering, medical, B.sc & MBA students in Kerela, Maharashtra, Tamil Nadu and Gujarat.','1.You should download the application form & should attached the documents required with it. \r\n2.You should submit the application form to the address mentioned on website.\r\n','Email : csr@federalbank.co.in\r\nEmail : contact@federalbank.co.in\r\nEmail : fednetinfo@federalbank.co.in\r\nTel : 1800-425-1199 Or\r\n       1800-420-1199\r\n       +91-484-2630994 \r\n       +91-484-2630995',' http://www.federalbank.co.in/scholarships',' ','Fedbank  Foundation Scholarship is for engineering,medical,B.sc & MBA students in Kerela,Maharshtra,Tamil Nadu and Gujarat.Let\'s fill the form and apply.','Fedbank Hormis Memorial  Scholarships 2015 - Scholfin','http://scholfin.com/scholarship-details/Fedbank-Hormis-Memorial-Foundation-Scholarships/',' ',0,0,0),(268,'Excellence Master Fellowship 2015 | Study in Switzerland ','University of Geneva',0,0,0,0,'2016-03-15 18:29:25',' ',0,2,2,10000,'1. Fellowship award of CHF 10,000 (Approx 6.5 lacs) to CHF 15,000 (Approx 10 lacs) will be given to final shortlisted fellows.\r\n2. The duration of this fellowship will be for 1 year and it will continue the completion of your Mater\'s course if the student is showing good academic results.',7,0,'2015-12-10 15:26:32',0,'1. You should have a bachelor\'s degree or expected to complete your graduation within 6 months.\r\n2. You should lie among the top 10% of your bachelor\'s program.','Excellence Fellowship Program is for brilliant and talented students who intend to pursue a Master\'s degree in Science from University of Geneva in the following field:  \r\n1. Mathematics\r\n2. Computer Science\r\n3. Physics\r\n4. Chemistry\r\n5. Biochemistry\r\n6. Biology\r\n7. Prehistoric Archaeology\r\n8. Geology\r\n9. Environmental Science\r\n10. Pharmacy\r\n11. Neuroscience\r\n12. Proteomics & Bioinformatics','1. Click on the apply button and download the application form.\r\n2. Fill the form, convert it into PDF format and send your application via email to Excellence-Master-Sciences@unige.ch\r\n3. Following documents are necessary to be attached along with your from:\r\n    a. Resume or Curriculum Vitae which includes your transcript of all the courses passed during your Graduation along with grades.\r\n    b. A two-page essay which conveys your specific interests, the course you would like to pursue for your Master\'s degree and the inspiration  and intentions to pursue Master\'s at University at Geneva.\r\n    c. Two letter of recommendations from Professors (Not mandatory)\r\n    d. Any other vital information like GRE or TOEFL scores or language tests.','Faculty of Science\r\n30, quai Ernest-Ansermet\r\nCH-1211 Genève 4\r\nPhone: ++41 22 37 96111\r\nFax: ++41 22 37 96698\r\nEmail: Excellence-Master-Sciences@unige.ch','http://www.unige.ch/sciences/Enseignements/Formations/Masters/ExcellenceMasterFellowships_en.html',' ','Excellence Master Fellowship 2015 is for Graduate students who want to pursue Master\'s degree in Switzerland with grant amount upto 10 lacs. Let\'s fill the form and apply.','Excellence Master Fellowship 2015 to Study in Switzerland','http://scholfin.com/scholarship-details/Swiss-Government-Excellence-Ph-D-Scholarship-2016-17/','',0,0,0);
